	(25, 'ACDC Fly on the Wall Mens T-Shirt', '\n\n        Represent your favorite musical artist with this retro graphic tee! Officially Licensed Art From Goodie Two Sleeves.\n    \n\n\n\n\n\n\n\nWidth (in)\nLength (in)\nSleeve (in)\n\n\n\n\nS\n18\n28\n15.625\n\n\nM\n20\n29\n17\n\n\nL\n22\n30\n18.5\n\n\nXL\n24\n31\n20\n\n\n2XL\n26\n32\n21.5\n\n\n3XL\n28\n33\n22.875\n\n\n4XL\n30\n34\n24.25\n\n\n5XL\n32\n35\n25.375\n\n\n\n\n\n\n\n\n\n', 2199, 'https://media.gamestop.com/i/gamestop/11157809/ACDC-Fly-on-the-Wall-Mens-T-Shirt?$pdp2x$,', 16, 5),
	(26, 'Wow! PODS Pixar Toy Story Buzz Lightyear Figure', '\n\n        WOW! PODS are for fans of character brands; girls, boys and adults alike! WOW! PODS are also the first collectible that’s brought to life with light! Each character is located in their own hex-shaped POD with built in UV lights. Simply swipe across the sensor to light your WOW! POD using your hand. See your chosen character, along with a hidden mystery feature or icons, instantly revealed with light! Connect them together in seconds to create any size and shape of your display, limited only by your imagination! A wall of WOW! PODS that pop as you walk past them or a shelf display that you add to over time? You can even write your name or initials to create a display that it is undoubtedly and uniquely yours! And now you scan the QR code on the card (included) and bring your purchased character into your digital collection! Collect and Connect into the wider range of WOW! PODS also available in Marvel, DC, Disney, Sonic, Jurassic World and many more. Developed for all fans of Character Brands!\n    \n\nWOW! PODS are for fans of character brands; girls, boys and adults alike! WOW! PODS are also the first collectible that\'s brought to life with light! Each character is located in their own hex-shaped POD with built in UV lights. Simply swipe across the sensor to light your WOW! POD using your hand. See your chosen character, along with a hidden mystery feature or icons, instantly revealed with light! Connect them together in seconds to create any size and shape of your display, limited only by your imagination! A wall of WOW! PODS that pop as you walk past them or a shelf display that you add to over time? You can even write your name or initials to create a display that it is undoubtedly and uniquely yours! And now you scan the QR code on the card (included) and bring your purchased character into your digital collection! Collect and Connect into the wider range of WOW! PODS also available in Marvel, DC, Disney, Sonic, Jurassic World and many more. Developed for all fans of Character Brands!COLLECT, CONNECT AND DISPLAY - PODS connect in a number of ways so that you can make your own unique awesome light displays across your wall, shelf, table or window ledgeJUST SWIPE TO LIGHT - Move your hand in front of the POD and a mystery surprise hidden feature is revealed when the POD lights-up. The light automatically goes out after 60 secondsBUILD YOUR OWN COLLECTION - Connect to other WOW! PODS Characters in seconds. Other Character ranges are available - Collect them all!\n\n\n\n', 1299, 'https://media.gamestop.com/i/gamestop/11154930/Wow-PODS-Pixar-Toy-Story-Buzz-Lightyear-Figure?$pdp2x$,https://media.gamestop.com/i/gamestop/11154930_ALT01/Wow-PODS-Pixar-Toy-Story-Buzz-Lightyear-Figure?$pdp2x$,https://media.gamestop.com/i/gamestop/11154930_ALT02/Wow-PODS-Pixar-Toy-Story-Buzz-Lightyear-Figure?$pdp2x$,https://media.gamestop.com/i/gamestop/11154930_ALT03/Wow-PODS-Pixar-Toy-Story-Buzz-Lightyear-Figure?$pdp2x$,https://media.gamestop.com/i/gamestop/11154930_ALT04/Wow-PODS-Pixar-Toy-Story-Buzz-Lightyear-Figure?$pdp2x$,https://media.gamestop.com/i/gamestop/11154930_ALT05/Wow-PODS-Pixar-Toy-Story-Buzz-Lightyear-Figure?$pdp2x$,https://media.gamestop.com/i/gamestop/11154930_ALT06/Wow-PODS-Pixar-Toy-Story-Buzz-Lightyear-Figure?$pdp2x$,https://media.gamestop.com/i/gamestop/11154930_ALT07/Wow-PODS-Pixar-Toy-Story-Buzz-Lightyear-Figure?$pdp2x$,', 17, 7),
	(27, 'Cars 2: The Video Game - Xbox 360', '\n\n        Inspired by the upcoming Disney?Pixar animated film, Cars 2: The Video Game lets players jump into the Cars?2 universe with some of their favorite Cars personalities in exotic locations around the globe.?Continuing the storyline from the upcoming film, players can choose to play as Mater and Lightning McQueen, as well as some brand new characters, as they train in the international training center - CHROME (Command Headquarters for Recon Operations and Motorized Espionage) to become world-class spies. They\'ll take on dangerous missions, compete to become the fastest racecar in the world, or use their spy skills in exciting, action-packed combat racing and battle arenas. Players can race against friends and family in either single or multiplayer modes with up to four players to unlock challenging new tracks, characters, events and thrilling spy missions. The DS version will also include exclusive global locations not seen in the film.\n    \n\n\n\nCars 2: The Video Game introduces the international training center - CHROME (Command Headquarters for Recon Operations and Motorized Espionage) that expands upon the film storyline Choose from more than 20 different characters, such as Mater, Lightning McQueen and the newly introduced Finn McMissile and Holley Shiftwell, and train to become world class spies Participate in simulated hazardous missions using high-tech gadgets to evade and impede adversaries Perform maneuvers only Cars characters can do, such as backwards driving, air tricks, sidestepping to avoid obstacles, two wheel driving and more Connect with World of Cars Online, a free-to-play browser-based virtual world based on the Cars universe, to gain rewards in the video game and then use them to unlock new items in the virtual world The Cars 2 video game also integrates with World of Cars Online: Integration of WOC Online &amp; Cars 2 Console Game:With the purchase of your Cars 2 game on Nintendo DS, Nintendo Wii, Playstation3, or Xbox 360, you\'ll be able to link your video game account with The World of Cars Online. Complete Levels or Circuits in your Cars 2 game and unlock coins, hood stickers, and more in The World of Cars Online! In addition, if you complete certain tasks in The World of Cars Online you\'ll unlock new characters and earn special rewards in your Cars 2 video game! \n\n\n\n\n\n', 1998, 'https://media.gamestop.com/i/gamestop/10090284/Cars-2-The-Video-Game---Xbox-360?$pdp2x$,', 18, 17),
	(28, 'NHL Anaheim Ducks Controller Skin for Xbox One', '\n\n        The NHL Anaheim Ducks Xbox One Controller Skin is made from a 3M durable auto-grade vinyl for an ultimate lightweight Xbox One Controller decal protection without the bulk. Every Skinit Anaheim Ducks skin is officially licensed by National Hockey League, Enterprises for an authentic brand design. The Anaheim Ducks Anaheim Ducks Frozen Microsoft Xbox One Controller decal skin is engineered to feature vibrant photo quality designs and to perfectly fit your Xbox One Controller The Anaheim Ducks Anaheim Ducks Frozen skin can be easily applied and removed from your Xbox One Controller with no residue, no mess and no fuss due to 3M adhesive backing. This makes it even easier for you to mix up your Xbox One Controller style as much as you want to keep your device feeling new. All Skinit made decal skins are cut and crafted with everyday Xbox One Controller uses in mind so that each Anaheim Ducks skin offers a premium feel with a thin functional protection. Shop all officially licensed NHL Anaheim Ducks Microsoft Xbox One Controller skins made by Skinit and make it yours today!\n    \n\nUltra-Thin, Lightweight Xbox One Controller Vinyl Decal ProtectionOffically Licensed National Hockey League, Enterprises DesignIndustry Leading Vivid Color Vinyl Print TechnologyScratch - Resistant. Built To Last Everday Xbox One Controller Use3M Adhesive Backing - Easy On, Easy Off & Residue-Free\n\n\n\n', 1599, 'https://media.gamestop.com/i/gamestop/11133406/NHL-Anaheim-Ducks-Controller-Skin-for-Xbox-One?$pdp2x$,https://media.gamestop.com/i/gamestop/11133406_ALT01/NHL-Anaheim-Ducks-Controller-Skin-for-Xbox-One?$pdp2x$,https://media.gamestop.com/i/gamestop/11133406_ALT02/NHL-Anaheim-Ducks-Controller-Skin-for-Xbox-One?$pdp2x$,https://media.gamestop.com/i/gamestop/11133406_ALT03/NHL-Anaheim-Ducks-Controller-Skin-for-Xbox-One?$pdp2x$,', 8, 15),
	(29, 'The Periodic Table of Elements Atom Word Art  Drawstring Backpack', '\n\nPage Title Created out of all of the elements on the periodic table Created out of all of the elements on the periodic table\nOne of the hottest trends now a days is to be a nerd or a geek.  After being made fun of for years, geeks are getting the last laugh, as most everything we use in today\'s modern world was probably created by the nerdy kid who sat behind you in high school.  Today\'s "techies" have also defined many of todays hottest clothing trends with geek shirts become cool to wear.\nAn atom can be defined as the smallest part of an element that can enter into combination with other elements. Each element has its own atomic structure associated with it.  So we thought it would be cool to create an atom out of every single element in the periodic chart.   \n\n\nMATERIAL - 100% CottonFEATURES - 14" W x 18" H, Matching drawcord  PRINTED WITH PRIDE IN THE USA- All of our products are printed and shipped from Las Vegas, Nevada USA.\n\n\n\n', 1399, 'https://media.gamestop.com/i/gamestop/11142982/The-Periodic-Table-of-Elements-Atom-Word-Art--Drawstring-Backpack?$pdp2x$,https://media.gamestop.com/i/gamestop/11142982_ALT01/The-Periodic-Table-of-Elements-Atom-Word-Art--Drawstring-Backpack?$pdp2x$,', 2, 18),
	(30, 'Highland Mint Green Bay Packers Team Schedule Silver Coin Card', '\n\n        This special limited edition Team Schedule Coin Card commemorates your favorite NFL team\'s 2021 Season. Delivered in a 4" x 6" acrylic display is a 39mm Silver plated team commemorative coin. The reverse (back) of the coin is struck with the official NFL logo. The display includes a commemorative card featuring the 2021 Team Schedule of your favorite NFL team and is delivered with a display stand. This unique collectible is a limited edition of only 5,000 and it is officially licensed by the NFL. Proudly made in the USA by the Highland Mint.\n    \n\nFour-time Super Bowl Champions. The winners of the first Super Bowl in 1966. Their home stadium of Lambeau Field is the oldest continually operating stadium in the NFL and one of the best home field advantages in the sport - regularly playing playoff games in below freezing Wisconsin weather. The Green Bay Packers are not only a historically good football team, but an intimidating one come playoff time.\n\n\n\n', 2999, 'https://media.gamestop.com/i/gamestop/11154271/Highland-Mint-Green-Bay-Packers-Team-Schedule-Silver-Coin-Card?$pdp2x$,', 4, 19),
	(31, 'Kotobukiya ArtFX Premire She-Hulk Limited Edition 8.2-In Statue', '\n\n        The fifth character from Marvel’s Avengers to join the ARTFX Premier line is She-Hulk!\n    \n\nThe latest installment in the highly detailed line of ARTFX Premier statues, She-Hulk was painstakingly crafted using digital sculpting, and is packed with intricate textures and details that will add a new level of charm and appeal to your collection. As part of the ARTFX Premier series, the statue utilizes a unique painting technique that differs from the standard process of applying a simple base coat with shading. Each individual piece of the statue is layered with several types of paint, giving the finished product an unprecedented sense of beauty and depth.\nWith strength rivalling the Hulk himself, unparalleled intelligence, and good looks Jennifer Walters or She-Hulk is the full package, and this 1/10 scale rendition of the character perfectly captures her brains and beauty! Like the previously released ARTFX Premier Hulk, She-Hulk’s massive muscles are beautifully sculpted, showing off the character’s strength as a hero, while the statue’s painting highlights numerous stylish accents. From her delicate eyelashes and makeup to the texture of her skin and the fierce determination in She-Hulk’s eyes, the statue’s unique paint job brings an unprecedented amount of realism along with showing off the character’s strength and beauty!\nA unique rendition of She-Hulk unlike any to come before, this high-end collectible piece shows off the character in a way that can only be achieved by the ARTFX Premier series.\nAs part of the first line in the ARTFX Premier series, the statue comes in sophisticated packaging overflowing with elegant details, including a marble inspired motif as well as an original illustration based on the figure.\n\n\n\n\n1/10 Statue\nCrafted using digital sculpting\ncome with a certificate that includes a collector number printed in gold, certifying each piece as a one-of-a-kind original\n\n\n\n\n\n', 18999, 'https://media.gamestop.com/i/gamestop/11170429/Kotobukiya-ArtFX-Premire-She-Hulk-Limited-Edition-8.2-In-Statue?$pdp2x$,https://media.gamestop.com/i/gamestop/11170429_ALT01/Kotobukiya-ArtFX-Premire-She-Hulk-Limited-Edition-8.2-In-Statue?$pdp2x$,https://media.gamestop.com/i/gamestop/11170429_ALT02/Kotobukiya-ArtFX-Premire-She-Hulk-Limited-Edition-8.2-In-Statue?$pdp2x$,https://media.gamestop.com/i/gamestop/11170429_ALT03/Kotobukiya-ArtFX-Premire-She-Hulk-Limited-Edition-8.2-In-Statue?$pdp2x$,https://media.gamestop.com/i/gamestop/11170429_ALT04/Kotobukiya-ArtFX-Premire-She-Hulk-Limited-Edition-8.2-In-Statue?$pdp2x$,https://media.gamestop.com/i/gamestop/11170429_ALT05/Kotobukiya-ArtFX-Premire-She-Hulk-Limited-Edition-8.2-In-Statue?$pdp2x$,https://media.gamestop.com/i/gamestop/11170429_ALT06/Kotobukiya-ArtFX-Premire-She-Hulk-Limited-Edition-8.2-In-Statue?$pdp2x$,https://media.gamestop.com/i/gamestop/11170429_ALT07/Kotobukiya-ArtFX-Premire-She-Hulk-Limited-Edition-8.2-In-Statue?$pdp2x$,https://media.gamestop.com/i/gamestop/11170429_ALT08/Kotobukiya-ArtFX-Premire-She-Hulk-Limited-Edition-8.2-In-Statue?$pdp2x$,https://media.gamestop.com/i/gamestop/11170429_ALT09/Kotobukiya-ArtFX-Premire-She-Hulk-Limited-Edition-8.2-In-Statue?$pdp2x$,https://media.gamestop.com/i/gamestop/11170429_ALT10/Kotobukiya-ArtFX-Premire-She-Hulk-Limited-Edition-8.2-In-Statue?$pdp2x$,https://media.gamestop.com/i/gamestop/11170429_ALT11/Kotobukiya-ArtFX-Premire-She-Hulk-Limited-Edition-8.2-In-Statue?$pdp2x$,https://media.gamestop.com/i/gamestop/11170429_ALT12/Kotobukiya-ArtFX-Premire-She-Hulk-Limited-Edition-8.2-In-Statue?$pdp2x$,https://media.gamestop.com/i/gamestop/11170429_ALT13/Kotobukiya-ArtFX-Premire-She-Hulk-Limited-Edition-8.2-In-Statue?$pdp2x$,https://media.gamestop.com/i/gamestop/11170429_ALT14/Kotobukiya-ArtFX-Premire-She-Hulk-Limited-Edition-8.2-In-Statue?$pdp2x$,https://media.gamestop.com/i/gamestop/11170429_ALT15/Kotobukiya-ArtFX-Premire-She-Hulk-L