	(33, 'Ridge Racer Unbounded Extended Pack: 3 Vehicles and 5 Paint Jobs', '\n\n        A super sports car, 2 classic 60s machines and 5 paint jobs (PAC-MAN?, GALAGA?, TEKKEN?, SOULCALIBUR?, ACE COMBAT?), this pack has it all!\n    \n\n\n', 399, 'https://media.gamestop.com/i/gamestop/10103224/Ridge-Racer-Unbounded-Extended-Pack-3-Vehicles-and-5-Paint-Jobs?$pdp2x$,', 12, 21),
	(34, 'Skinit Auburn University Bold Logo Skin Bundle for PlayStation 5', '\n\n        The Auburn University PS5 Bundle Skin is made from a 3M durable auto-grade vinyl for an ultimate lightweight PS5 Bundle decal protection without the bulk. Every Skinit Auburn University skin is officially licensed by Collegiate Licensing Co for an authentic brand design. The Auburn University Auburn Bold Logo Sony PS5 Bundle decal skin is engineered to feature vibrant photo quality designs and to perfectly fit your PS5 Bundle The Auburn University Auburn Bold Logo skin can be easily applied and removed from your PS5 Bundle with no residue, no mess and no fuss due to 3M adhesive backing. This makes it even easier for you to mix up your PS5 Bundle style as much as you want to keep your device feeling new. All Skinit made decal skins are cut and crafted with everyday PS5 Bundle uses in mind so that each Auburn University skin offers a premium feel with a thin functional protection. Shop all officially licensed Auburn University Sony PS5 Bundle skins made by Skinit and make it yours today!\n    \n\nUltra-Thin, Lightweight PS5 Bundle Vinyl Decal ProtectionOffically Licensed Collegiate Licensing Co DesignIndustry Leading Vivid Color Vinyl Print TechnologyScratch - Resistant. Built To Last Everday PS5 Bundle Use3M Adhesive Backing - Easy On, Easy Off & Residue-Free\n\n\n\n', 3999, 'https://media.gamestop.com/i/gamestop/11131902/Skinit-Auburn-University-Bold-Logo-Skin-Bundle-for-PlayStation-5?$pdp2x$,https://media.gamestop.com/i/gamestop/11131902_ALT01/Skinit-Auburn-University-Bold-Logo-Skin-Bundle-for-PlayStation-5?$pdp2x$,https://media.gamestop.com/i/gamestop/11131902_ALT02/Skinit-Auburn-University-Bold-Logo-Skin-Bundle-for-PlayStation-5?$pdp2x$,https://media.gamestop.com/i/gamestop/11131902_ALT03/Skinit-Auburn-University-Bold-Logo-Skin-Bundle-for-PlayStation-5?$pdp2x$,', 8, 8),
	(35, 'Call of Duty: Black Ops II Revolution', '\n\n        The 21st Century Cold War is heating up. With technologically-advanced weaponry, drones and advanced robotics, Call of Duty?: Black Ops II redeploys with Revolution, a new downloadable content pack boasting 4 brand-new Multiplayer Maps:\n    \n\n\n\nDownhill: Set in the ski country of the French Alps, players will fight their way down the slopes and through a mountain lodge, avoiding the moving hazards of the gondola system. Hydro: Opponents must dodge the floodwaters as they contend for dominance of this hydroelectric dam facility in Pakistan. Mirage: Players compete amidst the sand dunes of a sandstorm-devastated luxury resort in the Chinese Gobi Desert, where a range of long distance and close-quarters combat will mix up the action for all play-styles. Grind: Players will be transported to California\'s Venice Beach, the birthplace of skateboarding, where they\'ll battle it out through the ramps and half pipes of a massive skate park.And for the first time ever, players will enter these firefights with a bonus weapon – the Peacekeeper hybrid SMG-Assault Rifle – yours to level up and customize on all Call of Duty: Black Ops II multiplayer maps.This first map pack also includes a healthy dose of the undead, as Treyarch introduces the brand new Zombies Co-Op Map, Die Rise, bringing a terrifying new twist that will turn your undead world upside down. And for even more zombie-stopping action, the new Zombies game mode, Turned, flips the battle around, putting players into the role of the zombie fighting for survival against a human opponent.\n\n\n\n\n\n', 1499, 'https://media.gamestop.com/i/gamestop/10108151/Call-of-Duty-Black-Ops-II-Revolution?$pdp2x$,', 20, 21),
	(36, 'Nintendo DS Teal GameStop Premium Refurbished', '\n\n        Nintendo\'s latest innovation provides users with a unique game-play experience using features never before offered by any other home console or hand-held game system. This portable personal entertainment and communications unit provides owners with new perspectives on dual screens, new control using both touch and voice, and new connections with two kinds of wireless game play. It\'s a newfound canvas on which developers can express their creativity.\n    \n\n\n\nIncludes: System, ac adapter, stylusSlim design The Nintendo DS manages to pack a lot fun into a small, slim body. DS measures a pocket-friendly 5.8 x 3.3 x 1.1. No lightweight Nintendo DS might weigh in at just 275g, but it\'s full of features. Read on to see how much we squeezed in. Dual slot compatibility Nintendo DS doesn\'t just play DS games – it also features an additional port for Game Boy Advance game paks. Screens The 2 LCD screens on the Nintendo DS combine crisp, punchy colors, along with touch-screen technology on the lower screen to deliver some of the most groundbreaking gameplay ever developed. Sharp colors Nintendo DS looks sharp in silver, black, and electric blue. You know the DS means business the very first second you see it. Long life Can you outlast the Nintendo DS battery? Get up to 10 hours continuous gameplay on one charge. And you can be up and running fully recharged again in less than 4 hours. Nintendo Wi-Fi Connection Ready to take on the world? With Nintendo Wi-Fi Connection, you can connect wirelessly, chat with friends while you play and compete with Nintendo DS owners across the globe. And it\'s totally free! All you need to play is a Nintendo DS and a Wi-Fi-ready game. DS 3D Nintendo DS has powerful dual processors that bring impressive 3D graphics to life with lightning-fast rendering. You\'re in control Control the action or access menus using either your finger or the supplied DS stylus to touch or tap the screen. \n\n\n\n\n\n', 4999, 'https://media.gamestop.com/i/gamestop/10107530/Nintendo-DS-Teal-GameStop-Premium-Refurbished?$pdp2x$,', 21, 22),
	(37, 'Skinit NHL Arizona Coyotes Skin Bundle for Xbox One', '\n\n        The NHL Arizona Coyotes Xbox One Console and Controller Bundle Skin is made from a 3M durable auto-grade vinyl for an ultimate lightweight Xbox One Console and Controller Bundle decal protection without the bulk. Every Skinit Arizona Coyotes skin is officially licensed by National Hockey League, Enterprises for an authentic brand design. The Arizona Coyotes Arizona Coyotes Frozen Microsoft Xbox One Console and Controller Bundle decal skin is engineered to feature vibrant photo quality designs and to perfectly fit your Xbox One Console and Controller Bundle The Arizona Coyotes Arizona Coyotes Frozen skin can be easily applied and removed from your Xbox One Console and Controller Bundle with no residue, no mess and no fuss due to 3M adhesive backing. This makes it even easier for you to mix up your Xbox One Console and Controller Bundle style as much as you want to keep your device feeling new. All Skinit made decal skins are cut and crafted with everyday Xbox One Console and Controller Bundle uses in mind so that each Arizona Coyotes skin offers a premium feel with a thin functional protection. Shop all officially licensed NHL Arizona Coyotes Microsoft Xbox One Console and Controller Bundle skins made by Skinit and make it yours today!\n    \n\nUltra-Thin, Lightweight Xbox One Console and Controller Bundle Vinyl Decal ProtectionOffically Licensed National Hockey League, Enterprises DesignIndustry Leading Vivid Color Vinyl Print TechnologyScratch - Resistant. Built To Last Everday Xbox One Console and Controller Bundle Use3M Adhesive Backing - Easy On, Easy Off & Residue-Free\n\n\n\n', 3999, 'https://media.gamestop.com/i/gamestop/11133416/Skinit-NHL-Arizona-Coyotes-Skin-Bundle-for-Xbox-One?$pdp2x$,', 8, 15),
	(38, 'Ouija the Mystical T-Shirt', '\n\n        Our regular tee is an everyday staple. This pre-shrunk classic features zero side seams, and double-needle stitched sleeves giving your wardrobe the upgrade it deserves. 100% cotton (except Heathers). Officially Licensed Art by BarmalisRTB\n    \n\n\nMachine Wash Cold, With Like Colors\nOnly Non-Chlorine Bleach If Needed\nTumble Dry Low, Warm Iron If Needed\n100% Ring Spun Cotton\n\n\n\n\n', 1998, 'https://media.gamestop.com/i/gamestop/11106632/Ouija-the-Mystical-T-Shirt?$pdp2x$,', 22, 5),
	(39, 'Greatest Rap Hits of The 1980\'s Boom Box Word Art Crewneck Sweatshirt', '\n\nCreated using some of the greatest rap hits of the 1980s\nBefore the MP3 and the IPOD there was the “Boom Box” also referred to as a “Ghetto Blaster.” The advancement of music technology has left the Boom Box looking like a dinosaur compared to the electronics of today. But there is one thing these advancements can’t take away and that is how important the Boom Box was in the popularization of Rap and Hip Hop in the 80’s. To think that in today’s world you plug in and escape into your own world; in the 1980’s it was the complete opposite. Put the cassette in, turn the knob up to 10, throw the Boom Box on your shoulder and head out. That’s how music caught on, that’s how Rap spread across the nation. You could hear a song playing on the other side of a park and run out that night to buy the cassette. It really is very hard to imagine HOW different things were only 20 years ago. But one thing has remained constant – there is no doubting the ground breaking Rap songs of the 1980’s.\n \nTo pay tribute to this amazing time in Music history, we have created this Boom Box T-shirt out of some of the greatest Rap hits of the 1980’s.\n \nThe songs include:\n\n    Rappers Delight\n    The Breaks\n    The Message\n    White Lines\n    King of Rock\n    Paul Revere\n    Rock the bells\n    The Show\n    Boyz-N-The-Hood\n    You Be illin\'\n    Walk This Way\n    Brass Monkey\n    You Gotta Fight For Your Right To Party\n    Paid in Full\n    Push It\n    Children\'s Story\n    Colors\n    Fuck Tha Police\n    Going Back to Cali\n    It Takes Two\n    Joy \'N Pain\n    Parents Just Don\'t Understand\n    Straight Outta Compton\n    Supersonic\n    Cars That Go Boom\n    Bust A Move\n    Fight The Power\n    Funky cold medina\n    Wild Thing\n    Just A Friend\n    Me Myself and I\n    It’s tricky\n\n\n\nMATERIAL - 50% Cotton/50% Polyester\nPRINTED WITH PRIDE IN THE USA - All of our products are printed and shipped from Las Vegas, Nevada USA.\n\n\n\n\n', 3999, 'https://media.gamestop.com/i/gamestop/11115984/Greatest-Rap-Hits-of-The-1980s-Boom-Box-Word-Art-Crewneck-Sweatshirt?$pdp2x$,https://media.gamestop.com/i/gamestop/11115984_ALT02/Greatest-Rap-Hits-of-The-1980s-Boom-Box-Word-Art-Crewneck-Sweatshirt?$pdp2x$,', 2, 16),
	(40, 'Buffalo Games Honey Drip Farms 1000-pc Jigsaw Puzzle', '\n\n        This 1,000 piece jigsaw puzzle, Honey Drip Farm, shows the sun setting on the local farm and the families log cabin across the lake. You will enjoy piecing together this picturesque landscape of both nature and those that inhabit it. This puzzle is by Buffalo Games based on the artwork by Chuck Pinson.\n\nEvery Buffalo Games jigsaw puzzle is manufactured from recycled puzzle board. A precision cutting technique guarantees that every piece will fit soundly with the company\'s signature Perfect Snap?. A bonus puzzle poster is also included so that you have a handy reference of what the completed puzzle should look like while you put yours together.\n    \n\n\n', 1499, 'https://media.gamestop.com/i/gamestop/11160050/Buffalo-Games-Honey-Drip-Farms-1000-pc-Jigsaw-Puzzle?$pdp2x$,https://media.gamestop.com/i/gamestop/11160050_ALT01/Buffalo-Games-Honey-Drip-Farms-1000-pc-Jigsaw-Puzzle?$pdp2x$,https://media.gamestop.com/i/gamestop/11160050_ALT02/Buffalo-Games-Honey-Drip-Farms-1000-pc-Jigsaw-Puzzle?$pdp2x$,https://media.gamestop.com/i/gamestop/11160050_ALT03/Buffalo-Games-Honey-Drip-Farms-1000-pc-Jigsaw-Puzzle?$pdp2x$,https://media.gamestop.com/i/gamestop/11160050_ALT04/Buffalo-Games-Honey-Drip-Farms-1000-pc-Jigsaw-Puzzle?$pdp2x$,', 23, 23),
