	(42, 'Hasbro Marvel Legends Series Ant-Man Roleplay Premium Collector Movie Electronic Helmet', '\n\n        Scott Lang is recruited by Hank Pym to don the Ant-Man suit and shrink into action as the incredible, power-packed half-inch hero!\n    \n\n\n\nCollectors, fans, and Marvel enthusiasts alike can imagine iconic Ant-Man moments from the Marvel Cinematic Universe with this premium Hasbro Marvel Legends Series Ant-Man Electronic Helmet collectible fan roleplay item. This high quality fan helmet features premium design and detail, as well as 6 red and blue LED light FX on the antennae and jawline. Press button once for red LED special effects and a second time for blue electronic light FX. Helmet features movie-inspired design and detail, as well as fantasy-inspired interior sculpting and design. With this premium adult roleplay helmet, collectors and fans can imagine getting into costume to recreate favorite moments from the Marvel movies, including Ant-Man, Captain America: Civil War, and Ant-Man and the Wasp.  INSPIRED BY ANT-MAN FROM THE MARVEL CINEMATIC UNIVERSE. Premium roleplay helmet with light special effects inspired by Ant-Man from the MCU.ELECTRONIC HELMET WITH RED & BLUE LIGHTS. With design inspired by Pym Technologies, this collector electronic fan helmet features 6 LEDs for light FX on antennae and jawline. HIGH QUALITY HELMET WITH ADJUSTABLE FIT. Premium collectible helmet features adjustable straps for best fit for most adult head sizes, as well as detailed interior sculpting and design. ICONIC CHARACTER FROM THE MARVEL MOVIES. Ant-Man is featured in many MCU movies including Ant-Man, Ant-Man and the Wasp, and Captain America: Civil War. MARVEL LEGENDS SERIES COLLECTOR HELMET. Premium roleplay helmet to complete any fan costume or collection with the high-quality design expected of the Hasbro Marvel Legends Series. X3 1.5V AA ALKALINE BATTERIES REQUIRED. NOT INCLUDED. \n\n\n\n\n\n', 8999, 'https://media.gamestop.com/i/gamestop/10172048/Hasbro-Marvel-Legends-Series-Ant-Man-Roleplay-Premium-Collector-Movie-Electronic-Helmet?$pdp2x$,https://media.gamestop.com/i/gamestop/10172048_ALT01/Hasbro-Marvel-Legends-Series-Ant-Man-Roleplay-Premium-Collector-Movie-Electronic-Helmet?$pdp2x$,https://media.gamestop.com/i/gamestop/10172048_ALT02/Hasbro-Marvel-Legends-Series-Ant-Man-Roleplay-Premium-Collector-Movie-Electronic-Helmet?$pdp2x$,https://media.gamestop.com/i/gamestop/10172048_ALT03/Hasbro-Marvel-Legends-Series-Ant-Man-Roleplay-Premium-Collector-Movie-Electronic-Helmet?$pdp2x$,https://media.gamestop.com/i/gamestop/10172048_ALT04/Hasbro-Marvel-Legends-Series-Ant-Man-Roleplay-Premium-Collector-Movie-Electronic-Helmet?$pdp2x$,https://media.gamestop.com/i/gamestop/10172048_ALT05/Hasbro-Marvel-Legends-Series-Ant-Man-Roleplay-Premium-Collector-Movie-Electronic-Helmet?$pdp2x$,https://media.gamestop.com/i/gamestop/10172048_ALT06/Hasbro-Marvel-Legends-Series-Ant-Man-Roleplay-Premium-Collector-Movie-Electronic-Helmet?$pdp2x$,https://media.gamestop.com/i/gamestop/10172048_ALT07/Hasbro-Marvel-Legends-Series-Ant-Man-Roleplay-Premium-Collector-Movie-Electronic-Helmet?$pdp2x$,', 24, 24),
	(43, 'PowerA Joy-Con Charging Dock for Nintendo Switch', '\n\n        The Joy-Con Charging Dock is the easiest solution for charging your Nintendo Switch Joy-Con Controllers. Charge 4 Joy-Con Controllers at a time for multiple players, or keep an extra pair charged for single players to switch out. Simply slide the Joy-Con Controllers down and wait until each charge LED turns green!\n    \n\n\n\n Charges up to 4 Joy-Con Controllers simultaneously  Individual LEDs indicate charge level for each Joy-Con Easy slide-in design connects each Joy-Con to charger Weighted base for stability Powered via USB \n\n\n\n\n\n', 2299, 'https://media.gamestop.com/i/gamestop/10141872/PowerA-Joy-Con-Charging-Dock-for-Nintendo-Switch?$pdp2x$,https://media.gamestop.com/i/gamestop/10141872_10153624_SCR04/PowerA-Joy-Con-Charging-Dock-for-Nintendo-Switch?$screen2x$,https://media.gamestop.com/i/gamestop/10141872_10153624_SCR03/PowerA-Joy-Con-Charging-Dock-for-Nintendo-Switch?$screen2x$,https://media.gamestop.com/i/gamestop/10141872_10153624_SCR02/PowerA-Joy-Con-Charging-Dock-for-Nintendo-Switch?$screen2x$,https://media.gamestop.com/i/gamestop/10141872_10153624_SCR01/PowerA-Joy-Con-Charging-Dock-for-Nintendo-Switch?$screen2x$,https://media.gamestop.com/i/gamestop/10141872_10153624_SCR04/PowerA-Joy-Con-Charging-Dock-for-Nintendo-Switch?$screen$,https://media.gamestop.com/i/gamestop/10141872_10153624_SCR03/PowerA-Joy-Con-Charging-Dock-for-Nintendo-Switch?$screen$,https://media.gamestop.com/i/gamestop/10141872_10153624_SCR02/PowerA-Joy-Con-Charging-Dock-for-Nintendo-Switch?$screen$,https://media.gamestop.com/i/gamestop/10141872_10153624_SCR01/PowerA-Joy-Con-Charging-Dock-for-Nintendo-Switch?$screen$', 25, 25),
	(44, 'Frozen 2 Anna and Elsa Skin Bundle for PlayStation 5', '\n\n        The Frozen PS5 Bundle Skin is made from a 3M durable auto-grade vinyl for an ultimate lightweight PS5 Bundle decal protection without the bulk. Every Skinit Frozen skin is officially licensed by Disney for an authentic brand design. The Frozen Anna and Elsa Sony PS5 Bundle decal skin is engineered to feature vibrant photo quality designs and to perfectly fit your PS5 Bundle The Frozen Anna and Elsa skin can be easily applied and removed from your PS5 Bundle with no residue, no mess and no fuss due to 3M adhesive backing. This makes it even easier for you to mix up your PS5 Bundle style as much as you want to keep your device feeling new. All Skinit made decal skins are cut and crafted with everyday PS5 Bundle uses in mind so that each Frozen skin offers a premium feel with a thin functional protection. Shop all officially licensed Frozen Sony PS5 Bundle skins made by Skinit and make it yours today!\n    \n\nUltra-Thin, Lightweight PS5 Bundle Vinyl Decal ProtectionOffically Licensed Disney DesignIndustry Leading Vivid Color Vinyl Print TechnologyScratch - Resistant. Built To Last Everday PS5 Bundle Use3M Adhesive Backing - Easy On, Easy Off & Residue-Free\n\n\n\n', 3999, 'https://media.gamestop.com/i/gamestop/11132336/Frozen-2-Anna-and-Elsa-Skin-Bundle-for-PlayStation-5?$pdp2x$,https://media.gamestop.com/i/gamestop/11132336_ALT01/Frozen-2-Anna-and-Elsa-Skin-Bundle-for-PlayStation-5?$pdp2x$,https://media.gamestop.com/i/gamestop/11132336_ALT02/Frozen-2-Anna-and-Elsa-Skin-Bundle-for-PlayStation-5?$pdp2x$,https://media.gamestop.com/i/gamestop/11132336_ALT03/Frozen-2-Anna-and-Elsa-Skin-Bundle-for-PlayStation-5?$pdp2x$,', 8, 8),
	(45, 'MLB The Show 19 - PlayStation 4', '\n\n        The Show is back! MLB? The Show? 19 brings you the best of baseball. Play America\'s pastime your way, with new game modes, expanded team building and player customization, and an extensive personalized RPG experience. Create your own player and rise through the MLB ranks or play against others as baseball\'s greatest stars and legends. Fierce online competition*, exciting RPG action, lightning fast gameplay––The Show 19 has it all. This is more than baseball. Welcome to The Show.\n    \n\nNew Game Mode: Moments.  Recreate or change some of the biggest moments in baseball history**New Unannounced Game Mode: March to October.New in Road to The Show: deeper RPG elements, more ways to improve your player on and off the field, and the removal of level caps.New in Diamond Dynasty**: more streamlined mission and reward systems and numerous new quality-of-life improvements make earning rewards faster and clearer than previous years.Conquer and defend territories in new Conquest maps, designed to provide a more dynamic and reward-filled Conquest experience.**We\'ve spent the offseason studying gameplay telemetry and community feedback to drive changes in our hitting engine and defensive AI.Impress your friends and the competition with all new options for customization.*Online multiplayer requires an active PS Plus membership.**Internet connection required.\n\n\n\n', 999, 'https://media.gamestop.com/i/gamestop/10170067/MLB-The-Show-19---PlayStation-4?$pdp2x$,', 26, 26),
	(46, 'Hasbro Star Wars The Vintage Collection Star Wars: The Clone Wars Ahsoka Tano 3.75-in Action Figure', '\n\n        Ahsoka Tano, the Padawan to Anakin Skywalker and hero of the Clone Wars, grew from headstrong student into mature leader. But her destiny laid along a different path.\n    \n\nCelebrate the legacy of Star Wars, the action-and-adventure-packed space saga from a galaxy far, far away, with premium 3.75-inch scale figures and vehicles from Star Wars The Vintage Collection. Figures feature premium detail and design across product and packaging inspired by the original line, as well as the entertainment-inspired collector grade deco that fans have come to know and love. (Additional products each sold separately. Subject to availability.)\nFeaturing premium detail and design across multiple points of articulation inspired by Star Wars: The Clone Wars, this collectible Star Wars The Vintage Collection 3.75-inch-scale figure makes a great gift for Star Wars fans and collectors.\n\n\n\n\n\nAhsoka - Ahsoka Tano, a Togruta female, was the Padawan to Anakin Skywalker and hero of the Clone Wars. She grew from headstrong student into mature leader. But her destiny laid along a different path  \n\nVintage-inspired Packaging - Star Wars The Vintage Collection 3.75-inch scale classic Star Wars figures and vehicles feature original Kenner branding (Each sold separately. Subject to availability.) \n\nClassic Star Wars Figure, Photoreal Face Deco - This Ahsoka action figure is inspired by the character in Star Wars: The Clone Wars. For this release of the VC102 classic action figure she has PhotoReal face deco \n\nSeries-based Character-inspired Accessories - This Star Wars The Vintage Collection action figure comes with 4 entertainment-inspired accessories that make a great addition to any fan’s Star Wars collection  \n\nPremium Design And Articulation - Highly articulated with fully poseable head, arms, and legs, the Star Wars Ahsoka figure can be displayed in any Star Wars action figure and vehicle collections\n\n\n\n\n\n\n', 1399, 'https://media.gamestop.com/i/gamestop/11163024/Hasbro-Star-Wars-The-Vintage-Collection-Star-Wars-The-Clone-Wars-Ahsoka-Tano-3.75-in-Action-Figure?$pdp2x$,https://media.gamestop.com/i/gamestop/11163024_ALT01/Hasbro-Star-Wars-The-Vintage-Collection-Star-Wars-The-Clone-Wars-Ahsoka-Tano-3.75-in-Action-Figure?$pdp2x$,https://media.gamestop.com/i/gamestop/11163024_ALT02/Hasbro-Star-Wars-The-Vintage-Collection-Star-Wars-The-Clone-Wars-Ahsoka-Tano-3.75-in-Action-Figure?$pdp2x$,https://media.gamestop.com/i/gamestop/11163024_ALT03/Hasbro-Star-Wars-The-Vintage-Collection-Star-Wars-The-Clone-Wars-Ahsoka-Tano-3.75-in-Action-Figure?$pdp2x$,https://media.gamestop.com/i/gamestop/11163024_ALT04/Hasbro-Star-Wars-The-Vintage-Collection-Star-Wars-The-Clone-Wars-Ahsoka-Tano-3.75-in-Action-Figure?$pdp2x$,https://media.gamestop.com/i/gamestop/11163024_ALT05/Hasbro-Star-Wars-The-Vintage-Collection-Star-Wars-The-Clone-Wars-Ahsoka-Tano-3.75-in-Action-Figure?$pdp2x$,https://media.gamestop.com/i/gamestop/11163024_ALT06/Hasbro-Star-Wars-The-Vintage-Collection-Star-Wars-The-Clone-Wars-Ahsoka-Tano-3.75-in-Action-Figure?$pdp2x$,', 24, 27),
	(47, 'Namaste Lotus Flower Word Art Mens Tank Top', '\n\nLotus flower created out of the word NamasteThe lotus flower is a symbol of purity, enlightenment, self-regeneration and rebirth. The word "Namaste" has a spiritual meaning that conveys "the divine in me respectfully recognizes the divine in you." We have combined them to create this beautiful "Word Art" design. We hope that you can help share this wonderful message to the world with the purchase of our unique product. Namaste. \n\n\nMATERIAL - 100% CottonPRINTED WITH PRIDE IN THE USA- All of our products are printed and shipped from Las Vegas, Nevada USA.\n\n\n\n', 2049, 'https://media.gamestop.com/i/gamestop/11139820_orange/Namaste-Lotus-Flower-Word-Art-Mens-Tank-Top-orange?$pdp2x$,', 2, 5),
	(48, 'List of Great Rock Guitarist Rock Guitar Word Art Womens Premium Blend T-Shirt', '\n\nPage Title Created using the names of some of the greatest Rock Guitarists of all time The history of Rock and Roll is rich with some amazingly talented people. To pay tribute to some of the best that help shape Rock music, we created this guitar artwork created out of their legendary names. \n\n\nMATERIAL - 50% Cotton/50% PolyesterPRINTED WITH PRIDE IN THE USA - All of our products are printed and shipped from Las Vegas, Nevada USA.\n\n\n\n', 2699, 'https://media.gamestop.com/i/gamestop/11143621_red/List-of-Great-Rock-Guitarist-Rock-Guitar-Word-Art-Womens-Premium-Blend-T-Shirt-red?$pdp2x$,https://media.gamestop.com/i/gamestop/11143621_red_ALT01/List-of-Great-Rock-Guitarist-Rock-Guitar-Word-Art-Womens-Premium-Blend-T-Shirt-red?$pdp2x$,', 2, 5),
	(49, 'Honu Turtle Hawaiian Islands Word Art  Drawstring Backpack', '\n\nPage Title Created using The Hawaiian Island Names  There are three species of sea turtles native to the Hawaiian Islands: the Green, the Hawksbill, and the Leatherback. These fascinating creatures have played important roles in the environment and culture of Hawaii\'s people. Of the three native sea turtles, the Green Turtle also called Honu is the most popular and has become a symbol of the enchantment of the Hawaiian Islands. Our Honu Turtle is created using the names of all the Hawaiian Islands.  \n\n\nMATERIAL - 100% CottonFEATURES - 14" W x 18" H, Matching drawcord  PRINTED WITH PRIDE IN THE USA- All of our products are printed and shipped from Las Vegas, Nevada USA.\n\n\n\n', 1399, 'https://media.gamestop.com/i/gamestop/11143291/Honu-Turtle-Hawaiian-Islands-Word-Art--Drawstring-Backpack?$pdp2x$,https://media.gamestop.com/i/gamestop/11143291_ALT01/Honu-Turtle-Hawaiian-Islands-Word-Art--Drawstring-Backpack?$pdp2x$,', 2, 18),
	(50, 'St. Louis Cardinals Yadier Molina Impact Jersey Framed Photo', '\n\n        This unique collectible frame features an action photo of your favorite MLB star super imposed on his respective jersey number. The printed art is delivered in a 13" x 13" wood frame under glass and ready to hang. Officially Licensed by the MLB and MLBPA. Proudly made in the USA by The Highland Mint!\n    \n\n\n', 4999, 'https://media.gamestop.com/i/gamestop/11136451/St.-Louis-Cardinals-Yadier-Molina-Impact-Jersey-Framed-Photo?$pdp2x$,', 4, 4),
	(51, 'Battle Chef Brigade', '\n\n        In the fantasy realm of Victusia, the members of the elite Battle Chef Brigade are revered for their ability to skillfully take down monsters and transform their kills into delicious cuisine! But getting in isn\'t easy; chefs from across Victusia must vie for their spot in a high stakes competition. Follow two contestants, Mina and Thrash, as their journeys through the tournament unfold. In order to become a Brigadier you\'ll need to hunt monsters with combo-based attacks and prepare your freshly caught ingredients in puzzle-based cooking challenges to serve up winning dishes to the judges – all while the round clock ticks down.\n    \n\n\n\nHand drawn characters and monsters.Two playable chefs, brought to life through unique poses and VO, star in a charming campaign that delves into each character\'s personality, combat style, and cuisine.A chef\'s pairing of equal parts old school brawler and combo puzzler, served with a side of light RPG progression.Deadly monsters that turn into delicious dishes: subdue them in the arena and get cooking in the kitchen!Daily Cook-Off leaderboards where Battle Chefs show off their culinary creations.Puzzle Rush and Break the Dishes modes for more exciting leaderboard challenges!\n\n\n\n\n\n', 1998, 'https://media.gamestop.com/i/gamestop/10161259/Battle-Chef-Brigade?$pdp2x$,https://media.gamestop.com/i/gamestop/10161259_SCR07/Battle-Chef-Brigade?$screen2x$,https://media.gamestop.com/i/gamestop/10161259_SCR06/Battle-Chef-Brigade?$screen2x$,https://media.gamestop.com/i/gamestop/10161259_SCR05/Battle-Chef-Brigade?$screen2x$,https://media.gamestop.com/i/gamestop/10161259_SCR04/Battle-Chef-Brigade?$screen2x$,https://media.gamestop.com/i/gamestop/10161259_SCR03/Battle-Chef-Brigade?$screen2x$,https://media.gamestop.com/i/gamestop/10161259_SCR02/Battle-Chef-Brigade?$screen2x$,https://media.gamestop.com/i/gamestop/10161259_SCR01/Battle-Chef-Brigade?$screen2x$,https://media.gamestop.com/i/gamestop/10161259_SCR07/Battle-Chef-Brigade?$screen$,https://media.gamestop.com/i/gamestop/10161259_SCR06/Battle-Chef-Brigade?$screen$,https://media.gamestop.com/i/gamestop/10161259_SCR05/Battle-Chef-Brigade?$screen$,https://media.gamestop.com/i/gamestop/10161259_SCR04/Battle-Chef-Brigade?$screen$,https://media.gamestop.com/i/gamestop/10161259_SCR03/Battle-Chef-Brigade?$screen$,https://media.gamestop.com/i/gamestop/10161259_SCR02/Battle-Chef-Brigade?$screen$,https://media.gamestop.com/i/gamestop/10161259_SCR01/Battle-Chef-Brigade?$screen$', 27, 25),
	(52, 'Marvel Avengers Anime Logo Mens T-Shirt', '\n\n        Lose yourself in the pages of a comic book or the movie adventure of a lifetime with your favorite Marvel superheroes! Whether you want to swing through the city with Spider-Man, smash some walls with the Hulk, or sail through the air with Iron Man, you\'ll need to be wearing the best Marvel designs to do it! It\'s time to get marvel-ous in awesome Marvel apparel!\n    \n\nPrinted in the U.S.A.Machine WashablePrinted with Water-Based InksFifth Sun\n\n\n\n', 2199, 'https://media.gamestop.com/i/gamestop/11142087/Marvel-Avengers-Anime-Logo-Mens-T-Shirt?$pdp2x$,', 5, 5),
	(53, 'Candyman Poster Mens T-Shirt', '\n\n        Terrify your friends with this Candyman Tee! 100% Cotton. Pre-Shrunk Knit Jersey. Classic Fit. Artwork Licensed by Goodie Two Sleeves.\n    \n\n\n', 1998, 'https://media.gamestop.com/i/gamestop/11168005/Candyman-Poster-Mens-T-Shirt?$pdp2x$,', 16, 5),
	(54, 'Senran Kagura Estival Versus - Endless Summer Edition', '\n\n        The high-flying, high-bouncing ninja girls of SENRAN KAGURA return, this time with more moves, more playable characters, more story and attitude, and more destruction online with matches that can support up to 10 players (PS4 version only; PS Vita supports up to 4 players). All the previous shinobi girls return with a host of upgraded moves to master, and new playable characters offer more challenges to conquer, along with a story that\'s equal parts sexy and shocking, serious and scandalous, busty and brawling.\n    \n\n\n\nFeatures:A Little More Violent, a Little More Sexy and a Ton More Fun - The series\' busty ninja girls take to the beach, flying high in bouncy battles with more outrageous moves than ever before.Biggest Roster in Series History - With over two dozen playable characters, each with her own style, technique and role in the story, there\'s a shinobi to fit any taste and preference.Enhanced Production Values Bring the Story to Life - Dynamic camera angles, expressive animations and full anime cutscenes deliver a storytelling experience unlike any other in the series.All-New Multiplayer Battle Royales - Up to four players on PS Vita, or up to 10 players on the PS4, can enter free-for-alls and team battles in a variety of events, from the traditional deathmatch to the less-traditional “Understorm” and “Capture the Bra.”\n\n\n\n\n\n', 1998, 'https://media.gamestop.com/i/gamestop/10127448/Senran-Kagura-Estival-Versus---Endless-Summer-Edition?$pdp2x$,https://media.gamestop.com/i/gamestop/10127447_10127448_SCR11/Senran-Kagura-Estival-Versus---Endless-Summer-Edition?$screen2x$,https://media.gamestop.com/i/gamestop/10127447_10127448_SCR10/Senran-Kagura-Estival-Versus---Endless-Summer-Edition?$screen2x$,https://media.gamestop.com/i/gamestop/10127447_10127448_SCR09/Senran-Kagura-Estival-Versus---Endless-Summer-Edition?$screen2x$,https://media.gamestop.com/i/gamestop/10127447_10127448_SCR08/Senran-Kagura-Estival-Versus---Endless-Summer-Edition?$screen2x$,https://media.gamestop.com/i/gamestop/10127447_10127448_SCR07/Senran-Kagura-Estival-Versus---Endless-Summer-Edition?$screen2x$,https://media.gamestop.com/i/gamestop/10127447_10127448_SCR06/Senran-Kagura-Estival-Versus---Endless-Summer-Edition?$screen2x$,https://media.gamestop.com/i/gamestop/10127447_10127448_SCR05/Senran-Kagura-Estival-Versus---Endless-Summer-Edition?$screen2x$,https://media.gamestop.com/i/gamestop/10127447_10127448_SCR04/Senran-Kagura-Estival-Versus---Endless-Summer-Edition?$screen2x$,https://media.gamestop.com/i/gamestop/10127447_10127448_SCR03/Senran-Kagura-Estival-Versus---Endless-Summer-Edition?$screen2x$,https://media.gamestop.com/i/gamestop/10127447_10127448_SCR02/Senran-Kagura-Estival-Versus---Endless-Summer-Edition?$screen2x$,https://media.gamestop.com/i/gamestop/10127447_10127448_SCR01/Senran-Kagura-Estival-Versus---Endless-Summer-Edition?$screen2x$,https://media.gamestop.com/i/gamestop/10127447_10127448_SCR11/Senran-Kagura-Estival-Versus---Endless-Summer-Edition?$screen$,https://media.gamestop.com/i/gamestop/10127447_10127448_SCR10/Senran-Kagura-Estival-Versus---Endless-Summer-Edition?$screen$,https://media.gamestop.com/i/gamestop/10127447_10127448_SCR09/Senran-Kagura-Estival-Versus---Endless-Summer-Edition?$screen$,https://media.gamestop.com/i/gamestop/10127447_10127448_SCR08/Senran-Kagura-Estival-Versus---Endless-Summer-Edition?$screen$,https://media.gamestop.com/i/gamestop/10127447_10127448_SCR07/Senran-Kagura-Estival-Versus---Endless-Summer-Edition?$screen$,https://media.gamestop.com/i/gamestop/10127447_10127448_SCR06/Senran-Kagura-Estival-Versus---Endless-Summer-Edition?$screen$,https://media.gamestop.com/i/gamestop/10127447_10127448_SCR05/Senran-Kagura-Estival-Versus---Endless-Summer-Edition?$screen$,https://media.gamestop.com/i/gamestop/10127447_10127448_SCR04/Senran-Kagura-Estival-Versus---Endless-Summer-Edition?$screen$,https://media.gamestop.com/i/gamestop/10127447_10127448_SCR03/Senran-Kagura-Estival-Versus---Endless-Summer-Edition?$screen$,https://media.gamestop.com/i/gamestop/10127447_10127448_SCR02/Senran-Kagura-Estival-Versus---Endless-Summer-Edition?$screen$,https://media.gamestop.com/i/gamestop/10127447_10127448_SCR01/Senran-Kagura-Estival-Versus---Endless-Summer-Edition?$screen$', 28, 28),
	(55, 'XOXO Heart Word Art  Large Tote Bag', '\n\nPage Title Created out of the letters XOXO XOXO, referring to hugs and kisses, has become the universal way of expressing affection.  This stylish "word art" heart symbol created out of X\'s and O\'s is the perfect way to take expressing love and affection to the next level.  \n\n\nMATERIAL - 100% CottonFEATURES - Tote size 20 x 15 x 5 with a 10" handle drop PRINTED WITH PRIDE IN THE USA- All of our products are printed and shipped from Las Vegas, Nevada USA.\n\n\n\n', 1499, 'https://media.gamestop.com/i/gamestop/11143845/XOXO-Heart-Word-Art--Large-Tote-Bag?$pdp2x$,https://media.gamestop.com/i/gamestop/11143845_ALT01/XOXO-Heart-Word-Art--Large-Tote-Bag?$pdp2x$,', 2, 2),
	(56, 'Amazfit T-Rex Smartwatch Green', '\n\n        Amazfit T-Rex Smartwatch with 12 Military Certifications,Rugged Body,20-day Battery Life,AMOLED Display.\n    \n\nTough from the inside out, the rugged and reliable T-Rex GPS smartwatch is ready for anything. Passing 12 military standards for robustness and resistance to harsh environments, the distinctive design boasts an outstanding 1.3" AMOLED always-on display and the ability to track 14 different sports to help you crush your fitness goals.	\n\n\n\n\n1.3" AMOLED always-on display with 360x360 resolution; Corning Gorilla Glass 3\n20 day battery life\nBluetooth 5.0 wireless technology\n12 military standard tested\nBioTracker PPG Bio-Tracking optical sensor\nAcceleration, geomagnetic, and ambient light sensors\nBuilt-in GPS, GLONASS\nSmart notifications\n14 sports modes\nWater-resistant up to 5ATM\n\n\n\n\n\n', 13999, 'https://media.gamestop.com/i/gamestop/11168821/Amazfit-T-Rex-Smartwatch-Green?$pdp2x$,https://media.gamestop.com/i/gamestop/11168821_ALT01/Amazfit-T-Rex-Smartwatch-Green?$pdp2x$,', 29, 29),
	(57, 'KidKraft Lil\' Friends Play Kitchen', '\n\n        Emojin\' the fun in the expressive KidKraft Lil\' Friends Play Kitchen that\'s full of personality! With its own line of accessories, these new kitchen buddies will be fully equipped for cooking duty. All doors feature cutout notches for opening and closing with ease.  With so much to discover—knobs, buttons, accessories—there will be stories, smiles and sweet surprises all day in the Lil\' Friends Play Kitchen.\n    \n\nMagical graphic prints pop up on the bin, mitt and even the cookies!\nWith its own line of accessories, these new kitchen buddies will be fully equipped for cooking duty\nCheerfully decorated, this pastel-hued baking center is ready to whip up creativity. \n\n\n\n', 7998, 'https://media.gamestop.com/i/gamestop/11169822/KidKraft-Lil-Friends-Play-Kitchen?$pdp2x$,https://media.gamestop.com/i/gamestop/11169822_ALT01/KidKraft-Lil-Friends-Play-Kitchen?$pdp2x$,https://media.gamestop.com/i/gamestop/11169822_ALT02/KidKraft-Lil-Friends-Play-Kitchen?$pdp2x$,https://media.gamestop.com/i/gamestop/11169822_ALT03/KidKraft-Lil-Friends-Play-Kitchen?$pdp2x$,https://media.gamestop.com/i/gamestop/11169822_ALT04/KidKraft-Lil-Friends-Play-Kitchen?$pdp2x$,', 30, 30),
	(58, 'Spider-Man Miles Morales Crew Socks (5 Pack)', '\n\n        Become apart of the Spider-Verse with this 5 pack Spiderman socks!\n    \n\nMaterial: 95% COTTON/5% SPANDEX\nCare Instructions:\n\nWash in cold water with like-colored clothes\nTumble dry on low\nUse only non-chlorine bleach\nDo not iron or dry clean\n\n\n\n\n', 999, 'https://media.gamestop.com/i/gamestop/11146922/Spider-Man-Miles-Morales-Crew-Socks-5-Pack?$pdp2x$,https://media.gamestop.com/i/gamestop/11146922_ALT01/Spider-Man-Miles-Morales-Crew-Socks-5-Pack?$pdp2x$,https://media.gamestop.com/i/gamestop/11146922_ALT02/Spider-Man-Miles-Morales-Crew-Socks-5-Pack?$pdp2x$,https://media.gamestop.com/i/gamestop/11146922_ALT03/Spider-Man-Miles-Morales-Crew-Socks-5-Pack?$pdp2x$,https://media.gamestop.com/i/gamestop/11146922_ALT04/Spider-Man-Miles-Morales-Crew-Socks-5-Pack?$pdp2x$,https://media.gamestop.com/i/gamestop/11146922_ALT05/Spider-Man-Miles-Morales-Crew-Socks-5-Pack?$pdp2x$,', 31, 31),
	(59, 'Quail in the Succulent Garden T-Shirt', '\n\n        Our regular tee is an everyday staple. This pre-shrunk classic features zero side seams, and double-needle stitched sleeves giving your wardrobe the upgrade it deserves. 100% cotton (except Heathers). Officially Licensed Art by Leroy Hornblower\n    \n\n        100% Ring Spun Cotton\n    \n\n\n', 1998, 'https://media.gamestop.com/i/gamestop/11106853/Quail-in-the-Succulent-Garden-T-Shirt?$pdp2x$,https://media.gamestop.com/i/gamestop/11106853_ALT01/Quail-in-the-Succulent-Garden-T-Shirt?$pdp2x$,', 22, 5),
	(60, 'Sonix Case for iPhone 13 Blush Quartz', '\n\n        Blush Quartz, iPhone Case features a subtle, yet statement making pink marble quartz design. Pretty & Bold. Essentials you want. Unlike others, the actual material of our cases are antimicrobial (this is not your average surface coating). The antimicrobial agent is injected and mixed into the plastic during production. This ensures that the antimicrobial protection won’t chip away nor deteriorate with use.\n    \n\nPlant it! This iPhone series is eco-friendly & biodegradable - which means while you’re protecting your phone, you’re protecting the environment, too! At Sonix, we recognize the need for environmental consciousness. As our first step, we created the recycling program, ReSonix (learn more about it here!). As we take this next step, we hope that you, too, can join us in reducing our carbon footprint towards sustainability.\n*This case is antimicrobial & biodegradable. During production, select cases were created with eco-friendly materials.\n\n\n\n\n\nAntimicrobial material*\nBiodegradable*\nGrooved impact resistant corners for added protection\nRaised bumper around camera hole\nFeaturing Sonix\'s statement-making print design with foil details\nSleek, lightweight case\n10 ft. drop protection\nScratch-resistant, protective coating, with raised shock-absorbent sides for full 360o protection\nIncludes Sonix Limited Lifetime Warranty\n\n\n\n\n\n\n', 3499, 'https://media.gamestop.com/i/gamestop/11177047/Sonix-Case-for-iPhone-13-Blush-Quartz?$pdp2x$,https://media.gamestop.com/i/gamestop/11177047_ALT01/Sonix-Case-for-iPhone-13-Blush-Quartz?$pdp2x$,', 32, 32),
	(61, 'The Crew 2 Gold Edition - Xbox One', '\n\n        Take on the American motorsports scene as you explore and dominate the land, air, and sea across the entire US.  With a wide variety of exotic cars, bikes, boats, and planes to choose from, experience the unbridled thrill and adrenaline-pumping excitement of competing across the entire US as you test your skills in a wide range of driving disciplines. Record every heart-pounding moment and share them with the simple push of a button. Fame is yours to take!\n    \n\nThe Crew? 2 Gold Edition includes:\n\nSeason Pass\nDigital Special Pack, which includes:\n	\n* DODGE CHALLENGER SRT? DEMON Interception Unit\n* PORSCHE 911 SPEEDSTER\n\n\nThe Motorsports Deluxe Pack which includes:\n	\n* FORD F-150 RAPTOR RACE TRUCK 2017\n* ABARTH 500 2008 MONSTER TRUCK EDITION\n* PILATUS PC-21\n* 3 outfits to customize your avatar\n\n\n\nFeatures:Discover the entire US through non-stop competition, no-limits exploration, and total freedom.Push boundaries in new vehicles, including planes, boats, motorcycles, and cars.Seamlessly switch between vehicles with the Fast Fav feature, to go from boat to car to plane to motorcycle, without loading screens.Make your mark on the entire motorsports scene in street and pro racing, off-road, or freestyle.Create new challenges for others when you hit achievements, and easily share all of your best moments with the press of a button.\n\n\n\n', 1798, 'https://media.gamestop.com/i/gamestop/10152805/The-Crew-2-Gold-Edition---Xbox-One?$pdp2x$,', 33, 15),
	(62, 'Country Music Stars Guitar Word Art Mens Premium Blend T-Shirt', '\n\nCreated using the some of Country Music\'s Most Legendary Names.  Created using the some of Country Music\'s Most Legendary Names - Country Music is more than just a genre of Music. It\'s a lifestyle. Country music has changed significantly over the years from small dusty bars to large arena tours. Despite the huge spike in popularity at its core the lifestyle is exactly the same. Throughout the decades there have been then leaders, the trendsetters and the geniuses that have kept Country Music alive and kicking. This guitar is created out of some of the country music\'s most popular legends (past and present) and is a celebration of Country Music as a whole.\n\n\nMATERIAL - 35% Cotton/65% PolyesterPRINTED WITH PRIDE IN THE USA - All of our products are printed and shipped from Las Vegas, Nevada USA.\n\n\n\n', 2699, 'https://media.gamestop.com/i/gamestop/11139209_black/Country-Music-Stars-Guitar-Word-Art-Mens-Premium-Blend-T-Shirt-black?$pdp2x$,', 2, 5),
	(63, 'Skinit MLB Atlanta Braves Console Skin for Xbox Series X', '\n\n        The MLB Atlanta Braves Xbox Series X Console Skin is made from a 3M durable auto-grade vinyl for an ultimate lightweight Xbox Series X Console decal protection without the bulk. Every Skinit Atlanta Braves skin is officially licensed by MLB for an authentic brand design. The Atlanta Braves Atlanta Braves Split Microsoft Xbox Series X Console decal skin is engineered to feature vibrant photo quality designs and to perfectly fit your Xbox Series X Console The Atlanta Braves Atlanta Braves Split skin can be easily applied and removed from your Xbox Series X Console with no residue, no mess and no fuss due to 3M adhesive backing. This makes it even easier for you to mix up your Xbox Series X Console style as much as you want to keep your device feeling new. All Skinit made decal skins are cut and crafted with everyday Xbox Series X Console uses in mind so that each Atlanta Braves skin offers a premium feel with a thin functional protection. Shop all officially licensed MLB Atlanta Braves Microsoft Xbox Series X Console skins made by Skinit and make it yours today!\n    \n\nUltra-Thin, Lightweight Xbox Series X Console Vinyl Decal ProtectionOffically Licensed MLB DesignIndustry Leading Vivid Color Vinyl Print TechnologyScratch - Resistant. Built To Last Everday Xbox Series X Console Use3M Adhesive Backing - Easy On, Easy Off & Residue-Free\n\n\n\n', 2499, 'https://media.gamestop.com/i/gamestop/11132850/Skinit-MLB-Atlanta-Braves-Console-Skin-for-Xbox-Series-X?$pdp2x$,https://media.gamestop.com/i/gamestop/11132850_ALT01/Skinit-MLB-Atlanta-Braves-Console-Skin-for-Xbox-Series-X?$pdp2x$,https://media.gamestop.com/i/gamestop/11132850_ALT02/Skinit-MLB-Atlanta-Braves-Console-Skin-for-Xbox-Series-X?$pdp2x$,https://media.gamestop.com/i/gamestop/11132850_ALT03/Skinit-MLB-Atlanta-Braves-Console-Skin-for-Xbox-Series-X?$pdp2x$,', 8, 12),
	(64, 'Madden NFL 17 Ultimate Team 5,850 Madden Points', 'None', 4999, 'https://media.gamestop.com/i/gamestop/10131527/Madden-NFL-17-Ultimate-Team-5850-Madden-Points?$pdp2x$,', 14, 14),
	(65, 'Arkon Mounts Pro Adjustable Smartphone/Camera Stand with Clamp Base', '\n\n        CLAMPRV29 is a high-quality heavy-duty universal phone or camera clamp mount that facilitates the creation of overhead or front facing stable videos from your smartphone on a counter, table, podium, desk, or other clampable surface from 1.5 inches up to 3.25 inches wide. This clamp stand is less prone to tipping and is especially useful for any crafter who takes photos or creates demo videos, including nail artists, woodworkers, potters, bakers, stampers, or any hobby where you want to show an overhead view. The stand’s arm easily extends upward from 17 inches to 29 inches in order to capture overhead views as well as eye-level views. A camera adapter is included for use with pico/mini projectors or MEVO cameras.\n    \n\n        CLAMPRV29 securely fits phones with cases weighing up to 2 pounds and measuring up to 3.9 inches wide, including Apple iPhone 13 Pro Max, iPhone 13 Pro, iPhone 13, iPhone 13 mini, iPhone 12 Pro Max, iPhone 12 Pro, iPhone 12, iPhone 12 mini, iPhone 11 Pro Max, iPhone 11 Pro, iPhone 11, iPhone XS Max, iPhone XS, iPhone XR, and iPhone X, Samsung Galaxy Z Flip, Galaxy S21 Ultra, Galaxy S21 and S20, Galaxy S10, A11, A12, A32, A42, A52, A71, Galaxy Note 20 and Note 10, Google Pixel 6 and 5, Motorola Moto G, and LG G7, G6, and G5. Whether you\'re creating a live demo of your baking or nail art, or just want to add stability and height to your videos or photos, CLAMPRV29 is a must-have companion accessory.\n    \n\n\n\nFor live DIY demos, videos, or photos of your hobby\nCreate overhead or front facing stable videos with your phone\nFor all phones including iPhone 13 and Galaxy S21\nIncludes camera adapter for pico/mini projectors or cameras\n2 year limited warranty\n\n\n\n\n\n', 9995, 'https://media.gamestop.com/i/gamestop/11179704/Arkon-Mounts-Pro-Adjustable-Smartphone/Camera-Stand-with-Clamp-Base?$pdp2x$,https://media.gamestop.com/i/gamestop/11179704_ALT01/Arkon-Mounts-Pro-Adjustable-Smartphone/Camera-Stand-with-Clamp-Base?$pdp2x$,https://media.gamestop.com/i/gamestop/11179704_ALT02/Arkon-Mounts-Pro-Adjustable-Smartphone/Camera-Stand-with-Clamp-Base?$pdp2x$,https://media.gamestop.com/i/gamestop/11179704_ALT03/Arkon-Mounts-Pro-Adjustable-Smartphone/Camera-Stand-with-Clamp-Base?$pdp2x$,', 34, 33),
	(66, 'iPad Pro 10.5-Inch 128GB - WiFi', '\n\n        A new 10.5-inch display.\nThe new 10.5-inch iPad Pro comes with a screen nearly 20 percent larger than the 9.7-inch model, so you get more room to do more. It also delivers a full-size onscreen keyboard, yet it’s just as portable as ever. \niPad has always offered the ultimate Multi-Touch experience. The redesigned Retina display on iPad Pro sets a whole new standard. It’s not just brighter and less reflective — with ProMotion technology, it’s also far more responsive. So whether you’re scrolling through pages in Safari or playing an intense 3D game, everything feels utterly smooth, fast, and immersive.\n    \n\nThis product has been repaired and restored to a like-new state and has been fully tested for functionality. Product may have noticeable cosmetic blemishes (such a light scratches). ?Any defective modules identified in testing are replaced. Each product undergoes a final inspection prior to being sold as a refurbished item.\nFEATURES:\n\nWi-Fi (802.11a/b/g/n/ac)\nBluetooth 4.2 technology\n10.5-inch Retina display\n12-megapixel iSight camera\nFaceTime HD camera\n1080p HD video recording\nA10X Fusion chip with 64-bit architecture\nEmbedded M10 coprocessor\n10-hour battery life\nMulti-Touch screen\n1.03 pounds and 0.24 inch\nIncludes original operating system shipped with the unit, or a more recent version.\nThis item is thoroughly cleaned and inspected, and is repackaged including cables, accessories, and box. This item does not come with a manual.\nGameStop backs this item with a limited 1-year warranty\n\nSPECIFICATIONS:\n\nScreen Size: 10.5 inches\nScreen Resolution: 2224 x 1668\nProcessor Model: A10X Fusion chip with 64?bit architecture Embedded M10 coprocessor\nTotal Storage Capacity: 128 gigabytes\nOperating System: Apple iOS 10\nVoice Assistant Built-in: Siri\nWorks With: Apple HomeKit\nInternet Connectivity: Wi-Fi\nBattery Type: Lithium-polymer\nSecurity Features: Fingerprint reader, Password Protection\n\n\n\n\n', 34999, 'https://media.gamestop.com/i/gamestop/11164742_gold/iPad-Pro-10.5-Inch-128GB---WiFi-gold?$pdp2x$,https://media.gamestop.com/i/gamestop/11164742_gold_ALT01/iPad-Pro-10.5-Inch-128GB---WiFi-gold?$pdp2x$,', 35, 34),
	(67, 'Deadbeat Heroes', '\n\n        London\'s Super Heroes have been vanquished. Only the Deadbeat Heroes can put an end to dastardly evil-doers and their rotten plans!\nDeadbeat Heroes is a movement-based 3D brawler in which you dodge bullets, steal super powers and crack wise. You play as the new wave of ‘Deadbeat Heroes’. Not born with their own powers, they are armed with a super gauntlet and the ability to \'borrow\' the powers of others. Vie to win the hearts of the public with your amazing derring-do, while not getting shot, sliced or lasered.\n\n\n\nFeatures\n\nPower Fists Forever - Choose from one of 10 explosive abilities including a rocket powered punch, freeze ray and invisibility<br/>\n\nLondon\'s Streets - Over 35 levels set across London<br/>\n\nExtreme Traversal - Wall Run & Air Dash through London<br/>\n\nAlone or with a Friend - 1 to 2 player local campaign co-op<br/>\n    \n\n\n?Power Fists Forever – Choose from one of 10 explosive abilities including a rocket-powered punch, freeze ray and invisibility\nLondon’s Streets – Over 35 levels set across London\nExtreme Traversal – Wall Run & Air Dash through London\nAlone or with a Friend - 1 to 2 player local campaign co-op\n\n\n\n\n', 1499, 'https://media.gamestop.com/i/gamestop/10174691/Deadbeat-Heroes?$pdp2x$,', 36, 15),
	(68, 'Skinit University of Florida Gators Skin Bundle for PlayStation 4', '\n\n        The University of Florida PS4 Console and Controller Bundle Skin is made from a 3M durable auto-grade vinyl for an ultimate lightweight PS4 Console and Controller Bundle decal protection without the bulk. Every Skinit University of Florida skin is officially licensed by Collegiate Licensing Co for an authentic brand design. The University of Florida Florida Gators Sony PS4 Console and Controller Bundle decal skin is engineered to feature vibrant photo quality designs and to perfectly fit your PS4 Console and Controller Bundle The University of Florida Florida Gators skin can be easily applied and removed from your PS4 Console and Controller Bundle with no residue, no mess and no fuss due to 3M adhesive backing. This makes it even easier for you to mix up your PS4 Console and Controller Bundle style as much as you want to keep your device feeling new. All Skinit made decal skins are cut and crafted with everyday PS4 Console and Controller Bundle uses in mind so that each University of Florida skin offers a premium feel with a thin functional protection. Shop all officially licensed University of Florida Sony PS4 Console and Controller Bundle skins made by Skinit and make it yours today!\n    \n\nUltra-Thin, Lightweight PS4 Console and Controller Bundle Vinyl Decal ProtectionOffically Licensed Collegiate Licensing Co DesignIndustry Leading Vivid Color Vinyl Print TechnologyScratch - Resistant. Built To Last Everday PS4 Console and Controller Bundle Use3M Adhesive Backing - Easy On, Easy Off and Residue-Free\n\n\n\n', 3999, 'https://media.gamestop.com/i/gamestop/11114937/Skinit-University-of-Florida-Gators-Skin-Bundle-for-PlayStation-4?$pdp2x$,https://media.gamestop.com/i/gamestop/11114937_ALT01/Skinit-University-of-Florida-Gators-Skin-Bundle-for-PlayStation-4?$pdp2x$,https://media.gamestop.com/i/gamestop/11114937_ALT02/Skinit-University-of-Florida-Gators-Skin-Bundle-for-PlayStation-4?$pdp2x$,https://media.gamestop.com/i/gamestop/11114937_ALT03/Skinit-University-of-Florida-Gators-Skin-Bundle-for-PlayStation-4?$pdp2x$,', 8, 26),
	(69, 'Late for the Sky Jacks-opoly Board Game', '\n\n        Jacks-opoly is a game of tail-wagging fun! Increase your rent by buying Toys for your dogs and upgrading them to Big Bones. Sounds easy enough until you get fleas, have an accident on the carpet, or you\'re sent to the Kennel!\n    \n\n\nLoyal, friendly, unique, boundless... meet the Jack Russell! The Jack Russell is a happy, bold, and energetic little dog. They are intelligent and assertive, so if you let them take an inch, they will be happy to take a mile! For that reason it is very important for Jacks to have a person who is willing to be the pack leader. Equally contented hunting a fox or killing a sock in the living room, they are very amusing characters with a boundless energy that can sometimes be overwhelming!\nJacks-opoly is a game of tail-wagging fun! Collect your favorite Jacks and play hard! Increase your rent by buying Toys for your dogs and upgrading them to Big Bones. Sounds easy enough until you get fleas, have an accident on the carpet, or you\'re sent to the Kennel - then you\'re out of the game for three turns! Whatever happens... it\'s a doggone good time!\n\n\n\n\n', 2499, 'https://media.gamestop.com/i/gamestop/11176990/Late-for-the-Sky-Jacks-opoly-Board-Game?$pdp2x$,https://media.gamestop.com/i/gamestop/11176990_ALT01/Late-for-the-Sky-Jacks-opoly-Board-Game?$pdp2x$,https://media.gamestop.com/i/gamestop/11176990_ALT02/Late-for-the-Sky-Jacks-opoly-Board-Game?$pdp2x$,', 37, 11),
	(70, 'Sonix Case for iPhone 12/12 Pro Cosmic', '\n\n        Cosmic iPhone case is a Sonix original. This case features stars, moons, and eyes foiled in gold - making it a fan favorite. Pretty & Bold. Unlike others, the actual material of our cases are antimicrobial (this is not your average surface coating). The antimicrobial agent is injected and mixed into the plastic during production. This ensures that the antimicrobial protection won’t chip away nor deteriorate with use.\n    \n\nPlant it! This iPhone series is eco-friendly & biodegradable - which means while you’re protecting your phone, you’re protecting the environment, too! At Sonix, we recognize the need for environmental consciousness. As our first step, we created the recycling program, ReSonix (learn more about it here!). As we take this next step, we hope that you, too, can join us in reducing our carbon footprint towards sustainability.\n*This case is antimicrobial & biodegradable. During production, select cases were created with eco-friendly materials.\n\n\n\n\nAntimicrobial material*\nBiodegradable*\n Grooved impact resistant corners for added protection\n Raised bumper around camera hole\n Featuring Sonix’s statement-making print design with foil details\n Sleek, lightweight case\n10 ft. drop protection\n Scratch-resistant, protective coating, with raised shock-absorbent sides for full 360o protection\n Includes Sonix Limited Lifetime Warranty\n\n\n\n\n\n', 3499, 'https://media.gamestop.com/i/gamestop/11159843/Sonix-Case-for-iPhone-12/12-Pro-Cosmic?$pdp2x$,https://media.gamestop.com/i/gamestop/11159843_ALT01/Sonix-Case-for-iPhone-12/12-Pro-Cosmic?$pdp2x$,https://media.gamestop.com/i/gamestop/11159843_ALT02/Sonix-Case-for-iPhone-12/12-Pro-Cosmic?$pdp2x$,https://media.gamestop.com/i/gamestop/11159843_ALT03/Sonix-Case-for-iPhone-12/12-Pro-Cosmic?$pdp2x$,https://media.gamestop.com/i/gamestop/11159843_ALT04/Sonix-Case-for-iPhone-12/12-Pro-Cosmic?$pdp2x$,', 32, 32),
	(71, 'Max Payne 2: The Fall of Max Payne', '\n\n        Max Payne 2: The Fall of Max Payne is a violent, film-noir love story. Dark, tragic and intense, the in-depth story is a thrill-ride of shocking twists and revelations. Love hurts.\n    \n\nMax Payne 2: The Fall of Max Payne delivers the most intense gameplay experience imaginable. The fierce, yet stylish action sequences and slow-motion gunplay that has become synonymous with Max Payne is back and better than ever. New and enhanced moves and options provide breathtaking cinematic game play. Max Payne 2: The Fall of Max Payne raises the bar on action games all over again.\n\n\n\n', 999, 'https://media.gamestop.com/i/gamestop/10027803/Max-Payne-2-The-Fall-of-Max-Payne?$pdp2x$,', 38, 21),
	(72, 'Super7 ReAction SpongeBob Squarepants - SpongeBob Squarepantss Wave 1 3.75-in Action Figure', '\n\n        Whether you love SpongeBob SquarePants for his irrepressible spirit or you just have a thing for passionate fry cooks, this 3.75” ReAction Figure is what you’ve been waiting for. Wearing his Krusty Krab hat, and holding his trusty spatula and a perfect Krabby Patty, SpongeBob is ready for some patty-flippin’ action! Add SpongeBob SquarePants to your menagerie of Bikini Bottom\'s best today!\n    \n\nFEATURES:\n\nMeasures 3.75" tall\nSpongeBob Squarepants\nFor ages 14 and up\nWARNING: Choking hazard. May contain small parts.\nAdult collectible - Not a toy.\n\n?\n\n\n\n', 1798, 'https://media.gamestop.com/i/gamestop/11112076/Super7-ReAction-SpongeBob-Squarepants---SpongeBob-Squarepantss-Wave-1-3.75-in-Action-Figure?$pdp2x$,https://media.gamestop.com/i/gamestop/11112076_ALT01/Super7-ReAction-SpongeBob-Squarepants---SpongeBob-Squarepantss-Wave-1-3.75-in-Action-Figure?$pdp2x$,', 39, 7),
	(73, 'NBA Live 16 Ultimate Team 1,050 NBA Points', '\n\n        USE YOUR NBA POINTS TO OPEN ULTIMATE TEAM*PACKS AND BUILD YOUR LIVE ULTIMATE TEAMEVEN FASTER.\n    \n\n\n\n                Build your team of NBA Stars and Legends, and takethem to the hardwood to compete for ultimate glory.\n            \n\n\n\n\n', 999, 'https://media.gamestop.com/i/gamestop/10130778/NBA-Live-16-Ultimate-Team-1050-NBA-Points?$pdp2x$,', 14, 14),
	(74, 'Grand Theft Auto Online: The Great White Shark Cash Card', '\n\n        Purchase the Great White Shark Cash Card to gain 1,250,000 in-game GTA dollars to spend in GTA Online.Cash is king in this town. Solve your money problem and help get what you want across Los Santos and Blaine County with the occasional purchase of cash packs for Grand Theft Auto Online. All purchased cash is automatically deposited into your character\'s bank account. Spend wisely, cash therapy is fleeting.Grand Theft Auto V required to play and sold separately.\n    \n\nCash is king in this town. Solve your money problem and help get what you want across Los Santos and Blaine County with the Great White Shark Cash Card worth $1,250,000 in-game GTA dollars to spend in Grand Theft Auto Online. All purchased cash is automatically deposited into your character\'s bank account. Spend wisely, cash therapy is fleeting.\nCertain limits apply to purchase, use, and redemption. See EULA www.rockstargames.com/eula and Terms of Service www.rockstargames.com/legal for details.\n\n\n\n', 1998, 'https://media.gamestop.com/i/gamestop/10121299/Grand-Theft-Auto-Online-The-Great-White-Shark-Cash-Card?$pdp2x$,https://media.gamestop.com/i/gamestop/10121299_10121300_10130748_SCR15/Grand-Theft-Auto-Online-The-Great-White-Shark-Cash-Card?$screen2x$,https://media.gamestop.com/i/gamestop/10121299_10121300_10130748_SCR14/Grand-Theft-Auto-Online-The-Great-White-Shark-Cash-Card?$screen2x$,https://media.gamestop.com/i/gamestop/10121299_10121300_10130748_SCR11/Grand-Theft-Auto-Online-The-Great-White-Shark-Cash-Card?$screen2x$,https://media.gamestop.com/i/gamestop/10121299_10121300_10130748_SCR10/Grand-Theft-Auto-Online-The-Great-White-Shark-Cash-Card?$screen2x$,https://media.gamestop.com/i/gamestop/10121299_10121300_10130748_SCR09/Grand-Theft-Auto-Online-The-Great-White-Shark-Cash-Card?$screen2x$,https://media.gamestop.com/i/gamestop/10121299_10121300_10130748_SCR08/Grand-Theft-Auto-Online-The-Great-White-Shark-Cash-Card?$screen2x$,https://media.gamestop.com/i/gamestop/10121299_10121300_10130748_SCR07/Grand-Theft-Auto-Online-The-Great-White-Shark-Cash-Card?$screen2x$,https://media.gamestop.com/i/gamestop/10121299_10121300_10130748_SCR05/Grand-Theft-Auto-Online-The-Great-White-Shark-Cash-Card?$screen2x$,https://media.gamestop.com/i/gamestop/10121299_10121300_10130748_SCR04/Grand-Theft-Auto-Online-The-Great-White-Shark-Cash-Card?$screen2x$,https://media.gamestop.com/i/gamestop/10121299_10121300_10130748_SCR03/Grand-Theft-Auto-Online-The-Great-White-Shark-Cash-Card?$screen2x$,https://media.gamestop.com/i/gamestop/10121299_10121300_10130748_SCR02/Grand-Theft-Auto-Online-The-Great-White-Shark-Cash-Card?$screen2x$,https://media.gamestop.com/i/gamestop/10121299_10121300_10130748_SCR01/Grand-Theft-Auto-Online-The-Great-White-Shark-Cash-Card?$screen2x$,https://media.gamestop.com/i/gamestop/10121299_10121300_10130748_SCR15/Grand-Theft-Auto-Online-The-Great-White-Shark-Cash-Card?$screen$,https://media.gamestop.com/i/gamestop/10121299_10121300_10130748_SCR14/Grand-Theft-Auto-Online-The-Great-White-Shark-Cash-Card?$screen$,https://media.gamestop.com/i/gamestop/10121299_10121300_10130748_SCR11/Grand-Theft-Auto-Online-The-Great-White-Shark-Cash-Card?$screen$,https://media.gamestop.com/i/gamestop/10121299_10121300_10130748_SCR10/Grand-Theft-Auto-Online-The-Great-White-Shark-Cash-Card?$screen$,https://media.gamestop.com/i/gamestop/10121299_10121300_10130748_SCR09/Grand-Theft-Auto-Online-The-Great-White-Shark-Cash-Card?$screen$,https://media.gamestop.com/i/gamestop/10121299_10121300_10130748_SCR08/Grand-Theft-Auto-Online-The-Great-White-Shark-Cash-Card?$screen$,https://media.gamestop.com/i/gamestop/10121299_10121300_10130748_SCR07/Grand-Theft-Auto-Online-The-Great-White-Shark-Cash-Card?$screen$,https://media.gamestop.com/i/gamestop/10121299_10121300_10130748_SCR05/Grand-Theft-Auto-Online-The-Great-White-Shark-Cash-Card?$screen$,https://media.gamestop.com/i/gamestop/10121299_10121300_10130748_SCR04/Grand-Theft-Auto-Online-The-Great-White-Shark-Cash-Card?$screen$,https://media.gamestop.com/i/gamestop/10121299_10121300_10130748_SCR03/Grand-Theft-Auto-Online-The-Great-White-Shark-Cash-Card?$screen$,https://media.gamestop.com/i/gamestop/10121299_10121300_10130748_SCR02/Grand-Theft-Auto-Online-The-Great-White-Shark-Cash-Card?$screen$,https://media.gamestop.com/i/gamestop/10121299_10121300_10130748_SCR01/Grand-Theft-Auto-Online-The-Great-White-Shark-Cash-Card?$screen$', 38, 14),
	(75, 'DOOM Eternal Year 1 Pass', '\n\n        Access  to two campaign add-ons to release within first year of DOOM Eternal’s launch date.\n    \n\n\n\nMinimum Requirements:\n\nRequires a 64-bit processor and operating system\nOS: 64-bit Windows 7 / 64-Bit Windows 10\nProcessor: Intel Core i5 @ 3.3 GHz or better, or AMD Ryzen 3 @ 3.1 GHz or better\nMemory: 8 GB RAM\nGraphics: NVIDIA GeForce GTX 1050Ti (4GB), GTX 1060 (3GB), GTX 1650 (4GB) or AMD Radeon R9 280(3GB), AMD Radeon R9 290 (4GB), RX 470 (4GB)\nNetwork: Broadband Internet connection\nStorage: 50 GB available space\nAdditional Notes: ( 1080p / 60 FPS / Low Quality Settings )\nRecommended Requirements: \n\nRequires a 64-bit processor and operating system\nOS: 64-bit Windows 10\nProcessor: Intel Core i7-6700K or better, or AMD Ryzen 7 1800X or better\nMemory: 8 GB RAM\nGraphics: NVIDIA GeForce GTX 1060 (6GB), NVIDIA GeForce 970 (4GB), AMD RX 480 (8GB)\nNetwork: Broadband Internet connection\nStorage: 50 GB available space\nAdditional Notes: ( 1080p / 60 FPS / High Quality Settings ) - *On NVIDIA GTX 970 cards Texture Quality should be set to Medium\n\n\n\n\n\n', 2999, 'https://media.gamestop.com/i/gamestop/11101548/DOOM-Eternal-Year-1-Pass?$pdp2x$,https://media.gamestop.com/i/gamestop/11101548_ALT01/DOOM-Eternal-Year-1-Pass?$pdp2x$,', 40, 21),
	(76, 'Banpresto Dragon Ball Z Gxmateria Krillin 4.4-in Statue', '\n\n        Krillin is a major supporting protagonist in the Dragon Ball Z series. He met Goku when they were kids and considered Goku his rival while they were training under Master Roshi. While he may be overpowered by major enemies throughout the series, Krillin is still considered an important member of the Z Fighters\n    \n\n\n\n\nBased off the Dragon Ball Z series\nFigure is approximately 4.4-in tall\nPerfect for any Krillin fan\n\n\n\n\n\n\n', 2699, 'https://media.gamestop.com/i/gamestop/11171248/Banpresto-Dragon-Ball-Z-Gxmateria-Krillin-4.4-in-Statue?$pdp2x$,https://media.gamestop.com/i/gamestop/11171248_ALT01/Banpresto-Dragon-Ball-Z-Gxmateria-Krillin-4.4-in-Statue?$pdp2x$,https://media.gamestop.com/i/gamestop/11171248_ALT02/Banpresto-Dragon-Ball-Z-Gxmateria-Krillin-4.4-in-Statue?$pdp2x$,https://media.gamestop.com/i/gamestop/11171248_ALT03/Banpresto-Dragon-Ball-Z-Gxmateria-Krillin-4.4-in-Statue?$pdp2x$,https://media.gamestop.com/i/gamestop/11171248_ALT04/Banpresto-Dragon-Ball-Z-Gxmateria-Krillin-4.4-in-Statue?$pdp2x$,', 41, 20),
	(77, 'Beavis and Butt-Head Cornholio T-Shirt', '\n\n        Beavis and Butthead is a classic adult animated series that still affects pop culture to this day. Show everyone you\'re a fan with the Beavis and Butt-Head Cornholio T-Shirt. This short sleeve crew neck tee is made of 100% Cotton and features a printed Beavis and Butthead graphic on front.\n    \n\nFEATURES:\n\n100% Cotton\nPrinted Beavis and Butt-Head graphic\nShort sleeves\nCrew neck\nMachine wash cold with like colors. Tumble dry low. Non chlorine bleach only. Do not iron if decorated.\n\n\n\n\n', 1998, 'https://media.gamestop.com/i/gamestop/11112352/Beavis-and-Butt-Head-Cornholio-T-Shirt?$pdp2x$,https://media.gamestop.com/i/gamestop/11112352_ALT01/Beavis-and-Butt-Head-Cornholio-T-Shirt?$pdp2x$,https://media.gamestop.com/i/gamestop/11112352_ALT02/Beavis-and-Butt-Head-Cornholio-T-Shirt?$pdp2x$,', 31, 5),
	(78, 'Cardinal Classics Double-Six Dominoes', '\n\n        Bring some old-fashioned family fun to game night with this high quality Dominoes set. Double Six Dominoes is perfect for beginners and experts. The starter piece enhances gameplay while the bright colored dots make gameplay easier. This Double Six Dominoes set includes 28 durable, color-coded, ivory-colored dominoes that stack neatly into a durable storage tin and a starter piece. Learn to play different variations with the included instructions.\n    \n\nWhat\'s Included:\n\n28 Dominoes\nStarter piece\nStorage tin\nInstructions\n\nSpecifications:\n\nAges 8 and up\nFor 2-6 Players\n\n\n\n\n', 599, 'https://media.gamestop.com/i/gamestop/11155808/Cardinal-Classics-Double-Six-Dominoes?$pdp2x$,https://media.gamestop.com/i/gamestop/11155808_ALT01/Cardinal-Classics-Double-Six-Dominoes?$pdp2x$,https://media.gamestop.com/i/gamestop/11155808_ALT02/Cardinal-Classics-Double-Six-Dominoes?$pdp2x$,https://media.gamestop.com/i/gamestop/11155808_ALT03/Cardinal-Classics-Double-Six-Dominoes?$pdp2x$,', 42, 11),
	(79, 'Call of Duty: Advanced Warfare Reckoning', '\n\n        Brace yourself for Reckoning, the final downloadable content pack for Call of Duty?: Advanced Warfare. Grapple your way out of bottomless pits, dodge plasma lamp explosions and boost jump off crumbling glaciers in four all-new MP maps.  The culmination of the Exo Zombies saga: Descent introduces a remote ocean Atlas survival facility, new “fused” zombie enemies, and the Trident Reflected Energy Weapon. Discover the true cause of the global pandemic and the terrible secret that Atlas has been hiding.\n    \n\n\n\nBulletizedBrace yourself for Reckoning, the final downloadable content pack for Call of Duty?: Advanced Warfare:Drone swarms, plasma lamp explosions and crumbling glaciers dial up the excitement in four new MP maps. The Exo Grapple Playlist delivers more carnage and more fast-paced MP combat than ever before.  The culmination of the Exo Zombies saga: Descent delivers an all-new map, fused zombie enemies and the Trident Reflected Energy Weapon. Discover the true cause of the global pandemic and the terrible secret that Atlas has been hiding.Multiplayer Maps:Overload: Enjoy the grand view of downtown New Baghdad from this exotic compound, complete with fountains, gardens and decorative plasma lamps. The map\'s multiple levels and long perimeter site-lines highlight medium to long-range combat and firing a shot at the lamps will send enemies flying in a burst of energy.Quarantine: Following a deadly viral outbreak, the island has been converted into a biological testing center. This medium sized map\'s tight corners dial up the speed and open areas combine to allow for any style of gameplay. Watch your step in the atrium as the timed dynamic event opens up a bottomless disposal pit. Fracture: Discover what secrets are locked in the ice in this arctic excavation site. Take refuge behind wind turbines and heavy equipment through large combat areas cradled on the shelf of a glacier. Stay alert as the timed event cracks the ice sheet, sending one lane sinking to the depths. Swarm: Reconstruction is underway in Seoul, South Korea, congesting narrow corridors of this small to medium sized map with vehicles and equipment. Take position in war-scarred storefronts that provide plenty of cover and flush out the enemy with the drone swarm scorestreak.Exo Grapple Playlist: The Exo Grapple Playlist returns, delivering more carnage and more fast-paced MP combat than ever before. The unique grappling ability from campaign mode is available to use in all Reckoning DLC maps.  Exo Zombies:The culmination of the Exo Zombies saga: Descent delivers an all-new map, fused zombie enemies and the Trident Reflected Energy Weapon. Discover the true cause of the global pandemic and the terrible secret Atlas has been hiding.  \n\n\n\n\n\n', 1500, 'https://media.gamestop.com/i/gamestop/10119741/Call-of-Duty-Advanced-Warfare-Reckoning?$pdp2x$,', 20, 15),
	(80, 'Space Invaders Countercade', '\n\n        Brace yourself to be plunged back in time to an era of adrenaline pumping, old school fun with Arcade1Up as it brings iconic gaming back to you. Whether you are a retro junkie or curious to check out the hype - this is the perfect way to enjoy arcade play within your home, dorm room or office. Arcade1Up Countercades are available in multiple exciting versions that feature a table top design with commercial grade construction and coinless operation. All the machines feature original artwork of all-time iconic games. With immersive full-color hi-res displays and sounds, and full size joysticks and control buttons setup, you are looking at endless hours of gaming! Countertop style arcade game. Perfect size for kids, desks, and small spaces!\n    \n\n\n', 14999, 'https://media.gamestop.com/i/gamestop/10174200/Space-Invaders-Countercade?$pdp2x$,', 43, 35),
	(81, 'Brydge 10.5 Bluetooth Keyboard for iPad Pro 10.5-in Silver', '\n\n        The Brydge 10.5 Bluetooth keyboard brings versatility and productivity to your fingertips. When combined with the iPad Air, they create the ultimate in mobile productivity. A perfect balance between tablet and laptop, giving you the power to be mobile and highly productive. Anytime, anywhere.\n    \n\nFEATURES:\n\n0-180° Viewing Angles: Versatile viewing angles from 0-180° through a strong patented hinge design that fits securely to your iPad mini. Whether you\'re taking notes on your lap, watching a movie in bed, or composing an email, you can rest assured in the stability of your device.\nAmazing Typing Experience: The Brydge 10.5 has the most efficient typing experience on a tablet keyboard. With only 1.2mm\'s of travel on the keys, the natural tactile typing experience delivers the feel, sound, and response you expect. A full keyboard with 3-level backlit keys, and a top row of dedicated iOS special function keys.\nStrong and Durable: Forged out of a single piece of high-grade aluminum for added strength, beauty, and the premium feel you expect. The Brydge 10.5 keeps mobility simple and light, and brings quality design to match your iPad.\n3-Level Backlit Keys: LED Backlit keys that provide the ultimate typing experience in low to no light conditions. 3 levels of back light to meet your visibility demands. A feature that comes in very handy when you need it most.\nBluetooth Connectivity: Bluetooth for fast pairing and a lag-free typing experience. Type easier, type faster, type confidently.\nOne Year Warranty & Support: Brydge prides itself on the quality and durability of its products. All Brydge products come with a Limited One Year Warranty & free customer support based in Park City, Utah, USA.\n\n\n\n\n', 12999, 'https://media.gamestop.com/i/gamestop/11151057/Brydge-10.5-Bluetooth-Keyboard-for-iPad-Pro-10.5-in-Silver?$pdp2x$,https://media.gamestop.com/i/gamestop/11151057_ALT01/Brydge-10.5-Bluetooth-Keyboard-for-iPad-Pro-10.5-in-Silver?$pdp2x$,https://media.gamestop.com/i/gamestop/11151057_ALT02/Brydge-10.5-Bluetooth-Keyboard-for-iPad-Pro-10.5-in-Silver?$pdp2x$,', 44, 36),
	(82, 'Skinit The Nightmare Before Christmas Jack Skellington Console Skin for Xbox Series S', '\n\n        The The Nightmare Before Christmas Xbox Series S Console Skin is made from a 3M durable auto-grade vinyl for an ultimate lightweight Xbox Series S Console decal protection without the bulk. Every Skinit The Nightmare Before Christmas skin is officially licensed by Disney for an authentic brand design. The The Nightmare Before Christmas Jack Skellington Microsoft Xbox Series S Console decal skin is engineered to feature vibrant photo quality designs and to perfectly fit your Xbox Series S Console The The Nightmare Before Christmas Jack Skellington skin can be easily applied and removed from your Xbox Series S Console with no residue, no mess and no fuss due to 3M adhesive backing. This makes it even easier for you to mix up your Xbox Series S Console style as much as you want to keep your device feeling new. All Skinit made decal skins are cut and crafted with everyday Xbox Series S Console uses in mind so that each The Nightmare Before Christmas skin offers a premium feel with a thin functional protection. Shop all officially licensed The Nightmare Before Christmas Microsoft Xbox Series S Console skins made by Skinit and make it yours today!\n    \n\nUltra-Thin, Lightweight Xbox Series S Console Vinyl Decal ProtectionOffically Licensed Disney DesignIndustry Leading Vivid Color Vinyl Print TechnologyScratch - Resistant. Built To Last Everday Xbox Series S Console Use3M Adhesive Backing - Easy On, Easy Off & Residue-Free\n\n\n\n', 2499, 'https://media.gamestop.com/i/gamestop/11128924/Skinit-The-Nightmare-Before-Christmas-Jack-Skellington-Console-Skin-for-Xbox-Series-S?$pdp2x$,https://media.gamestop.com/i/gamestop/11128924_ALT01/Skinit-The-Nightmare-Before-Christmas-Jack-Skellington-Console-Skin-for-Xbox-Series-S?$pdp2x$,https://media.gamestop.com/i/gamestop/11128924_ALT02/Skinit-The-Nightmare-Before-Christmas-Jack-Skellington-Console-Skin-for-Xbox-Series-S?$pdp2x$,https://media.gamestop.com/i/gamestop/11128924_ALT03/Skinit-The-Nightmare-Before-Christmas-Jack-Skellington-Console-Skin-for-Xbox-Series-S?$pdp2x$,', 8, 12),
	(83, 'Nintendo 3DS XL Super Mario Bros. 2 Red', '\n\n        Everything you love about Nintendo 3DS-only bigger!\n    \n\n\n\nIncludes: System, ac adapter, stylusExtra Large 3D ScreenThe top screen of the Nintendo 3DS XL system are 90% larger than that of the original Nintendo 3DS, at 4.88 inches. It\'s the largest screen on a Nintendo handheld to date! The lower screen is also getting a bump up from 3 inches to 4.18 inches. Longer Battery LifeGet your game on for even longer! The Nintendo 3DS XL comes with an estimated 6.5 hours of battery life - a noticeable increase from the 3.5 hours on the original Nintendo 3DS. KEY FEATURES:90% Larger Screen: 4.88-inch stereoscopic screen, compared with a 3.53-inch screen in the current model — nearly double the size The lower touch-panel screen will also get a bump to 4.18 inches from 3 inches. Longer battery life: Outperforms the original Nintendo 3DS. Estimated battery life is 3.5 to 6.5 hours AC adapter (no charging cradle) \n\n\n\n\n\n', 13999, 'https://media.gamestop.com/i/gamestop/10129119/Nintendo-3DS-XL-Super-Mario-Bros.-2-Red?$pdp2x$,', 27, 37),
	(84, 'Word Whiz Electronic Flash Card 3 Skill Levels', '\n\n        Encourage children to practice word-building skills with this handheld game. 3 skill levels challenge you to build as many 3, 4, and 5 letter words as possible in 60 seconds. Requires 3 AA batteries, not included.\n    \n\n        Encourage children to practice word-building skills with this handheld game. 3 skill levels challenge you to build as many 3, 4, and 5 letter words as possible in 60 seconds. Requires 3 AA batteries, not included.\n    \n\n\n', 1663, 'https://media.gamestop.com/i/gamestop/11145949/Word-Whiz-Electronic-Flash-Card-3-Skill-Levels?$pdp2x$,', 45, 9),
	(85, 'Atrix Guild Series 2021 PC Holiday Bundle', '\n\n        The Atrix Guild Series PC Bundle gives you the edge you need for all your favorite MMO and RPG games. Turn your setup into a pro battle station with this high-performance bundle. The Guild bundle features everything you need to level up your game.\n    \n\n\n\n\nWhat\'s Included: 1 Mouse, 1 Keyboard, and 1 Mousepad\nThe XXL mousepad covers your desktop and gives you ample room to adventure through your favorite gaming universe with smooth movements\nThe high precision 16000 DPI mouse comes with interchangeable side panels to customize your layout. Find the perfect grip and choose between 8 or 14 buttons\nThe full size RGB keyboard has 5 onboard programmable macro keys to record any combo move\nThe Outemu Brown mechanical switches deliver tactile feedback with shine-through RGB lighting\nNever pause your game and control your universe with the volume scroll wheel and multimedia keys\nFrom spell casting to looting, never run out of moves with the Atrix Guild Series PC Bundle.\n\n\n\n\n\n\n', 12999, 'https://media.gamestop.com/i/gamestop/11176059/Atrix-Guild-Series-2021-PC-Holiday-Bundle?$pdp2x$,https://media.gamestop.com/i/gamestop/11176059_ALT01/Atrix-Guild-Series-2021-PC-Holiday-Bundle?$pdp2x$,https://media.gamestop.com/i/gamestop/11176059_ALT02/Atrix-Guild-Series-2021-PC-Holiday-Bundle?$pdp2x$,https://media.gamestop.com/i/gamestop/11176059_ALT03/Atrix-Guild-Series-2021-PC-Holiday-Bundle?$pdp2x$,https://media.gamestop.com/i/gamestop/11176059_ALT04/Atrix-Guild-Series-2021-PC-Holiday-Bundle?$pdp2x$,https://media.gamestop.com/i/gamestop/11176059_ALT05/Atrix-Guild-Series-2021-PC-Holiday-Bundle?$pdp2x$,https://media.gamestop.com/i/gamestop/11176059_ALT06/Atrix-Guild-Series-2021-PC-Holiday-Bundle?$pdp2x$,https://media.gamestop.com/i/gamestop/11176059_ALT07/Atrix-Guild-Series-2021-PC-Holiday-Bundle?$pdp2x$,', 46, 38),
	(86, 'Life is a Highway Route 66 Road Sign Word Art Mens Long Sleeve T-Shirt', '\n\nRoute 66 shield created out of the words Life Is A Highway. Filled with bumps, turns, accidents, slowdowns and sometimes easy cruising there is no doubt Life is a Highway. All you can do is sit back and enjoy the ride the best you can! Capturing the American Spirit of adventure, there has never been a more iconic highway than Route 66. Our "Word Art" design takes the legendary Route 66 shield and recreates it out of the words Life is a Highway and hopefully captures the top down, music playing, life is short, road trip vibe.\n\n\nMATERIAL - 100% CottonPRINTED WITH PRIDE IN THE USA- All of our products are printed and shipped from Las Vegas, Nevada USA.\n\n\n\n', 2699, 'https://media.gamestop.com/i/gamestop/11134386/Life-is-a-Highway-Route-66-Road-Sign-Word-Art-Mens-Long-Sleeve-T-Shirt?$pdp2x$,https://media.gamestop.com/i/gamestop/11134386_ALT01/Life-is-a-Highway-Route-66-Road-Sign-Word-Art-Mens-Long-Sleeve-T-Shirt?$pdp2x$,', 2, 5),
	(87, 'Super Mario World - Super Nintendo', '\n\n        Mario\'s off on his biggest adventure ever, and this time he\'s brought along a friend. Yoshi the dinosaur teams up with Mario to battle Bowser, who has kidnapped Princess Toadstool once again. Guide Mario and Yoshi through nine peril-filled worlds to the final showdown in Bowser\'s castle. Use Mario\'s new powers and Yoshi\'s voracious monster-gobbling appetite as you explore 96 levels filled with dangerous new monsters and traps. Climb mountains and cross rivers, and descend into subterranean depths. Destroy the seven Koopa castles and find keys to gain entrance to hidden levels. Discover more warps and thrilling bonus worlds than ever before!\n    \n\n\n\n Pre-owned Guarantee This pre-owned product has been carefully tested, and is guaranteed to work.  If you are not completely satisfied, simply return the product within 7 days for your money back.  Product may not include original box and instruction manual.  Item pictured may not be exact item received.  \n\n\n\n\n\n', 1199, 'https://media.gamestop.com/i/gamestop/10125270/Super-Mario-World---Super-Nintendo?$pdp2x$,', 27, 39),
	(88, 'Aerial_Knight\'s Never Yield', '\n\n?Survive A futuristic Tokyo style Detroit in this 3D runner that tells the story of Wally who has uncovered the evidence that can change his city forever. Explore a game world with a dope-tastic soundtrack featuring the authentic sounds of Detroit Artist. STORY Take the role of Wally. A mysterious character that has recovered what was taken from him. Hopefully, you\'re fast enough to outrun your enemies. Expose the truth and try to uncover the mystery of what happened to them. With an average runtime of an action movie (about an hour and a half on Normal), a first run of this action-packed adventure can be enjoyed in an afternoon. Afterwards you can improve your score.\n\n\nFeatures:\n\nGAMEPLAY Aerial_Knight\'s Never Yield is a 3D side-scroller that plays much like a classic endless runner. The game has an interesting story that keeps players always in motion. Run, Jump, Slide or  ”Dash ” for acrobatic variants leading to dope combinations and avoid the challenges that await. Aerial_Knight\'s Never Yield is being built for players who love to speedrun games while being an experience that casual players will enjoy as well.\nSOUNDTRACK This Soundtrack for Aerial_Knight\'s Never Yield is being done by  ”Danime-Sama ” A Detroit artist with vocals from artists from all over the world.\nNOTE FROM THE DEV This project began as just a passion project I started on my own to create something familiar but new for this generation of gamers while highlighting aspects of a culture that is often overlooked. I really hope you enjoy the game once its released and follow my journey to create new and interesting games - Aerial_Knight A free demo for Aerial_Knight\'s Never Yield is now available! Witness an early peek of what Wally has discovered and where his journey will take him!\n\n\n\n\n', 1199, 'https://media.gamestop.com/i/gamestop/11146550/Aerial_Knights-Never-Yield?$pdp2x$,https://media.gamestop.com/i/gamestop/11146550_SCR06/Aerial_Knights-Never-Yield?$screen2x$,https://media.gamestop.com/i/gamestop/11146550_SCR05/Aerial_Knights-Never-Yield?$screen2x$,https://media.gamestop.com/i/gamestop/11146550_SCR04/Aerial_Knights-Never-Yield?$screen2x$,https://media.gamestop.com/i/gamestop/11146550_SCR03/Aerial_Knights-Never-Yield?$screen2x$,https://media.gamestop.com/i/gamestop/11146550_SCR02/Aerial_Knights-Never-Yield?$screen2x$,https://media.gamestop.com/i/gamestop/11146550_SCR01/Aerial_Knights-Never-Yield?$screen2x$,https://media.gamestop.com/i/gamestop/11146550_SCR06/Aerial_Knights-Never-Yield?$screen$,https://media.gamestop.com/i/gamestop/11146550_SCR05/Aerial_Knights-Never-Yield?$screen$,https://media.gamestop.com/i/gamestop/11146550_SCR04/Aerial_Knights-Never-Yield?$screen$,https://media.gamestop.com/i/gamestop/11146550_SCR03/Aerial_Knights-Never-Yield?$screen$,https://media.gamestop.com/i/gamestop/11146550_SCR02/Aerial_Knights-Never-Yield?$screen$,https://media.gamestop.com/i/gamestop/11146550_SCR01/Aerial_Knights-Never-Yield?$screen$', 47, 25),
	(89, 'Destroy All Humans! DNA Collector\'s Edition - Xbox One', '\n\n        The cult-classic returns! Terrorize the people of 1950s Earth in the role of the evil alien Crypto-137. Harvest their DNA and bring down the US government in the faithful remake of the legendary alien invasion action adventure. Annihilate puny humans using an assortment of alien weaponry and psychic abilities. Reduce their cities to rubble with your flying Saucer! One giant step on mankind!\n    \n\nTake one giant step on mankind in style! Put other subduers of primitive civilizations to shame with the DNA Collector\'s Edition of the cult classic alien invasion game. It puts the udder in udderly awesome!  Terrorize the people of 1950\'s Earth as the evil alien Crypto-137. Harvest DNA and bring down the US government. Annihilate puny humans using an assortment of alien weaponry and psychic abilities. Reduce their cities to rubble with your flying Saucer!\nThis unique example of human craftsmanship is brought to you by your benevolent Furon overlords.\n\nPremium Box\nOriginal Game\nCrown your display case with the 9"/23cm Crypto\'N\'Cow figurine\nRelax your trigger finger after a long day of disintegrating humans with our patented Eye-popping Anti-Stress Toy\nShow your keys who\'s boss with our stylish keychain\nMarvel at the detailed depictions of alien mayhem on six glorious lithographs\nChange Crypto\'s in-game appearance with all skins available at launch\n\n\n\n', 2999, 'https://media.gamestop.com/i/gamestop/11096616/Destroy-All-Humans-DNA-Collectors-Edition---Xbox-One?$pdp2x$,https://media.gamestop.com/i/gamestop/11096616_ALT01/Destroy-All-Humans-DNA-Collectors-Edition---Xbox-One?$pdp2x$,https://media.gamestop.com/i/gamestop/10178654_10178656_11096621_11096620_11096619_11096617_11096616_11096615_SCR10/Destroy-All-Humans-DNA-Collectors-Edition---Xbox-One?$screen2x$,https://media.gamestop.com/i/gamestop/10178654_10178656_11096621_11096620_11096619_11096617_11096616_11096615_SCR09/Destroy-All-Humans-DNA-Collectors-Edition---Xbox-One?$screen2x$,https://media.gamestop.com/i/gamestop/10178654_10178656_11096621_11096620_11096619_11096617_11096616_11096615_SCR08/Destroy-All-Humans-DNA-Collectors-Edition---Xbox-One?$screen2x$,https://media.gamestop.com/i/gamestop/10178654_10178656_11096621_11096620_11096619_11096617_11096616_11096615_SCR07/Destroy-All-Humans-DNA-Collectors-Edition---Xbox-One?$screen2x$,https://media.gamestop.com/i/gamestop/10178654_10178656_11096621_11096620_11096619_11096617_11096616_11096615_SCR06/Destroy-All-Humans-DNA-Collectors-Edition---Xbox-One?$screen2x$,https://media.gamestop.com/i/gamestop/10178654_10178656_11096621_11096620_11096619_11096617_11096616_11096615_SCR05/Destroy-All-Humans-DNA-Collectors-Edition---Xbox-One?$screen2x$,https://media.gamestop.com/i/gamestop/10178654_10178656_11096621_11096620_11096619_11096617_11096616_11096615_SCR04/Destroy-All-Humans-DNA-Collectors-Edition---Xbox-One?$screen2x$,https://media.gamestop.com/i/gamestop/10178654_10178656_11096621_11096620_11096619_11096617_11096616_11096615_SCR03/Destroy-All-Humans-DNA-Collectors-Edition---Xbox-One?$screen2x$,https://media.gamestop.com/i/gamestop/10178654_10178656_11096621_11096620_11096619_11096617_11096616_11096615_SCR02/Destroy-All-Humans-DNA-Collectors-Edition---Xbox-One?$screen2x$,https://media.gamestop.com/i/gamestop/10178654_10178656_11096621_11096620_11096619_11096617_11096616_11096615_SCR01/Destroy-All-Humans-DNA-Collectors-Edition---Xbox-One?$screen2x$,https://media.gamestop.com/i/gamestop/10178654_10178656_11096621_11096620_11096619_11096617_11096616_11096615_SCR10/Destroy-All-Humans-DNA-Collectors-Edition---Xbox-One?$screen$,https://media.gamestop.com/i/gamestop/10178654_10178656_11096621_11096620_11096619_11096617_11096616_11096615_SCR09/Destroy-All-Humans-DNA-Collectors-Edition---Xbox-One?$screen$,https://media.gamestop.com/i/gamestop/10178654_10178656_11096621_11096620_11096619_11096617_11096616_11096615_SCR08/Destroy-All-Humans-DNA-Collectors-Edition---Xbox-One?$screen$,https://media.gamestop.com/i/gamestop/10178654_10178656_11096621_11096620_11096619_11096617_11096616_11096615_SCR07/Destroy-All-Humans-DNA-Collectors-Edition---Xbox-One?$screen$,https://media.gamestop.com/i/gamestop/10178654_10178656_11096621_11096620_11096619_11096617_11096616_11096615_SCR06/Destroy-All-Humans-DNA-Collectors-Edition---Xbox-One?$screen$,https://media.gamestop.com/i/gamestop/10178654_10178656_11096621_11096620_11096619_11096617_11096616_11096615_SCR05/Destroy-All-Humans-DNA-Collectors-Edition---Xbox-One?$screen$,https://media.gamestop.com/i/gamestop/10178654_10178656_11096621_11096620_11096619_11096617_11096616_11096615_SCR04/Destroy-All-Humans-DNA-Collectors-Edition---Xbox-One?$screen$,https://media.gamestop.com/i/gamestop/10178654_10178656_11096621_11096620_11096619_11096617_11096616_11096615_SCR03/Destroy-All-Humans-DNA-Collectors-Edition---Xbox-One?$screen$,https://media.gamestop.com/i/gamestop/10178654_10178656_11096621_11096620_11096619_11096617_11096616_11096615_SCR02/Destroy-All-Humans-DNA-Collectors-Edition---Xbox-One?$screen$,https://media.gamestop.com/i/gamestop/10178654_10178656_11096621_11096620_11096619_11096617_11096616_11096615_SCR01/Destroy-All-Humans-DNA-Collectors-Edition---Xbox-One?$screen$', 15, 15),
	(90, 'Marvel Ironman Mask Mens T-Shirt', '\n\n        Lose yourself in the pages of a comic book or the movie adventure of a lifetime with your favorite Marvel superheroes! Whether you want to swing through the city with Spider-Man, smash some walls with the Hulk, or sail through the air with Iron Man, you\'ll need to be wearing the best Marvel designs to do it! It\'s time to get marvel-ous in awesome Marvel apparel!\n    \n\nPrinted in the U.S.A.Machine WashablePrinted with Water-Based InksFifth Sun\n\n\n\n', 1998, 'https://media.gamestop.com/i/gamestop/11141670/Marvel-Ironman-Mask-Mens-T-Shirt?$pdp2x$,', 5, 5),
	(91, 'Skinit NFL Cleveland Browns Skin Bundle for PlayStation 5', '\n\n        The NFL Cleveland Browns PS5 Bundle Skin is made from a 3M durable auto-grade vinyl for an ultimate lightweight PS5 Bundle decal protection without the bulk. Every Skinit Cleveland Browns skin is officially licensed by NFL for an authentic brand design. The Cleveland Browns Cleveland Browns Sony PS5 Bundle decal skin is engineered to feature vibrant photo quality designs and to perfectly fit your PS5 Bundle The Cleveland Browns Cleveland Browns skin can be easily applied and removed from your PS5 Bundle with no residue, no mess and no fuss due to 3M adhesive backing. This makes it even easier for you to mix up your PS5 Bundle style as much as you want to keep your device feeling new. All Skinit made decal skins are cut and crafted with everyday PS5 Bundle uses in mind so that each Cleveland Browns skin offers a premium feel with a thin functional protection. Shop all officially licensed NFL Cleveland Browns Sony PS5 Bundle skins made by Skinit and make it yours today!\n    \n\nUltra-Thin, Lightweight PS5 Bundle Vinyl Decal ProtectionOffically Licensed NFL DesignIndustry Leading Vivid Color Vinyl Print TechnologyScratch - Resistant. Built To Last Everday PS5 Bundle Use3M Adhesive Backing - Easy On, Easy Off & Residue-Free\n\n\n\n', 3999, 'https://media.gamestop.com/i/gamestop/11133195/Skinit-NFL-Cleveland-Browns-Skin-Bundle-for-PlayStation-5?$pdp2x$,https://media.gamestop.com/i/gamestop/11133195_ALT01/Skinit-NFL-Cleveland-Browns-Skin-Bundle-for-PlayStation-5?$pdp2x$,https://media.gamestop.com/i/gamestop/11133195_ALT02/Skinit-NFL-Cleveland-Browns-Skin-Bundle-for-PlayStation-5?$pdp2x$,https://media.gamestop.com/i/gamestop/11133195_ALT03/Skinit-NFL-Cleveland-Browns-Skin-Bundle-for-PlayStation-5?$pdp2x$,', 8, 8),
	(92, 'One Small Step for Man Quote Astronaut Word Art  Drawstring Backpack', '\n\nPage Title Created using the quote "That\'s one small step for a man, a giant leap for mankind," the names of all those that walked on the moon and the dates and names of all moon missions. Created using the quote "That\'s one small step for a man, a giant leap for mankind," the names of all those that walked on the moon and the dates and names of all moon missions.\n\nOne of the greatest moments of all time was met with one of the greatest quotes of all time. Humanity has always been fascinated with space exploration and the moment we finally set foot on the Moon, the desire to explore deeper grew stronger.\n\nThis salute to NASA and Space Exploration creates an astronaut out of the iconic "That\'s one small step for a man, a giant leap for mankind" quote. The moon background lists names and dates of every man and mission to the Moon.\n\n \n\n\nMATERIAL - 100% CottonFEATURES - 14" W x 18" H, Matching drawcord  PRINTED WITH PRIDE IN THE USA- All of our products are printed and shipped from Las Vegas, Nevada USA.\n\n\n\n', 1399, 'https://media.gamestop.com/i/gamestop/11142977/One-Small-Step-for-Man-Quote-Astronaut-Word-Art--Drawstring-Backpack?$pdp2x$,https://media.gamestop.com/i/gamestop/11142977_ALT01/One-Small-Step-for-Man-Quote-Astronaut-Word-Art--Drawstring-Backpack?$pdp2x$,', 2, 18),
	(93, 'Dia De Los Muertos Sugar Skull Word Art  Drawstring Backpack', '\n\nPage Title Created out of the words Dia De Los Muertos Día De Los Muertos (Day of The Dead) is a Mexican holiday celebrated throughout Mexico. The holiday involves family and friends gathering to pray for and remember friends and family members who have died, and helping support their spiritual journey. In Mexican culture, death is viewed as a natural part of the human cycle. Mexicans view it not as a day of sadness but as a day of celebration because their loved ones awake and celebrate with them. There are so many symbols and unique artwork that is associated with the day including Calaveras (sugar skulls). These skulls are made out of sugar and decorated by artists with colors and designs in honor of the dead. We created our sugar skull out of the name of the day - Día De Los Muertos.  \n\n\nMATERIAL - 100% CottonFEATURES - 14" W x 18" H, Matching drawcord  PRINTED WITH PRIDE IN THE USA- All of our products are printed and shipped from Las Vegas, Nevada USA.\n\n\n\n', 1399, 'https://media.gamestop.com/i/gamestop/11143120/Dia-De-Los-Muertos-Sugar-Skull-Word-Art--Drawstring-Backpack?$pdp2x$,https://media.gamestop.com/i/gamestop/11143120_ALT01/Dia-De-Los-Muertos-Sugar-Skull-Word-Art--Drawstring-Backpack?$pdp2x$,', 2, 18),
	(94, 'Everything is Bigger in Texas Word Art Mens Premium Blend T-Shirt', '\n\nCreated out of the words Everything is Bigger in Texas Everything is Bigger in Texas is one of the Great Motto\'s of The Great State of Texas. There is little doubt as to how true this motto really is. From the actual size of the state to the Economy, to the food, to the people, to the personalities to just about everything you come across. But it is clear Texans Love and Passion for their Great State is truly the biggest thing you will find in Texas. \n\n\nMATERIAL - 35% Cotton/65% PolyesterPRINTED WITH PRIDE IN THE USA - All of our products are printed and shipped from Las Vegas, Nevada USA.\n\n\n\n', 2699, 'https://media.gamestop.com/i/gamestop/11139503_burgundy/Everything-is-Bigger-in-Texas-Word-Art-Mens-Premium-Blend-T-Shirt-burgundy?$pdp2x$,', 2, 5),
	(95, 'Hoberman Mini Sphere - Starbright', '\n\n        Light-up the night with this combination of geometry, engineering and beauty! 8 bright LED lights activate when the sphere is expanded and shut off automatically. Pull on any of the sphere\'s hubs and watch as it magically lights and unfolds from 5.5" to 12"!\n    \n\n\n\nWelcome to the world of award winning toys created by the mind and eye of Chuck Hoberman. These are toys you can throw, bounce, kick, spin, roll or suspend from the ceiling. Some you can also wear or even climb into - if you\'re small enough. \nThese amazing toys are tools for teaching and objects of art that are both educational and fun. Hoberman uses technology and unique designs to inspire children to be creative and inventive.\nIncludes 8 LED Lights with AG3 replaceable batteries\nFor Ages 4-104\n\n\n\n\n\n', 2249, 'https://media.gamestop.com/i/gamestop/11156507/Hoberman-Mini-Sphere---Starbright?$pdp2x$,', 48, 9),
	(96, 'Star Wars Battlefront Season Pass', '\n\n        Online Multiplayer Only.\n\nExpand your galaxy with the STAR WARS? Battlefront? Season Pass. Get four upcoming expansion packs filled with new content that will take you to new locations across a galaxy far, far away. Act now to secure two-week early access to each expansion pack and an exclusive "Shoot First" emote. Be sure to visit http://StarWarsBattlefront.com/SeasonPass often for the release date and additional details about each expansion pack.\n\nSave money on content for this game by purchasing the Season Pass. Content can be downloaded from the PlayStation?Store or in-game once it is released.\n    \n\n\nNetwork Players 2-40 - Full game requires PlayStation?Plus membership to access online multiplayer\n25GB minimum save size\nDUALSHOCK?4 Vibration Function\nRemote Play Supported\nHD Video Output 720p,1080p\n\n\n\n\n', 4999, 'https://media.gamestop.com/i/gamestop/11098263/Star-Wars-Battlefront-Season-Pass?$pdp2x$,', 14, 21),
	(97, 'Looney Tunes Identity Skin Bundle for Nintendo Switch', '\n\n        The Looney Tunes Nintendo Switch Bundle Skin is made from a 3M durable auto-grade vinyl for an ultimate lightweight Nintendo Switch Bundle decal protection without the bulk. Every Skinit Looney Tunes skin is officially licensed by Warner Bros for an authentic brand design. The Looney Tunes Looney Tunes Identity Pattern Nintendo Nintendo Switch Bundle decal skin is engineered to feature vibrant photo quality designs and to perfectly fit your Nintendo Switch Bundle The Looney Tunes Looney Tunes Identity Pattern skin can be easily applied and removed from your Nintendo Switch Bundle with no residue, no mess and no fuss due to 3M adhesive backing. This makes it even easier for you to mix up your Nintendo Switch Bundle style as much as you want to keep your device feeling new. All Skinit made decal skins are cut and crafted with everyday Nintendo Switch Bundle uses in mind so that each Looney Tunes skin offers a premium feel with a thin functional protection. Shop all officially licensed Looney Tunes Nintendo Nintendo Switch Bundle skins made by Skinit and make it yours today!\n    \n\nUltra-Thin, Lightweight Nintendo Switch Bundle Vinyl Decal ProtectionOffically Licensed Warner Bros DesignIndustry Leading Vivid Color Vinyl Print TechnologyScratch - Resistant. Built To Last Everday Nintendo Switch Bundle Use3M Adhesive Backing - Easy On, Easy Off & Residue-Free\n\n\n\n', 3499, 'https://media.gamestop.com/i/gamestop/11129820/Looney-Tunes-Identity-Skin-Bundle-for-Nintendo-Switch?$pdp2x$,https://media.gamestop.com/i/gamestop/11129820_ALT01/Looney-Tunes-Identity-Skin-Bundle-for-Nintendo-Switch?$pdp2x$,https://media.gamestop.com/i/gamestop/11129820_ALT02/Looney-Tunes-Identity-Skin-Bundle-for-Nintendo-Switch?$pdp2x$,https://media.gamestop.com/i/gamestop/11129820_ALT03/Looney-Tunes-Identity-Skin-Bundle-for-Nintendo-Switch?$pdp2x$,', 8, 25),
	(98, 'Madden NFL 22  - Xbox One', '\n\n        GameStop puts your skills to the test with Madden 22 on Xbox One! Take down the competition, hone your skills, and build your fantasy roster with Madden 22 Face of the Franchise, The Yard, and Ultimate Team in this highly-anticipated NFL football video game.\n    \n\nXBOX ONE game playable on XBOX SERIES X. XBOX SERIES X features and content not available on this product\nMadden NFL 22 is where gameday happens.\nAll-new features in Franchise include staff management, an enhanced scenario engine, and weekly strategy. Share avatar progress and player class between Face of The Franchise and The Yard with unified progression. And for the first time ever in Ultimate Team, adjust Superstar X-Factors at halftime.\nFranchise\n\nStaff management & talent trees\nEnhanced scenario engine\nWeekly strategy\n\nUnified Progression\n\nAvatar progress shared b/w Face of The Franchise & The Yard\nNew player classes\nEarn rep via gameplay, level up\n\nUltimate Team\n\nAdjust Superstar X-Factors at halftime\nEasily manage team chemistries\n\n\nKEY FEATURES\nFRANCHISE\nWin the Super Bowl and build an NFL Dynasty as a player, coach or owner.\nAn expansive new set of features across the redeveloped Franchise Mode puts you in charge of literally everything. (Yes, that includes winning Super Bowls.) Hire and manage your coaching staff and dish out staff points to upgrade your coaching crew\'s specialized talent trees. Regulate your team\'s practice reps, counter your opponent\'s strengths, and integrate your strategies into play-calling. So when gameday happens you\'re ready for anything. Oh, and forget about last season. An enhanced scenario engine will ensure that this Franchise season, and every one after it is going to be different. Got all that? Good. Now go win championships.\nFACE OF THE FRANCHISE\nCreate your avatar and play your rookie season the way you want as a QB, WR, RB or LB. Want more customization? No problem. A new class system and player physiques let you customize ratings, skills, attributes and body type. Earn rep via gameplay and level up your avatar at each class until you max out. Go earn the No. 1 overall pick and set the tone for your career. Once the stage is set for your rookie season, you\'ll face personalized and unexpected challenges at every turn. You\'re not in this alone, either. Those closest to you like your agent, trainer, and coordinators will offer advice and rise with you as you find success. And with new unified progression, your avatar and all your progress, rewards, and gear are shared between Face of the Franchise and The Yard. So you can stay looking fresh and keep winning.\nTHE YARD\nFast to the fun, social football gameplay with NFL superstars set in locations around the globe featuring larger than life presentation, characters and teams.\nThis is The Yard, reimagined in a big way for Madden NFL 22. Become the world\'s greatest as you play through a redesigned campaign featuring stunning locations around the globe. Check out the new rotating live events hub and call your props to earn rewards in the all-new ranked mode. Do it all in style with the hottest gear in the game. All your progress is fully integrated with the updated avatar and unified progression system.\nSUPERSTAR KO\nSquad up and take down the competition in Madden\'s fastest co-op eliminator mode featuring five-minute games, unique stadium and commentary, dynamic rules and icons of football culture.\nSuperstar KO mode introduces NFL teams and rosters for the first time in Madden NFL 22. Play fast games in this co-op eliminator mode featuring dynamic rules, unique stadiums, and icons of football culture.\nMADDEN ULTIMATE TEAM\nPull up for a brand-new season of fresh and fun Ultimate Team content and competitive team building. Earn MUT items via Ultimate Team Challenges and finesse your depth chart via strategic decisions. Flex your fantasy roster comprised of current NFL superstars, Hall of Fame legends, and more. For the first time ever, make halftime adjustments to Superstar X-Factors to counter your opponent\'s strategies during Ultimate Team matchups.\nExhibition\nCompete in head-to-head online and offline games (single and multiplayer) or single player offline against the CPU. Customize your game settings including time of quarters, rules, stadiums, and uniforms.\n\n\n\n\n', 3479, 'https://media.gamestop.com/i/gamestop/11116262/Madden-NFL-22----Xbox-One?$pdp2x$,https://media.gamestop.com/i/gamestop/11149275_11149277_11149394_11116262_SCR05/Madden-NFL-22----Xbox-One?$screen2x$,https://media.gamestop.com/i/gamestop/11149275_11149277_11149394_11116262_SCR04/Madden-NFL-22----Xbox-One?$screen2x$,https://media.gamestop.com/i/gamestop/11149275_11149277_11149394_11116262_SCR03/Madden-NFL-22----Xbox-One?$screen2x$,https://media.gamestop.com/i/gamestop/11149275_11149277_11149394_11116262_SCR02/Madden-NFL-22----Xbox-One?$screen2x$,https://media.gamestop.com/i/gamestop/11149275_11149277_11149394_11116262_SCR01/Madden-NFL-22----Xbox-One?$screen2x$,https://media.gamestop.com/i/gamestop/11149275_11149277_11116262_SCR09/Madden-NFL-22----Xbox-One?$screen2x$,https://media.gamestop.com/i/gamestop/11149275_11149277_11116262_SCR08/Madden-NFL-22----Xbox-One?$screen2x$,https://media.gamestop.com/i/gamestop/11149275_11149277_11116262_SCR07/Madden-NFL-22----Xbox-One?$screen2x$,https://media.gamestop.com/i/gamestop/11149275_11149277_11116262_SCR06/Madden-NFL-22----Xbox-One?$screen2x$,https://media.gamestop.com/i/gamestop/11149275_11149277_11149394_11116262_SCR05/Madden-NFL-22----Xbox-One?$screen$,https://media.gamestop.com/i/gamestop/11149275_11149277_11149394_11116262_SCR04/Madden-NFL-22----Xbox-One?$screen$,https://media.gamestop.com/i/gamestop/11149275_11149277_11149394_11116262_SCR03/Madden-NFL-22----Xbox-One?$screen$,https://media.gamestop.com/i/gamestop/11149275_11149277_11149394_11116262_SCR02/Madden-NFL-22----Xbox-One?$screen$,https://media.gamestop.com/i/gamestop/11149275_11149277_11149394_11116262_SCR01/Madden-NFL-22----Xbox-One?$screen$,https://media.gamestop.com/i/gamestop/11149275_11149277_11116262_SCR09/Madden-NFL-22----Xbox-One?$screen$,https://media.gamestop.com/i/gamestop/11149275_11149277_11116262_SCR08/Madden-NFL-22----Xbox-One?$screen$,https://media.gamestop.com/i/gamestop/11149275_11149277_11116262_SCR07/Madden-NFL-22----Xbox-One?$screen$,https://media.gamestop.com/i/gamestop/11149275_11149277_11116262_SCR06/Madden-NFL-22----Xbox-One?$screen$', 14, 15),
	(99, 'Blurryface by Twenty One Pilots Vinyl', '\n\n        Blurryface is the much anticipated second studio album from twenty one pilots. On the follow up to their highly successful debut Vessel, the band worked with famed producers Mike Elizondo, Mike Crossey, Tim Anderson and Ricky Reed to craft a genre bending collection of dynamic and diverse songs.\n    \n\n\n', 2699, 'https://media.gamestop.com/i/gamestop/11120281/Blurryface-by-Twenty-One-Pilots-Vinyl?$pdp2x$,', 49, 40),
	(100, 'Rush Charge Max USB-C Power Bank Rose Gold', '\n\n        The world\'s most convenient, lightweight, and compact charger for your device. The cable-free design allows you to plug the Rush Charge directly into any compatible device and take it with you anywhere, anytime uninterrupted. Truly a charger that’s made to move with you. No more messy and tangled cables or heavy power banks; Rush Charge fits comfortably in your pocket. Comes pre-charged and ready to go, so you can stay powered up right from the jump! Perfect for travel, emergency power, and everyday use. Recharge using your existing phone cable; alone or simultaneously with your device.\n    \n\nFEATURES:\n\nPatented technology?\nPowerful 3,600 mAh?\nRechargeable lithium-ion battery\nRC36 is up to 25+hours of extended use.\nPass-through technology, you can charge your rush charge and your phone at the same time.\nThe RC36 charger works on all cell phones and gadgets, just choose the built-in connector you want: Lightning, USB-C, OR micro-USB.?\nA 2.1A fast charging output.\nDimensions: measures approximately 2.75"W x 2.25"L x 0.5"D\nWeight: 2.75 oz\nLED meter for battery life ? ? ? ? ? ? ? ? ? ? ? ? ? ? ? ? ? ? ?\nRush Charge is a one-hand operation, eliminating any and all downtime associated with any other charging solution.\n\n\n\n\n', 4000, 'https://media.gamestop.com/i/gamestop/11142608/Rush-Charge-Max-USB-C-Power-Bank-Rose-Gold?$pdp2x$,https://media.gamestop.com/i/gamestop/11142608_ALT01/Rush-Charge-Max-USB-C-Power-Bank-Rose-Gold?$pdp2x$,https://media.gamestop.com/i/gamestop/11142608_ALT02/Rush-Charge-Max-USB-C-Power-Bank-Rose-Gold?$pdp2x$,', 50, 41),
	(101, 'Buffalo Games Eugene\'s Gas and Grocery 500-pc Jigsaw Puzzle', '\n\n        This 500-piece jigsaw puzzle titled Eugene\'s Gas & Grocery is from artist Geno Peoples and is part of the Americana Collection by Buffalo Games. Under the light of a full moon Eugene People\'s Gas and Grocery is waiting for the next customer to arrive. Deer and roosters are hanging out in the puddle covered roadway as ducks swim through the moon\'s reflection on the lake. Enjoy piecing together this puzzle as you discover everything available to purchase at the store.\n\nEvery Buffalo Games jigsaw puzzle is manufactured in the U.S.A. from recycled puzzle board. A precision cutting technique guarantees that every piece will fit soundly with the company\'s signature Perfect Snap?. A bonus puzzle poster is also included so that you have a handy reference of what the completed puzzle should look like while you put yours together.\n    \n\n\n', 1099, 'https://media.gamestop.com/i/gamestop/11160029/Buffalo-Games-Eugenes-Gas-and-Grocery-500-pc-Jigsaw-Puzzle?$pdp2x$,https://media.gamestop.com/i/gamestop/11160029_ALT01/Buffalo-Games-Eugenes-Gas-and-Grocery-500-pc-Jigsaw-Puzzle?$pdp2x$,https://media.gamestop.com/i/gamestop/11160029_ALT02/Buffalo-Games-Eugenes-Gas-and-Grocery-500-pc-Jigsaw-Puzzle?$pdp2x$,', 23, 23),
	(102, 'Star Wars The Mandalorian This Is The Way Circle Mens T-Shirt', '\n\n        Take the reins as a Mandalorian Bounty Hunter exploring the galaxy in this awesome Star Wars tee that celebrates the Star Wars-inspired television series, The Mandalorian with favorites like Grogu, Mando, Greef Karga and more.\n    \n\nPrinted in the U.S.A.Machine WashablePrinted with Water-Based InksFifth Sun\n\n\n\n', 1998, 'https://media.gamestop.com/i/gamestop/11145743/Star-Wars-The-Mandalorian-This-Is-The-Way-Circle-Mens-T-Shirt?$pdp2x$,', 5, 5),
	(103, 'Madden NFL 15', '\n\n        Madden NFL 15 transforms you into your rival\'s worst nightmare with a new breed of defense built to challenge the best offenses in the NFL.  An all-new intuitive tackling system and improved coverage logic make defense exciting and fun to play.  Learn and hone your skills in the Gauntlet, an all-new mode in Skills Trainer that will take your new abilities through the ultimate test in intense conditions and challenges.  Whether building your legacy in Connected Franchise or a dynasty in Ultimate Team, it\'s not just football, it\'s Madden Season!\n    \n\n\n\nPRESENTATION NFL game day is brought to life through improved likenesses to players and coaches, new gameplay camera angles and post player interactions that show the emotion of football. Coaches have been revamped from head to toe to match their real life counterparts. The new All-22 gameplay camera gives you a birds-eye view of the action as you survey the entire field at once. Post play, players comes to life through touchdown celebrations, sacks, tackles, and other events right in real time.GAMEPLAYRisk vs. Reward – Defenders can now make aggressive or conservative tackles in the open field, with proximity cones showing the effective range of each. Aggressive tackles can lead to big plays and fumbles, but conservative tackles are more likely to bring the ball-carrier down without giving up extra yards. The choice is yours, but so are the consequences.Redesigned Coverage Logic - Have a bigger impact in the secondary with redesigned AI, providing more intelligence to how players react to the ball carrier. Defenses are now smarter when going for a swat vs. an interception or a tackle. Man coverage has also been improved to impact how much separation receivers are able to get on cuts in their routes, resulting in improved behavior of the defender.MODESRun The Gauntlet – Skills Trainer has been expanded to teach not only gameplay skills, but strategy and football concepts as well. Learn how to read zone defenses, when to hot route a receiver, and more with nearly 50 new tutorials and drills. Once you\'ve mastered the basics, enter The Gauntlet where your skills will be put to the ultimate test through intense challenges.Connected Franchise – Interact and build your team with more control in Game Prep all-new to CFM. Want to develop your backup QB? Between matchups, spend extra time on him each week to earn training points without having to force him into the real games before he is ready. Also new in CFM is the Confidence rating system. Build your teams\' confidence through performance and front office transactions. Balance keeping player\'s confidence up, to increase abilities and build player XP.Madden Ultimate Team - Take over as team GM by collecting your favorite NFL players past and present, coaches, and playbooks to dominate rivals on the field in head to head seasons, solo challenges and more. Earn coins to buy packs through the online store, where you can trade and auction off items on the road to building the Ultimate Team. Engage with the NFL in an all new way thanks live content and service updates made throughout the NFL season and beyond , in the fastest growing mode in Madden NFL!\n\n\n\n\n\n', 6000, 'https://media.gamestop.com/i/gamestop/10113711/Madden-NFL-15?$pdp2x$,https://media.gamestop.com/i/gamestop/10113707_10113709_10113711_10113712_SCR07/Madden-NFL-15?$screen2x$,https://media.gamestop.com/i/gamestop/10113707_10113709_10113711_10113712_SCR06/Madden-NFL-15?$screen2x$,https://media.gamestop.com/i/gamestop/10113707_10113709_10113711_10113712_SCR05/Madden-NFL-15?$screen2x$,https://media.gamestop.com/i/gamestop/10113707_10113709_10113711_10113712_SCR04/Madden-NFL-15?$screen2x$,https://media.gamestop.com/i/gamestop/10113707_10113709_10113711_10113712_SCR03/Madden-NFL-15?$screen2x$,https://media.gamestop.com/i/gamestop/10113707_10113709_10113711_10113712_SCR02/Madden-NFL-15?$screen2x$,https://media.gamestop.com/i/gamestop/10113707_10113709_10113711_10113712_SCR01/Madden-NFL-15?$screen2x$,https://media.gamestop.com/i/gamestop/10113707_10113709_10113711_10113712_SCR07/Madden-NFL-15?$screen$,https://media.gamestop.com/i/gamestop/10113707_10113709_10113711_10113712_SCR06/Madden-NFL-15?$screen$,https://media.gamestop.com/i/gamestop/10113707_10113709_10113711_10113712_SCR05/Madden-NFL-15?$screen$,https://media.gamestop.com/i/gamestop/10113707_10113709_10113711_10113712_SCR04/Madden-NFL-15?$screen$,https://media.gamestop.com/i/gamestop/10113707_10113709_10113711_10113712_SCR03/Madden-NFL-15?$screen$,https://media.gamestop.com/i/gamestop/10113707_10113709_10113711_10113712_SCR02/Madden-NFL-15?$screen$,https://media.gamestop.com/i/gamestop/10113707_10113709_10113711_10113712_SCR01/Madden-NFL-15?$screen$', 51, 17),
	(104, 'ROCCAT Elo Surround Sound RGB 7.1 USB Gaming Headset Black', '\n\nPRECISION SURROUND SOUND - The ROCCAT? Elo 7.1 USB Surround Sound RGB Gaming Headset lets you pinpoint enemy locations thanks to 360° visual audio powered by precision-tuned 50mm drivers. Superior memory foam and a self-adjusting headband provide all-day comfort while the detachable TruSpeak? mic ensures clear communication. Plus, AIMO Intelligent Lighting vividly lights up your setup. AIMO INTELLIGENT LIGHTING ENGINE - The AIMO illumination ecosystem takes your setup to another level by adding organic light. It synergizes with other AIMO-compatible devices to create a vivid, state-of-the-art aesthetic without the need for extensive configuration. The Elo 7.1 USB looks even better with AIMO.\n\n\nCRYSTAL-CLEAR COMMUNICATION- TruSpeak? microphone technology ensures your voice sounds the same in the digital world as it does in the real world. Say goodbye to static and crackle with crystal-clear communication with your teammates that sounds completely natural. The unidirectional, noise-cancelling mic is also detachable for added convenience. EXCEPTIONAL 7.1 SURROUND- Precision-tuned 50mm neodymium drivers deliver exceptional 7.1 surround sound way ahead of the competition. We call it visual audio because the 360° sound characteristics let you pinpoint enemy locations for a clear competitive advantage. DYNAMIC FIT - Gamers come in all shapes and sizes but the Elo 7.1 ensures a perfect fit no matter what. A self-adjusting metal headband and rotating earcup hinges for added flexibility create a weightless fit unique to you.\n\n\n\n', 4499, 'https://media.gamestop.com/i/gamestop/11155457/ROCCAT-Elo-Surround-Sound-RGB-7.1-USB-Gaming-Headset-Black?$pdp2x$,https://media.gamestop.com/i/gamestop/11155457_ALT01/ROCCAT-Elo-Surround-Sound-RGB-7.1-USB-Gaming-Headset-Black?$pdp2x$,https://media.gamestop.com/i/gamestop/11155457_ALT02/ROCCAT-Elo-Surround-Sound-RGB-7.1-USB-Gaming-Headset-Black?$pdp2x$,https://media.gamestop.com/i/gamestop/11155457_ALT03/ROCCAT-Elo-Surround-Sound-RGB-7.1-USB-Gaming-Headset-Black?$pdp2x$,https://media.gamestop.com/i/gamestop/11155457_ALT04/ROCCAT-Elo-Surround-Sound-RGB-7.1-USB-Gaming-Headset-Black?$pdp2x$,https://media.gamestop.com/i/gamestop/11155457_ALT05/ROCCAT-Elo-Surround-Sound-RGB-7.1-USB-Gaming-Headset-Black?$pdp2x$,https://media.gamestop.com/i/gamestop/11155457_ALT06/ROCCAT-Elo-Surround-Sound-RGB-7.1-USB-Gaming-Headset-Black?$pdp2x$,https://media.gamestop.com/i/gamestop/11155457_ALT07/ROCCAT-Elo-Surround-Sound-RGB-7.1-USB-Gaming-Headset-Black?$pdp2x$,', 52, 42),
	(105, 'Cardinal Legacy Deluxe Double-6 Dominoes Board Game', '\n\n        The entire family can enjoy one of the world’s most popular games with the Cardinal Legacy Deluxe Dominoes set. Players place their Dominoes so that the numbers match up as they race to get rid of all of their pieces. The Cardinal Legacy Deluxe Classic Games product line features ten timeless classics crafted from beautiful mahogany. Legacy Deluxe games are not only sure to be loved by people of all ages and provide endless entertainment, but each one is also a great display piece and a welcomed complement to any game room.\n    \n\nFeatures:\n\nA beautiful mahogany finish makes this game a perfect display piece\nClassic tile-matching game for the entire family\nEasy to learn, challenging to play\n\nSpecifications:\n\nAges 8 and up\nFor 1-4 Players\n\n\n\n\n', 2499, 'https://media.gamestop.com/i/gamestop/11155825/Cardinal-Legacy-Deluxe-Double-6-Dominoes-Board-Game?$pdp2x$,https://media.gamestop.com/i/gamestop/11155825_ALT01/Cardinal-Legacy-Deluxe-Double-6-Dominoes-Board-Game?$pdp2x$,https://media.gamestop.com/i/gamestop/11155825_ALT02/Cardinal-Legacy-Deluxe-Double-6-Dominoes-Board-Game?$pdp2x$,https://media.gamestop.com/i/gamestop/11155825_ALT03/Cardinal-Legacy-Deluxe-Double-6-Dominoes-Board-Game?$pdp2x$,', 42, 11),
	(106, 'Hasbro Star Wars: The Black Series Deluxe Episode I: The Phantom Menace Jar Jar Binks 6-in Action Figure', '\n\nAs an outcast, Jar Jar spends much of his time in the Naboo swampland. It\'s there that the hapless Gungan encounters a pair of Jedi as they elude enemy forces.\nKids and collectors alike can imagine the biggest battles and missions in the Star Wars saga with figures from Star Wars The Black Series! With exquisite features and decoration, this series embodies the quality and realism that Star Wars devotees love. Star Wars The Black Series includes figures, vehicles, and roleplay items from the 40-plus-year legacy of the Star Wars Galaxy, including comics, movies, and animated series. (Additional products each sold separately. Subject to availability.)\nThe 6-inch-scale The Black Series Jar Jar Binks deluxe figure is carefully detailed to look like the character from Star Wars: The Phantom Menace, featuring premium detail and multiple points of articulation.\n\n\nFEATURES:\n\nJAR JAR BINKS: A clumsy, well-meaning Gungan outcast on Naboo, Jar Jar Binks struggled to prove his worth throughout his life\nSTAR WARS: THE PHANTOM MENACE: Fans and collectors can imagine scenes from the Star Wars Galaxy with this premium Jar Jar Binks toy, inspired by Star Wars: The Phantom Menace\nMOVIE-BASED CHARACTER-INSPIRED ACCESSORIES: This Star Wars The Black Series deluxe action figure comes with 3 Jar Jar Binks-inspired accessories that make great additions to any Star Wars collection\nPREMIUM ARTICULATION AND DETAILING: Star Wars fans and collectors can display this highly poseable, fully articulated figure, featuring premium deco, in their action figure and vehicle collection\nLOOK FOR OTHER FIGURES FROM A GALAXY FAR, FAR AWAY: Look for movie- and entertainment-inspired Star Wars The Black Series figures to build a Star Wars galaxy (Each sold separately. Subject to availability)\n \nIncludes: figure and 3 accessories.\nFigure scale: 6 inches\nAges 4 and up\nWARNING: CHOKING HAZARD -- Small parts. Not for children under 3 years.\n\n\n\n\n', 2349, 'https://media.gamestop.com/i/gamestop/11105999/Hasbro-Star-Wars-The-Black-Series-Deluxe-Episode-I-The-Phantom-Menace-Jar-Jar-Binks-6-in-Action-Figure?$pdp2x$,https://media.gamestop.com/i/gamestop/11105999_ALT01/Hasbro-Star-Wars-The-Black-Series-Deluxe-Episode-I-The-Phantom-Menace-Jar-Jar-Binks-6-in-Action-Figure?$pdp2x$,https://media.gamestop.com/i/gamestop/11105999_ALT02/Hasbro-Star-Wars-The-Black-Series-Deluxe-Episode-I-The-Phantom-Menace-Jar-Jar-Binks-6-in-Action-Figure?$pdp2x$,https://media.gamestop.com/i/gamestop/11105999_ALT03/Hasbro-Star-Wars-The-Black-Series-Deluxe-Episode-I-The-Phantom-Menace-Jar-Jar-Binks-6-in-Action-Figure?$pdp2x$,https://media.gamestop.com/i/gamestop/11105999_ALT04/Hasbro-Star-Wars-The-Black-Series-Deluxe-Episode-I-The-Phantom-Menace-Jar-Jar-Binks-6-in-Action-Figure?$pdp2x$,https://media.gamestop.com/i/gamestop/11105999_ALT05/Hasbro-Star-Wars-The-Black-Series-Deluxe-Episode-I-The-Phantom-Menace-Jar-Jar-Binks-6-in-Action-Figure?$pdp2x$,https://media.gamestop.com/i/gamestop/11105999_ALT06/Hasbro-Star-Wars-The-Black-Series-Deluxe-Episode-I-The-Phantom-Menace-Jar-Jar-Binks-6-in-Action-Figure?$pdp2x$,https://media.gamestop.com/i/gamestop/11105999_ALT07/Hasbro-Star-Wars-The-Black-Series-Deluxe-Episode-I-The-Phantom-Menace-Jar-Jar-Binks-6-in-Action-Figure?$pdp2x$,https://media.gamestop.com/i/gamestop/11105999_ALT08/Hasbro-Star-Wars-The-Black-Series-Deluxe-Episode-I-The-Phantom-Menace-Jar-Jar-Binks-6-in-Action-Figure?$pdp2x$,', 24, 7),
	(107, 'Marvel Classic Brick Logo Long Sleeve Mens T-Shirt', '\n\n        Lose yourself in the pages of a comic book or the movie adventure of a lifetime with your favorite Marvel superheroes! Whether you want to swing through the city with Spider-Man, smash some walls with the Hulk, or sail through the air with Iron Man, you\'ll need to be wearing the best Marvel designs to do it! It\'s time to get marvel-ous in awesome Marvel apparel!\n    \n\nPrinted in the U.S.A.Machine WashablePrinted with Water-Based InksFifth Sun\n\n\n\n', 2499, 'https://media.gamestop.com/i/gamestop/11141736/Marvel-Classic-Brick-Logo-Long-Sleeve-Mens-T-Shirt?$pdp2x$,', 5, 5),
	(108, 'Paladone Batman 750-pc Jigsaw Puzzle', '\n\n        The Batman 750-piece Jigsaw Puzzle makes the perfect present for any fan of DC Comics, Batman, or superheroes in general. Plus collectors of official DC Comics merchandise will welcome this unique Jigsaw Puzzle into their collection of memorabilia. Once completed, the bat-shaped jigsaw puzzle will display a detailed image created from a montage of comic book pages. The puzzle is supplied in a collectible, full-color printed rectangular storage tin that is decorated with the cover artwork from Batman Volume 1, No1, Spring Issue comic published in 1940. The artwork was created by Bob Kane and Jerry Robinson. Originally published quarterly, this first volume introduced new characters into Batman\'s pantheon, most notably those of Catwoman and Batman\'s eventual nemesis, the Joker.\n    \n\nBat-shaped Puzzle - Charge into the DC Universe and embark on the adventure of completing this 750-piece bat-shaped jigsaw puzzle with a detailed image created from a montage of comic book pages.\nRelax and Puzzle - No superpowers are required to put this puzzle together. You can enhance your free time and reduce stress whilst you concentrate on sorting through the pieces and staring at the image for extended periods. Or gather your friends and family around the table to help and enjoy spending some quality time with them.\nGreat Collectable Gift - Supplied in a collectible, full-color printed rectangular storage tin decorated with the cover artwork of the Batman Volume 1, No1 Spring Issue comic published in 1940. This jigsaw puzzle makes the perfect present for any fan of DC Comics, Batman, or superheroes. Plus collectors of official DC Comics merchandise will welcome this unique jigsaw puzzle into their collection of memorabilia.\nOfficial Merchandise -  Perfect gift for all Batman fans, superb quality, this Batman 750-piece Shaped Jigsaw Puzzle is officially licensed and approved by Warner Bros. Entertainment UK Limited.\n\n\n\n\n\nIncludes 750 piece jigsaw puzzle and storage tin\nBat-Insignia shaped puzzle\nFor ages 8 and up\n\n\n\n\n\n\n', 1499, 'https://media.gamestop.com/i/gamestop/11172235/Paladone-Batman-750-pc-Jigsaw-Puzzle?$pdp2x$,https://media.gamestop.com/i/gamestop/11172235_ALT01/Paladone-Batman-750-pc-Jigsaw-Puzzle?$pdp2x$,', 53, 23),
	(109, 'Skinit The Avengers Baby Loki Console Skin for Xbox One', '\n\n        The Marvel Avengers Xbox One Console Skin is made from a 3M durable auto-grade vinyl for an ultimate lightweight Xbox One Console decal protection without the bulk. Every Skinit Avengers skin is officially licensed by Marvel/Disney for an authentic brand design. The Avengers Baby Loki Microsoft Xbox One Console decal skin is engineered to feature vibrant photo quality designs and to perfectly fit your Xbox One Console The Avengers Baby Loki skin can be easily applied and removed from your Xbox One Console with no residue, no mess and no fuss due to 3M adhesive backing. This makes it even easier for you to mix up your Xbox One Console style as much as you want to keep your device feeling new. All Skinit made decal skins are cut and crafted with everyday Xbox One Console uses in mind so that each Avengers skin offers a premium feel with a thin functional protection. Shop all officially licensed Marvel Avengers Microsoft Xbox One Console skins made by Skinit and make it yours today!\n    \n\nUltra-Thin, Lightweight Xbox One Console Vinyl Decal ProtectionOffically Licensed Marvel/Disney DesignIndustry Leading Vivid Color Vinyl Print TechnologyScratch - Resistant. Built To Last Everday Xbox One Console Use3M Adhesive Backing - Easy On, Easy Off & Residue-Free\n\n\n\n', 2499, 'https://media.gamestop.com/i/gamestop/11128671/Skinit-The-Avengers-Baby-Loki-Console-Skin-for-Xbox-One?$pdp2x$,', 8, 15),
	(110, 'Spintires', '\n\n        The award-winning, million-seller indie hit, Spintires?: The Original Game. \n\nThe ultimate off-road challenge, climb aboard incredibly detailed soviet inspired vehicles and venture across the rough and tough terrain motherland Russia has to offer. \n\nFeaturing a highly unique physics-based deformable terrain and water interaction technology. Spintires boasts a quirky new experience every time you play.\n    \n\nWinch yourself, or friends out of a mudslinging exercise and explore the depths of Russia, finding garages and fuel stations to keep your vehicle alive - carry logs and bring them to the objectives without becoming lost or stuck in the mud. Unlock and use more capable vehicles, or install one of the vast amounts of attachments available to help you along the way. \nOffering a truly immersive driving experience, watch in amazement as your vehicle becomes entangled in trees, bogged down in mud or swept away by river currents. \nA physics sandbox that is vastly moddable with a huge modding community expanding the horizons every day - try some of the mods available on the Steam workshop or have a go at creating your own with the included Spintires Editor. \n\n\nDeformable terrain with detailed mud particle effects. \nInteractive water with physics-based water animations. \n10 highly detailed soviet inspired vehicles and trucks with various attachments. \n7 maps based on the beautiful harsh lands of Russia with physics-based trees, bushes and rocks. \nA dynamic weather system, featuring rain and wind.\nPhysics vehicle simulation with deformable tires, wobbling body parts and detailed exhaust smoke. \nHighly detailed audio system, with true to life vehicle sounds. \nDay and night cycle. \nAbility to use winches and cranes. \nManual and automatic gears control. \nGamepad and steering wheel support.\n4 player multiplayer (peer to peer).\nModdable with Steam Workshop, create your own vehicles or maps. \nSandbox\nSpintires editor.\n\n\n\n\n', 999, 'https://media.gamestop.com/i/gamestop/10117290/Spintires?$pdp2x$,https://media.gamestop.com/i/gamestop/10117290_SCR08/Spintires?$screen2x$,https://media.gamestop.com/i/gamestop/10117290_SCR07/Spintires?$screen2x$,https://media.gamestop.com/i/gamestop/10117290_SCR06/Spintires?$screen2x$,https://media.gamestop.com/i/gamestop/10117290_SCR05/Spintires?$screen2x$,https://media.gamestop.com/i/gamestop/10117290_SCR04/Spintires?$screen2x$,https://media.gamestop.com/i/gamestop/10117290_SCR03/Spintires?$screen2x$,https://media.gamestop.com/i/gamestop/10117290_SCR02/Spintires?$screen2x$,https://media.gamestop.com/i/gamestop/10117290_SCR01/Spintires?$screen2x$,https://media.gamestop.com/i/gamestop/10117290_SCR08/Spintires?$screen$,https://media.gamestop.com/i/gamestop/10117290_SCR07/Spintires?$screen$,https://media.gamestop.com/i/gamestop/10117290_SCR06/Spintires?$screen$,https://media.gamestop.com/i/gamestop/10117290_SCR05/Spintires?$screen$,https://media.gamestop.com/i/gamestop/10117290_SCR04/Spintires?$screen$,https://media.gamestop.com/i/gamestop/10117290_SCR03/Spintires?$screen$,https://media.gamestop.com/i/gamestop/10117290_SCR02/Spintires?$screen$,https://media.gamestop.com/i/gamestop/10117290_SCR01/Spintires?$screen$', 54, 21),
	(111, 'Wolverine - Nintendo', '\n\n        Stranded on a remote, deserted island by his arch enemies, Sabretooth and Magneto, Marvel Comics\' Wolverine must fight the battle of his life. Super-human powers, including regenerative healing abilities, an indestructible Adamantium skeleton and retractable razor sharp claws that slice through anything, make Wolverine a terrifying adversary... but has he finally met his match? Lead Wolverine in this world-class struggle against Sabretooth and the evil genius, Magneto. In the heat of battle, fellow X-Men Havok, Jubilee and Psylocke come to your side helping even out the score. To survive, you must complete 9 missions, including The Battle for the Skies, Trial by Fire, Trial by Water, The Dungeon of Traps, and The Land of Nightmares, until, at long last, you face your ultimate foes. Prepare for the most exciting and unpredictable X-Men adventure of them all!\n    \n\n\n\n Pre-owned Guarantee This pre-owned product has been carefully tested, and is guaranteed to work.  If you are not completely satisfied, simply return the product within 7 days for your money back.  Product may not include original box and instruction manual.  Item pictured may not be exact item received.  \n\n\n\n\n\n', 1499, 'https://media.gamestop.com/i/gamestop/10125950/Wolverine---Nintendo?$pdp2x$,', 55, 43),
	(112, 'Banpresto Stranger Things Hopper Q posket Figure', '\n\nStranger Things Q posket -Hopper-Jim Hopper is one of the main\nprotagonists of Netflix Original Series: Stranger Things. Hopper is the Chief\nof Police of Hawkins, Indiana where he lived out a carefree life. After finding\nEleven alone, he takes her in and uses his cabin to give her a safe place to\nlive in secret. He becomes Eleven’s adoptive father.\n\n\n\n\n', 2799, 'https://media.gamestop.com/i/gamestop/11146740/Banpresto-Stranger-Things-Hopper-Q-posket-Figure?$pdp2x$,', 41, 20),
	(113, 'Conan', 'None', 499, 'https://media.gamestop.com/i/gamestop/10065274/Conan?$pdp2x$,', 15, 44),
	(114, 'Super Mario Galaxy - Nintendo Wii', '\n\n        The ultimate Nintendo hero is taking the ultimate step... out into space. Join Mario as he ushers in a new era of video games, defying gravity across all the planets in the galaxy. When some creature escapes into space with Princess Peach, Mario gives chase, exploring bizarre planets all across the galaxy. Players run, jump and battle enemies as they explore the many planets. For Mario to succeed, gamers will press buttons, swing the Wii Remote and Nunchuk controllers and even use the Wii Remote to point at and drag things on-screen.\n    \n\n\n\nGame storyline:  When some creature escapes into space with Princess Peach, Mario gives chase, exploring bizarre planets all across the galaxy. Characters: Mario, Peach and enemies new and old. How to progress through the game:  Players run, jump and battle enemies as they explore all the planets in the galaxy. Since this game makes full use of all the features of the Wii Remote, players have to do all kinds of things to succeed: pressing buttons, swinging the Wii Remote and the Nunchuk, and even pointing at and dragging things with the pointer.  Special powers/weapons/moves/features: Since he\'s in space, Mario can perform mind-bending jumps unlike anything he\'s done before. He\'ll also have a wealth of new moves that are all based around tilting, pointing and shaking the Wii Remote. Shake, Tilt and Point! Mario takes advantage of all the unique aspects of the Wii Remote and Nunchuk controllers, unleashing new moves as players shake the controllers and even point at and drag items with the Remote. Redefining Platformers: Mario essentially defined the 3-D platforming genre with Super Mario 64, and this game proves once again that he is king. Players perform mind-bending, low-gravity jumps across wild alien terrain as they experience platforming for a new generation.\n\n\n\n\n\n', 3999, 'https://media.gamestop.com/i/gamestop/10005725/Super-Mario-Galaxy---Nintendo-Wii?$pdp2x$,', 27, 45),
	(115, 'NBA Utah Jazz Controller Skin for PlayStation 5', '\n\n        The NBA Utah Jazz PS5 Controller Skin is made from a 3M durable auto-grade vinyl for an ultimate lightweight PS5 Controller decal protection without the bulk. Every Skinit Utah Jazz skin is officially licensed by NBA for an authentic brand design. The Utah Jazz Utah Jazz Split Canvas Sony PS5 Controller decal skin is engineered to feature vibrant photo quality designs and to perfectly fit your PS5 Controller The Utah Jazz Utah Jazz Split Canvas skin can be easily applied and removed from your PS5 Controller with no residue, no mess and no fuss due to 3M adhesive backing. This makes it even easier for you to mix up your PS5 Controller style as much as you want to keep your device feeling new. All Skinit made decal skins are cut and crafted with everyday PS5 Controller uses in mind so that each Utah Jazz skin offers a premium feel with a thin functional protection. Shop all officially licensed NBA Utah Jazz Sony PS5 Controller skins made by Skinit and make it yours today!\n    \n\nUltra-Thin, Lightweight PS5 Controller Vinyl Decal ProtectionOffically Licensed NBA DesignIndustry Leading Vivid Color Vinyl Print TechnologyScratch - Resistant. Built To Last Everday PS5 Controller Use3M Adhesive Backing - Easy On, Easy Off & Residue-Free\n\n\n\n', 1599, 'https://media.gamestop.com/i/gamestop/11119333/NBA-Utah-Jazz-Controller-Skin-for-PlayStation-5?$pdp2x$,https://media.gamestop.com/i/gamestop/11119333_ALT01/NBA-Utah-Jazz-Controller-Skin-for-PlayStation-5?$pdp2x$,https://media.gamestop.com/i/gamestop/11119333_ALT02/NBA-Utah-Jazz-Controller-Skin-for-PlayStation-5?$pdp2x$,https://media.gamestop.com/i/gamestop/11119333_ALT03/NBA-Utah-Jazz-Controller-Skin-for-PlayStation-5?$pdp2x$,', 8, 8),
	(116, 'Nerf Fortnite Blaster SMG', '\n\nPlay Fortnite in real life with the dart-firing Nerf Fortnite SR blaster that is inspired by the one used in Fortnite, capturing the look of the one from the popular video game. The SR blaster features 4-dart hammer action so you can fire 4 darts in a row before reloading. Take aim at your target and press the trigger to unleash 1 dart. To launch another dart, pull back the hammer, and press the trigger. Use the removable scope to help you line up your shot. The Nerf Fortnite SR blaster comes with 8 Nerf Elite darts, enough to fully load the blaster, with 4 darts for backup firepower when it\'s time to reload. Official Nerf darts are made of foam and are tested and approved for performance and quality. No batteries required. Eyewear recommended (not included).\nCopyright Epic Games.\nHasbro and all related terms are trademarks of Hasbro.\nIncludes: blaster, scope, 8 darts, and instructions.\n\n\n\nDART-BLASTING FORTNITE BLASTER REPLICA: The Nerf Fortnite SR blaster is inspired by the blaster used in Fortnite, capturing the look of the one in the popular video game\nDART HAMMER ACTION BLASTING: This Nerf Fortnite blaster features hammer priming action. Load 4 darts into the blaster, pull back the hammer to prime to blaster, then press the trigger to fire 1 dart\nREMOVABLE SCOPE: Includes a scope that you can attach and remove from the blaster to help you line up your shots. Play Fortnite in real life with the Nerf Fortnite SR dart blaster!\nINCLUDES 8 NERF DARTS: Comes with 8 Official Nerf Elite darts that are tested and approved for performance and quality\nAges 8 and up\nTO AVOID EYE INJURY\nWARNING: Do not aim at eyes or face. Use of eyewear recommended for players and people within range. Use only official Nerf darts. Other darts may not meet safety standards. Do not modify darts or blaster.\nWARNING: CHOKING HAZARD – Small parts may be generated. Not for children under 3 years.\nSome assembly required. No tools needed.\n\n\n\n\n\n\n\n      Bonus\n    \n\n\nFree in game El Durrrado Back bling with purchase of officially licensed physical Fortnite products\nFree in game El Durrrado Back bling with purchase of any officially licensed physical Fortnite products this holiday. Offer valid 11/1/2021 - 1/15/2022\n*While Supplies Last. Limit one per transaction\nOnline Customers: Code will be emailed within 2 business days after your order ships.\nStore / In-Store Pickup Customers: Code will be printed on your receipt at time of pickup.\n\n\n\n\n\n\n\n\n\n\n\n \n\n\n\n \n\n', 1998, 'https://media.gamestop.com/i/gamestop/11102220/Nerf-Fortnite-Blaster-SMG?$pdp2x$,https://media.gamestop.com/i/gamestop/11102220_ALT01/Nerf-Fortnite-Blaster-SMG?$pdp2x$,https://media.gamestop.com/i/gamestop/11102220_ALT02/Nerf-Fortnite-Blaster-SMG?$pdp2x$,https://media.gamestop.com/i/gamestop/11102220_ALT03/Nerf-Fortnite-Blaster-SMG?$pdp2x$,', 24, 46),
	(117, 'Peace Fingers Word Art T-Shirt', '\n\nCreated using the words \'Give Peace A Chance\'\n\n\n\nMATERIAL - 100% Cotton\nFEATURES - Shirt has a silhouette/slim fit. We suggest ordering one size up if you are in between sizes or want a more relaxed fit\nPRINTED WITH PRIDE IN THE USA- All of our products are printed and shipped from Las Vegas, Nevada USA.\n\n\n\n\n', 1998, 'https://media.gamestop.com/i/gamestop/11114141_black/Peace-Fingers-Word-Art-T-Shirt-black?$pdp2x$,', 2, 5),
	(118, 'TheNorthwest Star Wars Classic Being Darth Vader Adult Throw Blanket with Sleeves 48x71', '\n\n        Amazingly silky-soft and cozy, the Adult Silk Touch Comfy Throw Blanket with Sleeves by TheNorthwest is the perfect lounging accessory. This throw with sleeves is the ideal choice for comfort around the home. This 48"x 71" throw features an opening in the back that allows for full coverage in front. It has long sleeves that allow for movement while staying warm. Grab this throw with sleeves and take a nap on the couch with your favorite character!\n    \n\n        Amazingly silky-soft and cozy, the Adult Silk Touch Comfy Throw Blanket with Sleeves by TheNorthwest is the perfect lounging accessory. This throw with sleeves is the ideal choice for comfort around the home. This 48"x 71" throw features an opening in the back that allows for full coverage in front. It has long sleeves that allow for movement while staying warm. Grab this throw with sleeves and take a nap on the couch with your favorite character!\n    \n\n\n', 4289, 'https://media.gamestop.com/i/gamestop/11165478/TheNorthwest-Star-Wars-Classic-Being-Darth-Vader-Adult-Throw-Blanket-with-Sleeves-48x71?$pdp2x$,https://media.gamestop.com/i/gamestop/11165478_ALT01/TheNorthwest-Star-Wars-Classic-Being-Darth-Vader-Adult-Throw-Blanket-with-Sleeves-48x71?$pdp2x$,', 56, 47),
	(119, 'Pokemon Pikachu Plush GameStop Exclusive', '\n\n        Cute and cuddly 24 Pokémon Pikachu Plush Stuffed Animal is a must have for all Pokemon fans! This super soft plush figure is great to take wherever you go! The Pikachu plush toy is inspired by Pokémon anime, trading cards, Let\'s Go! and Nintendo video games series! Makes a great gift for fans of Pokemon - Your favorite Pokémon character is waiting for you! Officially licensed Pokémon merchandise by Wicked Cool Toys. Polyester.\n    \n\n\n\nFeatures:24” inch Pikachu Plush Soft and cuddly plush version of PikachuGame Stop ExclusiveThe perfect Pokemon Toy for ages 2 years and upOfficial licensed product from Wicked Cool Toys!\n\n\n\n\n\n', 3999, 'https://media.gamestop.com/i/gamestop/10160337/Pokemon-Pikachu-Plush-GameStop-Exclusive?$pdp2x$,', 57, 48),
	(120, 'The Legend of Zelda It\'s Dangerous to Go Alone Doormat', '\n\n        Celebrate your fandom right on your doorstep with this all-natural coir doormat. Soft PVC backing makes it slip-resistant. Can be used indoors or outdoors.\n    \n\n\nIndoor/Outdoor Use\nNatural Coir\nSlip-Resistant Soft Pvc Backing\n\n\n\n\n', 2999, 'https://media.gamestop.com/i/gamestop/10157854/The-Legend-of-Zelda-Its-Dangerous-to-Go-Alone-Doormat?$pdp2x$,', 58, 49),
	(121, 'Star Wars The Mandalorian Hero Walk Mens T-Shirt', '\n\n        Take the reins as a Mandalorian Bounty Hunter exploring the galaxy in this awesome Star Wars tee that celebrates the Star Wars-inspired television series, The Mandalorian with favorites like Grogu, Mando, Greef Karga and more.\n    \n\nPrinted in the U.S.A.Machine WashablePrinted with Water-Based InksFifth Sun\n\n\n\n', 1998, 'https://media.gamestop.com/i/gamestop/11145398/Star-Wars-The-Mandalorian-Hero-Walk-Mens-T-Shirt?$pdp2x$,', 5, 5),
	(122, 'NFL Baltimore Ravens Console Skin for PlayStation 5 Digital Edition', '\n\n        The NFL Baltimore Ravens PS5 Digital Edition Console Skin is made from a 3M durable auto-grade vinyl for an ultimate lightweight PS5 Digital Edition Console decal protection without the bulk. Every Skinit Baltimore Ravens skin is officially licensed by NFL for an authentic brand design. The Baltimore Ravens Baltimore Ravens Sony PS5 Digital Edition Console decal skin is engineered to feature vibrant photo quality designs and to perfectly fit your PS5 Digital Edition Console The Baltimore Ravens Baltimore Ravens skin can be easily applied and removed from your PS5 Digital Edition Console with no residue, no mess and no fuss due to 3M adhesive backing. This makes it even easier for you to mix up your PS5 Digital Edition Console style as much as you want to keep your device feeling new. All Skinit made decal skins are cut and crafted with everyday PS5 Digital Edition Console uses in mind so that each Baltimore Ravens skin offers a premium feel with a thin functional protection. Shop all officially licensed NFL Baltimore Ravens Sony PS5 Digital Edition Console skins made by Skinit and make it yours today!\n    \n\nUltra-Thin, Lightweight PS5 Digital Edition Console Vinyl Decal ProtectionOffically Licensed NFL DesignIndustry Leading Vivid Color Vinyl Print TechnologyScratch - Resistant. Built To Last Everday PS5 Digital Edition Console Use3M Adhesive Backing - Easy On, Easy Off & Residue-Free\n\n\n\n', 2499, 'https://media.gamestop.com/i/gamestop/11119855/NFL-Baltimore-Ravens-Console-Skin-for-PlayStation-5-Digital-Edition?$pdp2x$,https://media.gamestop.com/i/gamestop/11119855_ALT01/NFL-Baltimore-Ravens-Console-Skin-for-PlayStation-5-Digital-Edition?$pdp2x$,https://media.gamestop.com/i/gamestop/11119855_ALT02/NFL-Baltimore-Ravens-Console-Skin-for-PlayStation-5-Digital-Edition?$pdp2x$,', 8, 8),
	(123, 'Pillars Of Eternity II: Deadfire Ultimate Collector\'s Edition - Xbox One', '\n\n        Pursue a rogue god over land and sea in the sequel to the multi-award-winning RPG Pillars of Eternity. Captain your ship on a dangerous voyage of discovery across the vast unexplored archipelago region of the Deadfire. Bend the world to your will, as you explore the depths of infinite possibilities, including detailed character customization, total freedom of exploration, and more meaningful choices at every turn.\n    \n\nObsidian Edition Includes: \nDIGITAL ITEMS:\n\nfirst three DLCs of PoEII (each individually priced at USD/EUR 9.99)\nofficial soundtrack composed by Justin Bell, composer of the soundtrack to the first Pillars of Eternity\nin-game pet\na Deadfire themed special in-game item\na digital pen and paper RPG starter guide\na high-resolution game map\nVolume II of the digital guide book, published by Dark Horse\n\nPHYSICAL ITEMS:\n\ncloth map\nExplorer\'s notepad\nset of postcards\n\n\nImmerse yourself in a deeper single player RPG game experience - enriched with cutting edge technology and features, Deadfire builds on the foundation of classic D&D gameplay with vastly improved graphics, deeper game mechanics and a whole new hand-crafted adventure where choices truly matter.\nDiscover the new region of the Deadfire – plot your own course by ship and explore the rich and exotic islands of the archipelago region, discovering new places interacting with their inhabitants and engaging in a variety of quests at every port.\nBuild your party and customize your companions – choose from 7 different companions to join you on your quest and assign multiple classes and deeper abilities for each. Witness their personal relationships and interactions unfold with the addition of the new companion system.\nCaptain your ship across the seas – as your stronghold on the seas, your ship is much more than simply a vessel for exploring. Upgrade your ship and crew and choose what skills you improve in order to survive dangerous encounters along the way.\n\n\n\n\n', 1998, 'https://media.gamestop.com/i/gamestop/11097573/Pillars-Of-Eternity-II-Deadfire-Ultimate-Collectors-Edition---Xbox-One?$pdp2x$,https://media.gamestop.com/i/gamestop/11097573_ALT01/Pillars-Of-Eternity-II-Deadfire-Ultimate-Collectors-Edition---Xbox-One?$pdp2x$,https://media.gamestop.com/i/gamestop/11097469_11097573_10175787_10175786_10175788_SCR06/Pillars-Of-Eternity-II-Deadfire-Ultimate-Collectors-Edition---Xbox-One?$screen2x$,https://media.gamestop.com/i/gamestop/11097469_11097573_10175787_10175786_10175788_SCR05/Pillars-Of-Eternity-II-Deadfire-Ultimate-Collectors-Edition---Xbox-One?$screen2x$,https://media.gamestop.com/i/gamestop/11097469_11097573_10175787_10175786_10175788_SCR04/Pillars-Of-Eternity-II-Deadfire-Ultimate-Collectors-Edition---Xbox-One?$screen2x$,https://media.gamestop.com/i/gamestop/11097469_11097573_10175787_10175786_10175788_SCR03/Pillars-Of-Eternity-II-Deadfire-Ultimate-Collectors-Edition---Xbox-One?$screen2x$,https://media.gamestop.com/i/gamestop/11097469_11097573_10175787_10175786_10175788_SCR02/Pillars-Of-Eternity-II-Deadfire-Ultimate-Collectors-Edition---Xbox-One?$screen2x$,https://media.gamestop.com/i/gamestop/11097469_11097573_10175787_10175786_10175788_SCR01/Pillars-Of-Eternity-II-Deadfire-Ultimate-Collectors-Edition---Xbox-One?$screen2x$,https://media.gamestop.com/i/gamestop/11097469_11097573_10175787_10175786_10175788_SCR06/Pillars-Of-Eternity-II-Deadfire-Ultimate-Collectors-Edition---Xbox-One?$screen$,https://media.gamestop.com/i/gamestop/11097469_11097573_10175787_10175786_10175788_SCR05/Pillars-Of-Eternity-II-Deadfire-Ultimate-Collectors-Edition---Xbox-One?$screen$,https://media.gamestop.com/i/gamestop/11097469_11097573_10175787_10175786_10175788_SCR04/Pillars-Of-Eternity-II-Deadfire-Ultimate-Collectors-Edition---Xbox-One?$screen$,https://media.gamestop.com/i/gamestop/11097469_11097573_10175787_10175786_10175788_SCR03/Pillars-Of-Eternity-II-Deadfire-Ultimate-Collectors-Edition---Xbox-One?$screen$,https://media.gamestop.com/i/gamestop/11097469_11097573_10175787_10175786_10175788_SCR02/Pillars-Of-Eternity-II-Deadfire-Ultimate-Collectors-Edition---Xbox-One?$screen$,https://media.gamestop.com/i/gamestop/11097469_11097573_10175787_10175786_10175788_SCR01/Pillars-Of-Eternity-II-Deadfire-Ultimate-Collectors-Edition---Xbox-One?$screen$', 15, 15),
	(124, 'Kids Learn Spelling and Grammar A Plus Edition - Nintendo DS', '\n\n        SPELLING CAN BE FUN!\n\nSpelling and Grammar is a fun way for kids to learn and practice their English language skills. Kids are cast into the role of a detective where a variety of themed games and exercises will "teach" language through various modes of game play. kids can play with their friends in multiplayer mode or play\n    \n\n\n\n15 different mini games with a variety of content to help learn spelling and grammar. 3 types of exercise modes: Forming Syllables, Synonyms and Antonyms. Integrated age check provides learning for all levels of knowledge. \n\n\n\n\n\n', 699, 'https://media.gamestop.com/i/gamestop/10099314/Kids-Learn-Spelling-and-Grammar-A-Plus-Edition---Nintendo-DS?$pdp2x$,', 59, 22),
	(125, 'Mobile Suit Gundam Calamity Full Mechanics Grade Model Kit', '\n\nThe Calamity Gundam from MS Gundam Seed, a series popular among fans will be available and joins the new format series Full Mechanics. The joint gimmicks throughout the body enable the recreation of scenes from the series. Details such as the moving Ram Cannons on the shield, the "Schlag" Long-Range Beam Cannon on the back, and the range of articulation despite the Mobile Suit\'s hefty silhouette enable dynamic action poses. Kit includes: "Todesblock" a 337mm Plasma-Sabot Bazooka, "Kaefer Zwei" 2-barrel 115mm Ram Cannon shield, a set of foil stickers and a set of marking stickers.\n\n\n\n\n  The Calamity Gundam\n  from MS Gundam Seed, a series popular among fans will be available and joins\n  the new format series Full Mechanics. The joint gimmicks throughout the body\n  enable the recreation of scenes from the series. Details such as the moving\n  Ram Cannons on the shield, the "Schlag" Long-Range Beam Cannon on\n  the back, and the range of articulation despite the Mobile Suit\'s hefty\n  silhouette enable dynamic action poses. Kit includes: "Todesblock"\n  a 337mm Plasma-Sabot Bazooka, "Kaefer Zwei" 2-barrel 115mm Ram\n  Cannon shield, a set of foil stickers and a set of marking stickers.\n\n\n\n\n\n', 6099, 'https://media.gamestop.com/i/gamestop/11118817/Mobile-Suit-Gundam-Calamity-Full-Mechanics-Grade-Model-Kit?$pdp2x$,', 12, 13),
	(126, 'Melissa and Doug Fresh Mart Grocery Store Companion Collection', '\n\n        This companion set to the Fresh Mart Grocery Store has everything kids three and older need to stock shelves and get shopping! There are 70 pieces to play with, including grocer and shopper role-play items like an apron, conveyor belt divider bar, and a cloth shopping bag, a fully stocked grab-and-go rack (gum, granola bar, a magazine, and more!), play money, cards, and coupons, and grocery boxes and cans! This set plays perfectly with the Melissa & Doug Fresh Mart Grocery Store!\n    \n\n\n\n\n70-piece play set of grocery store accessories\nRoleplay items include apron, conveyor belt divider bar, shopping bag, play money, cards, coupons\nGrab-and-go rack with gum, lip balm, granola bar, gift cards, signs\n5 grocery boxes and 2 grocery cans with lids\nFor ages 3 and up\n\n\n\n\n\n\n', 1694, 'https://media.gamestop.com/i/gamestop/11177308/Melissa-and-Doug-Fresh-Mart-Grocery-Store-Companion-Collection?$pdp2x$,https://media.gamestop.com/i/gamestop/11177308_ALT01/Melissa-and-Doug-Fresh-Mart-Grocery-Store-Companion-Collection?$pdp2x$,https://media.gamestop.com/i/gamestop/11177308_ALT02/Melissa-and-Doug-Fresh-Mart-Grocery-Store-Companion-Collection?$pdp2x$,', 3, 50),
	(127, 'Hasbro Transformers: Generations Galvatron Selects Leader WFC-GS27 7-in Action Figure', '\n\nFans can take their Transformers figure collections to the next level with Generations Selects, a fan-dedicated line of figures featuring fan-favorite, special edition characters you can’t find in the main line.\nBehold, Galvatron! The herald of Unicron blasts his way into the Generations Selects line with this special edition figure! This Galvatron figure is inspired by the classic 1986 toy release, featuring comic-inspired deco. Includes 2 weapon accessories and the classic green Matrix of Leadership accessory on a chain that can be worn around the figure’s neck. This Galvatron figure converts from robot to Galactic Cannon mode in 33 steps. Comes with a sheet of foil labels, including a heat-sensitive sticker that reveals the Decepticon shield when you rub it with your finger\n\n\nFEATURES:\n\nEXPAND YOUR COLLECTION WITH SPECIAL EDITION FIGURES: Generations Selects is a fan-dedicated line of figures featuring special edition characters that can\'t be found in the main line\nINSPIRED BY 1986 GALVATRON: Behold, Galvatron! This Galvatron figure is inspired by the classic G1 toy release in 1986, with comic-inspired deco\nCLASSIC TRANSFORMERS CONVERSION: This Galvatron figure converts from robot to Galactic Cannon mode in 33 steps\nAWESOME ACCESSORIES: Includes classic green Matrix of Leadership accessory on a chain that can be worn around the figure\'s neck. Also comes with 2 weapon accessories\n\nWHAT\'S INCLUDED:\n\nGenerations Selects Leader Class Galvatron figure\n3 Accessories\nFoil sticker sheet\nInstructions\n\nSPECIFICATIONS:\n\nFigure scale: 7 inches\nAges 8 and up\nWARNING: CHOKING HAZARD - Small parts. Not for children under 3 years.\n\n\n\n\n', 5299, 'https://media.gamestop.com/i/gamestop/11153461/Hasbro-Transformers-Generations-Galvatron-Selects-Leader-WFC-GS27-7-in-Action-Figure?$pdp2x$,https://media.gamestop.com/i/gamestop/11153461_ALT01/Hasbro-Transformers-Generations-Galvatron-Selects-Leader-WFC-GS27-7-in-Action-Figure?$pdp2x$,https://media.gamestop.com/i/gamestop/11153461_ALT02/Hasbro-Transformers-Generations-Galvatron-Selects-Leader-WFC-GS27-7-in-Action-Figure?$pdp2x$,https://media.gamestop.com/i/gamestop/11153461_ALT03/Hasbro-Transformers-Generations-Galvatron-Selects-Leader-WFC-GS27-7-in-Action-Figure?$pdp2x$,https://media.gamestop.com/i/gamestop/11153461_ALT04/Hasbro-Transformers-Generations-Galvatron-Selects-Leader-WFC-GS27-7-in-Action-Figure?$pdp2x$,https://media.gamestop.com/i/gamestop/11153461_ALT05/Hasbro-Transformers-Generations-Galvatron-Selects-Leader-WFC-GS27-7-in-Action-Figure?$pdp2x$,https://media.gamestop.com/i/gamestop/11153461_ALT06/Hasbro-Transformers-Generations-Galvatron-Selects-Leader-WFC-GS27-7-in-Action-Figure?$pdp2x$,https://media.gamestop.com/i/gamestop/11153461_ALT07/Hasbro-Transformers-Generations-Galvatron-Selects-Leader-WFC-GS27-7-in-Action-Figure?$pdp2x$,https://media.gamestop.com/i/gamestop/11153461_ALT08/Hasbro-Transformers-Generations-Galvatron-Selects-Leader-WFC-GS27-7-in-Action-Figure?$pdp2x$,https://media.gamestop.com/i/gamestop/11153461_ALT09/Hasbro-Transformers-Generations-Galvatron-Selects-Leader-WFC-GS27-7-in-Action-Figure?$pdp2x$,', 24, 7),
	(128, 'New Nintendo 3DS XL Pikachu Yellow GameStop Premium Refurbished', '\n\n        The Nintendo NEW 3DS XL features face Tracking 3D, The C Stick, Built-in amiibo Support, and more...\n    \n\n\n\nIncludes: System, ac adapter, stylusWhat\'s New?Face Tracking 3D - Using the inner camera, face tracking 3D provides an improved 3D gaming experience from a wider range of viewing angles compared to Nintendo 3DS. The New Nintendo 3DS XL system automatically adjusts the 3D sweet spot based on the location of the user\'s face.New Controls - The C Stick opens a new world to your games. With certain games, you can freely control the in-game camera to get a new point of view. And, new ZL and ZR buttons give you more options than ever.Built-in amiibo Support - Tap an amiibo figure to the near-field communication (NFC) reader on the lower screen to enjoy amiibo features in compatible games. Get bonus items and content, customize your character, and more when you use amiibo figures (like Mario!) with amiibo-compatible games. *amiibo figures sold seperatelyFaster Processing Power - Improved processing power allows for faster loading of applications, such as Miiverse and games. Plus the improved CPU performance allows you to enjoy faster speeds for downloading software*. *Download speeds may vary depending on internet connection.Play Even More Games - You can still play all Nintendo 3DS games and nearly all games from previous systems such as Nintendo DS and DSi. And, some future titles will be exclusively playable on the New Nintendo 3DS XL.Ready to Upgrade - Taking your games with you is a snap. You can use local wireless to transfer all your data or just specific data from one device to the other. You may also transfer via PC.\n\n\n\n\n\n', 14999, 'https://media.gamestop.com/i/gamestop/10149278/New-Nintendo-3DS-XL-Pikachu-Yellow-GameStop-Premium-Refurbished?$pdp2x$,', 27, 37),
	(129, 'American Flag Pledge of Allegiance Word Art Mens Hooded Sweatshirt', '\n\nAmerican Flag created out of the Pledge of Allegiance. The Pledge of Allegiance is one of the first thing we are taught as children and the spirit and power of those few perfect lines is something that stays with us forever. There is a reason America is the greatest country in the world and its because of its people. This American Flag "Word Art" design is created out of the full text to The Pledge of Allegiance.\n\n\nMATERIAL - 50% Cotton/50% Polyester.FEATURES - Front pouch pocket, Matching color drawstring .PRINTED WITH PRIDE IN THE USA - All of our products are printed and shipped from Las Vegas, Nevada USA.\n\n\n\n', 4999, 'https://media.gamestop.com/i/gamestop/11134245_gray/American-Flag-Pledge-of-Allegiance-Word-Art-Mens-Hooded-Sweatshirt-gray?$pdp2x$,', 2, 16),
	(130, 'ASUS ROG Swift PG258Q Full HD 1080p 240Hz Gaming Monitor 24.5-in', '\n\n        25"" Full HD (1920x1080p) panel with a 1ms response time and native 240Hz refresh rate with a frameless design and customizable LED lighting effect\nFlexible connectivity options with DisplayPort 1.2, HDMI 1.4 and 2 x USB 3.0 ports\nNVIDIA G-SYNC ensures smooth gameplay by eliminating screen tearing and stuttering\nASUS Eye Care technology makes marathons even easier, reducing eyestrain and other eye ailments with TUV Rheinland-certified blue light filter and flicker-free backlighting\nGame-grade ergonomics such as tilt, pivot, swivel and height adjustments allow you to play like a pro in your comfort zone.\n    \n\n\nGET SWIFT. BE UNBEATABLE. ROG Swift PG258Q is all about speed - making it the perfect monitor for eSports and fast-paced action games. This Full HD monitor is the fastest ever, with a 240Hz native refresh rate, 1ms response time and NVIDIA? G-SYNC? technology for silky-smooth gameplay and ultra-realistic visuals. On top of that, Swift PG258Q has distinct ROG-inspired design elements that let everyone know that this is no ordinary gaming monitor.\nTHE SENSATION OF SPEED, INCREDIBLY FAST 240HZ REFRESH RATE: ROG Swift PG258Q\'s astonishing 240Hz native refresh rate makes it twice as fast as conventional 120Hz monitors. You\'ll experience amazingly -fluid gaming visuals, giving you the upper hand in first-person shooters, racing, real-time strategy and sports titles. There will be no break in the action!\nNVIDIA? G-SYNC TECHNOLOGY WITH ULTRA LOW MOTION BLUR: Coupling ROG Swift PG258Q\'s 240Hz refresh rate with NVIDIA G-SYNC technology results in the smoothest, fastest, most breathtaking gaming imaginable. G-SYNC synchronizes Swift PG258Q\'s refresh rate to the GeForce GTX graphics card in your PC or laptop to eliminate screen tearing and to minimize display stutter. There\'s also the Ultra Low Motion Blur (ULMB) technology to make objects in motion look sharper, so gameplay is more fluid and responsive.\n1MS RAPID RESPONSE TIME: ROG Swift PG258Q is the fastest in its class, with a 1ms gray-to-gray response time to completely eliminate smearing and motion blur. It\'s especially useful in fast- paced games - so you can take corners like a pro race car driver, or make that impossible headshot.\n\n\nMain Specifications \nBrandAsus\nTypeMonitor\nUnit Dimension (DxWxH)9.99 x 22.21 x 19.83\nShipping Dimension (DxWxH)25.9 x 17.4 x 9.3\nUnit Weight 12.35\nShipping Weight 18.6\nScreen Size24.5"\nScreen ModeFull HD\nResponse Time1ms\nAspect Ratio16:9\nRefresh Rate240Hz\nBrightness400 Nit\nMax Resolution1920 x 1080\nColor Supported16.7 million\nContrast1000:1\nTearing PreventionG-Sync\nInterfacesDisplayPort, HDMI, USB\nAccessories IncludedPower Cable\nVESA Mount CompatibleYes\nManufacturer Warranty3 year warranty through Asus\nCountry of OriginChina\n\n\n\n\n', 49999, 'https://media.gamestop.com/i/gamestop/10159830/ASUS-ROG-Swift-PG258Q-Full-HD-1080p-240Hz-Gaming-Monitor-24.5-in?$pdp2x$,', 60, 51),
	(131, 'NCAA Football 2012 - Xbox 360', '\n\n        NCAA Football 12 takes the journey of the college athlete to the next level of depth and authenticity. Experience the pride and pageantry of gameday Saturday like never before as you go from high school superstar to top college player to head coach in Road to Glory and Dynasty modes. With an enhanced in-game presentation, new traditions, and an all-new collision system, make an impact by leading your team to the National Championship with NCAA Football 12.\n    \n\n\nAuthentic Gameday Traditions—Feel the true emotion of college football as your team runs onto the field with new pre-game traditions like the Sooner Schooner and Ramblin\' Wreck, and celebrate big plays alongside school icons like Chief Osceola, Uga, and Tommy Trojan.\nEnhanced Tackling Engine—Your college gameday experience rises to a whole new level with an all-new momentum-based collision and tackling system that allows you to control a player through the moment of impact.\n\n\n\n\n', 1798, 'https://media.gamestop.com/i/gamestop/10089429/NCAA-Football-2012---Xbox-360?$pdp2x$,', 14, 17),
	(132, 'Case-Mate Case for iPhone 13 Pro Cute as a Dumpling', '\n\n        Give your phone the trendy update it deserves with Tough Prints! Choose from a variety of different fashion prints that perfectly match your vibe. The Tough Prints collection is backed with 10-foot drop protection and anti-scratch protection to keep your device styling safely.   \n\nHere at Case-Mate, we know that a case isn\'t just something you slip on the back of your phone and forget. It\'s a fashion accessory in its own right. A phone case expresses your personality, accentuates your look, and most importantly protects your phone. But just because it\'s a practical necessity doesn\'t mean it can\'t be beautiful and stylish.\n\nCASE???MATE, On Point.\n\n? Compatible with\n    \n\n\n\nThe best of form and function: this trendy print gives your phone a pop of personality and the resilient clear case offers durable device protection while still allowing the beauty of your device to shine through  10 foot drop protection and durable anti-scratch coating  One piece seamless design to allow you to easily swap out your Prints to match your style  Shock absorbing materials with cushioned corners and flxible sides for enhanced grip  Tactile buttons for full device functionality\n\n\n\n\n\n', 2999, 'https://media.gamestop.com/i/gamestop/11172167/Case-Mate-Case-for-iPhone-13-Pro-Cute-as-a-Dumpling?$pdp2x$,https://media.gamestop.com/i/gamestop/11172167_ALT01/Case-Mate-Case-for-iPhone-13-Pro-Cute-as-a-Dumpling?$pdp2x$,https://media.gamestop.com/i/gamestop/11172167_ALT02/Case-Mate-Case-for-iPhone-13-Pro-Cute-as-a-Dumpling?$pdp2x$,https://media.gamestop.com/i/gamestop/11172167_ALT03/Case-Mate-Case-for-iPhone-13-Pro-Cute-as-a-Dumpling?$pdp2x$,', 61, 32),
	(133, 'Observer: System Redux - PlayStation 4', '\n\n        GameStop is excited to bring you Observer: System Redux on PS4! Discover a dark, cyberpunk world as you become a neural police detective and solve the case by hacking into the minds of others.\n    \n\nObserver: System Redux is the definitive vision of the award-winning cyberpunk thriller, rebuilt and augmented for the next generation.?\nSYSTEM REDUX\nVeteran Observers can dive deeper into this dystopian reality thanks to three brand-new side cases to solve. “Errant Signal”, “Her Fearful Symmetry” and “It Runs in the Family” add another layer of depth to the game’s story while exploring thought-provoking themes of a future that soon might become our present.\nOn top of that, System Redux offers expanded gameplay, which includes new game mechanics, new secrets to find, redesigned stealth, additional neural interrogations, and quality-of-life improvements made with the help of the Observer community.?\nNewcomers get the chance to experience one of the most thrilling cyberpunk stories in all its next-gen glory: boasting 4K resolution, upgraded textures, new animations, models and effects, and transformed with jaw-dropping Ray-Tracing and HDR lighting.\nWELCOME TO THE FUTURE\nThe year is 2084. The future has turned out much darker than anyone could imagine. First, there was the Nanophage. A digital plague that killed thousands upon thousands of those who chose to augment their minds and bodies.\nThen came the War, leaving both the West and the East decimated and shattered. With no one left to seize power, corporations took over and forged their own crooked empires.\nYou are a tool of corporate oppression. Feared and despised, you hack into the darkest corners of your suspects’ minds. You creep into their dreams, expose their fears, and extract whatever your investigation may require.\nYou are an Observer.\nBECOME A NEURAL DETECTIVE\nYou play as Daniel Lazarski, an elite investigator of the future portrayed by late cyberpunk icon Rutger Hauer. As an Observer, you hack into the minds of suspects to extract clues and evidence. Anything they felt, thought, or remembered can and will be used to solve your case.?\nEAT THEIR DREAMS\nUsing a device known as the Dream Eater, hack into the minds of the dead and dying to relive their final moments, to explore their fears and obsessions. Delve into these twisted neural mazes and search for clues that will help you find the elusive killer. But beware: the deeper you go, the greater the risk of losing your own sanity.\nTAKE IN THE ATMOSPHERE OF 2084\nEnter a world ravaged by war and cyber-plague, where life is cheap and hope is scarce. Where most people will do anything to escape their grim existence. Virtual realities, mind-altering drugs, neural implants - pick your poison and drift away into a blissful oblivion. But remember, no matter how deep you go, you can never hide from an Observer.\n\n\n\n', 2699, 'https://media.gamestop.com/i/gamestop/11146433/Observer-System-Redux---PlayStation-4?$pdp2x$,https://media.gamestop.com/i/gamestop/11146433_11146434_11146435_SCR07/Observer-System-Redux---PlayStation-4?$screen2x$,https://media.gamestop.com/i/gamestop/11146433_11146434_11146435_SCR06/Observer-System-Redux---PlayStation-4?$screen2x$,https://media.gamestop.com/i/gamestop/11146433_11146434_11146435_SCR05/Observer-System-Redux---PlayStation-4?$screen2x$,https://media.gamestop.com/i/gamestop/11146433_11146434_11146435_SCR04/Observer-System-Redux---PlayStation-4?$screen2x$,https://media.gamestop.com/i/gamestop/11146433_11146434_11146435_SCR03/Observer-System-Redux---PlayStation-4?$screen2x$,https://media.gamestop.com/i/gamestop/11146433_11146434_11146435_SCR02/Observer-System-Redux---PlayStation-4?$screen2x$,https://media.gamestop.com/i/gamestop/11146433_11146434_11146435_SCR01/Observer-System-Redux---PlayStation-4?$screen2x$,https://media.gamestop.com/i/gamestop/11146433_11146434_11146435_SCR07/Observer-System-Redux---PlayStation-4?$sc