	(135, 'My Hero Academia Collectible Card Game Deck-Loadable Content Deck', '\n\n        Players get even more in this exciting expansion pack for the My Hero Academia CCG with new Character Cards for All Might, Tenya Iida, Ochaco Uraraka, and Tsuyu Asui! This pack contains 20 foils cards: 4 Character Cards, 2 of each Character\'s Attacks, and 2 of each Character\'s Foundations.\n    \n\n\n\n\nWhat\'s included: This pack contains 20 foils cards: 4 Character Cards, 2 of each Character\'s Attacks, and 2 of each Character\'s Foundations.\nFeatures new character cards for All Might, Tenya Iida, Ochaco Uraraka, and Tsuyu Asui!\nAges 14 and Up\n\n\n\n\n\n\n', 2999, 'https://media.gamestop.com/i/gamestop/11173354/My-Hero-Academia-Collectible-Card-Game-Deck-Loadable-Content-Deck?$pdp2x$,https://media.gamestop.com/i/gamestop/11173354_ALT01/My-Hero-Academia-Collectible-Card-Game-Deck-Loadable-Content-Deck?$pdp2x$,', 63, 52),
