	(137, 'Shin Megami Tensei: Strange Journey Redux - Nintendo 3DS', '\n\n        A spatial distortion full of demons appeared in Antarctica, threatening to engulf the Earth in Shin Megami Tensei: Strange Journey . The United Nations responded by tasking a team of highly advanced specialists with piercing the anomaly and figuring out how to stop it from the source. Well, get ready to don your Demonica once again in this new expanded port: Shin Megami Tensei: Strange Journey Redux . Expect new story content, additional endings, a new dungeon to explore, and more in the return of this sci-fi tinged SMT adventure.\n    \n\n\n\nA Stranger Journey Back In Strange Journey Redux, you play as a brave United Nations soldier investigating a spatial anomaly called the Schwarzwelt—a dome of dark energy that threatens to consume the world. Inside, you\'ll find it home to a nightmare mirror of our own Earth, populated with demons dying to meet you. The game touts brand-new illustrations by Masayuki Doi, updated visuals, UI tweaks, and more to make this journey back into the Schwarzwelt… even stranger. Additional Story Content and a Brand-New Character You won\'t be retreading the same nightmarish path as before because a brand-new character named Alex will play a major role in how the story unfolds. Much about her is a mystery, but there is one thing you know for sure: she\'s got a bone to pick with you. Joining her are new demons you might recognize from other SMT entries, new endings, and a new dungeon to discover. A True Shin Megami Tensei Adventure With its twisted demonic sci-fi story, addictive demon-collecting fun, and multiple narrative paths to explore, Strange Journey Redux is an essential ATLUS JRPG adventure that can\'t be missed!\n\n\n\n\n\n', 1698, 'https://media.gamestop.com/i/gamestop/10149539/Shin-Megami-Tensei-Strange-Journey-Redux---Nintendo-3DS?$pdp2x$,https://media.gamestop.com/i/gamestop/10149539_SCR06/Shin-Megami-Tensei-Strange-Journey-Redux---Nintendo-3DS?$screen2x$,https://media.gamestop.com/i/gamestop/10149539_SCR05/Shin-Megami-Tensei-Strange-Journey-Redux---Nintendo-3DS?$screen2x$,https://media.gamestop.com/i/gamestop/10149539_SCR04/Shin-Megami-Tensei-Strange-Journey-Redux---Nintendo-3DS?$screen2x$,https://media.gamestop.com/i/gamestop/10149539_SCR03/Shin-Megami-Tensei-Strange-Journey-Redux---Nintendo-3DS?$screen2x$,https://media.gamestop.com/i/gamestop/10149539_SCR02/Shin-Megami-Tensei-Strange-Journey-Redux---Nintendo-3DS?$screen2x$,https://media.gamestop.com/i/gamestop/10149539_SCR01/Shin-Megami-Tensei-Strange-Journey-Redux---Nintendo-3DS?$screen2x$,https://media.gamestop.com/i/gamestop/10149539_SCR06/Shin-Megami-Tensei-Strange-Journey-Redux---Nintendo-3DS?$screen$,https://media.gamestop.com/i/gamestop/10149539_SCR05/Shin-Megami-Tensei-Strange-Journey-Redux---Nintendo-3DS?$screen$,https://media.gamestop.com/i/gamestop/10149539_SCR04/Shin-Megami-Tensei-Strange-Journey-Redux---Nintendo-3DS?$screen$,https://media.gamestop.com/i/gamestop/10149539_SCR03/Shin-Megami-Tensei-Strange-Journey-Redux---Nintendo-3DS?$screen$,https://media.gamestop.com/i/gamestop/10149539_SCR02/Shin-Megami-Tensei-Strange-Journey-Redux---Nintendo-3DS?$screen$,https://media.gamestop.com/i/gamestop/10149539_SCR01/Shin-Megami-Tensei-Strange-Journey-Redux---Nintendo-3DS?$screen$', 64, 37),
	(138, 'Zombie Swarm T-Shirt', '\n\n        100% Ring Spun Cotton\n    \n\n\nmachine wash cold, with like colors\nonly non-chlorine bleach if needed\ntumble dry low\nwarm iron if needed\n\n\n\n\n', 1998, 'https://media.gamestop.com/i/gamestop/11104538/Zombie-Swarm-T-Shirt?$pdp2x$,', 22, 5),
	(139, 'Super C - Nintendo', '\n\n        In this action-packed sequel to the popular Contra, players have little time to think. Experience run-and-gun game play at its best as you take control of Mad Dog or Scorpion and once again battle the forces of Red Falcon. Stages feature a combination of perspectives (side scrolling, top down, etc.) and intense battles against huge bosses. Use a variety of powerful weapons and tap into your killer instinct to survive the deadly waves of enemies. And if you\'re scared, recruit a friend to help you. Because if your trigger finger lacks stamina, then Earth will lack a future!\n    \n\n\n\n Pre-owned Guarantee This pre-owned product has been carefully tested, and is guaranteed to work.  If you are not completely satisfied, simply return the product within 7 days for your money back.  Product may not include original box and instruction manual.  Item pictured may not be exact item received.  \n\n\n\n\n\n', 1998, 'https://media.gamestop.com/i/gamestop/10122771/Super-C---Nintendo?$pdp2x$,', 65, 43),
