	(142, 'Highland Mint MLB Boston Red Sox World Series Champions Ticket Collection', '\n\n        The Boston Red Sox replica World Series ticket collection is  featured in a 12" x 15" wood frame with double matting. A 39mm minted bronze Boston Red Sox World Series Champions commemorative coin and a 39mm minted bronze Boston Red Sox team coin are accompanied by a certificate of authenticity. It is officially licensed by the MLB and proudly made in the USA by The Highland Mint!\n    \n\n\n', 6998, 'https://media.gamestop.com/i/gamestop/11133967/Highland-Mint-MLB-Boston-Red-Sox-World-Series-Champions-Ticket-Collection?$pdp2x$,', 4, 53),
	(143, 'Call of Duty: Black Ops - Nintendo Wii', '\n\n        The biggest first-person action series of all time and the follow-up to last year\'s blockbuster Call of Duty: Modern Warfare 2 returns with Call of Duty: Black Ops.Call of Duty: Black Ops will take you behind enemy lines as a member of an elite special forces unit engaging in covert warfare, classified operations, and explosive conflicts across the globe. With access to exclusive weaponry and equipment, your actions will tip the balance during the most dangerous time period mankind has ever known.\n    \n\n\n\nCinematic Single Player CampaignAn epic campaign and story that takes you to a variety of locations and conflicts all over the world where if you are caught, captured or killed, your country will disavow all knowledge of your existence.Signature Multiplayer Call of Duty\'s signature multiplayer gameplay returns with new perks and killstreaks, deeper levels of character and weapon customization, and all new modes including:Wager Matches: One in the Chamber, Gun Game, Stick and Stones, SharpshooterCombat Training: Test your skills solo or Co-Op with friends against AI enemy playersZombies! Fan favorite Zombie mode is back providing endless hours of Zombie-slaying entertainment, solo or Co-Op \n\n\n\n\n\n', 1798, 'https://media.gamestop.com/i/gamestop/10077885/Call-of-Duty-Black-Ops---Nintendo-Wii?$pdp2x$,', 20, 45),
	(144, 'Apex Legends Mirage Edition', '\n\n        Ride into town looking good as you lay down the law on the competition with the Apex Legends? - Mirage Edition. Outlaws beware, this new sheriff is ready to stop evildoers in their tracks.\n    \n\nThe Mirage Edition includes:\n\nExclusive Legendary  ” ”The Show Stopper ” ” Mirage Skin\nExclusive Legendary  ” ”The Mantlepiece ” ” Volt SMG Skin\nExclusive  ” ”Boots \'N All ” ” Gun Charm\nExclusive  ” ”Holo Star ” ” Badge\n1,000 Apex Coins\n\nThere\'s a new sheriff in town and he looks really really shiny. Get ready to lay down the law in style with the Apex Legends Mirage Edition. It\'s got everything you need to let the competition know you\'re not all hat and no cattle.\nApex Legends? is a free-to-play hero shooter game where legendary characters battle for glory, fame, and fortune on the fringes of the Frontier.\n\n\n\n', 1998, 'https://media.gamestop.com/i/gamestop/11146553/Apex-Legends-Mirage-Edition?$pdp2x$,', 14, 25),
	(145, 'Good Vibes Rainbow Word Art Mens Raglan Baseball T-Shirt', '\n\nCreated using the words Love, Good Vibes & Happiness Life is not always rainbows, love, good vibes & happiness - but in the case of our "word art" rainbow design, it actually is!  Spread good vibes with our rainbow shirt created out of the words Love, Good Vibes & Happiness. \n\n\n\n', 2899, 'https://media.gamestop.com/i/gamestop/11139548_navygray/Good-Vibes-Rainbow-Word-Art-Mens-Raglan-Baseball-T-Shirt-navygray?$pdp2x$,', 2, 5),
	(146, 'Mario Party 3 - Nintendo 64', '\n\n        Mario and friends are throwing a party and you\'re invited. It\'s their biggest bash yet, with seventy totally new Mini-Games and five brand new adventure boards. You\'ll be the life of the party as you punch, pound and stampede right over your opponents in a multiplayer melee or go head-to-head in the new two-player duel mode. You can even unlock new characters in the one-player challenge. With so much fun and excitement, this is a bash you\'ll just have to crash!\n    \n\n\n\n Pre-owned Guarantee This pre-owned product has been carefully tested, and is guaranteed to work.  If you are not completely satisfied, simply return the product within 7 days for your money back.  Product may not include original box and instruction manual.  Item pictured may not be exact item received.  \n\n\n\n\n\n', 4999, 'https://media.gamestop.com/i/gamestop/10122514/Mario-Party-3---Nintendo-64?$pdp2x$,', 27, 54),
	(147, 'PaperCraft World 3D Model Otter', '\n\nPlayful, cute and inquisitive, otters are curious creatures children connect to. Made out of 3D kirigami paper, our self standing otter figurine shelf ornament is perfect for decorating a classroom, nursery, or home. This otter paper decor comes in practical pre-cut and pre-creased numbered pieces and is not intended only for arts and crafts enthusiasts. This otter paper model kit is made for anyone and everyone and only requires a little patience and time. Just follow the instructions and have fun! Tacky art glue not included.\n\n\nFEATURES:\n\nEnjoy a calming and rewarding experience.\nBring life and character to any room.\nAn excellent bonding activity for family and friends of all ages.\nDisconnect from devices and reconnect to creativity.\nNo scissors needed.\n100% recycled materials and fully recyclable.\n\n\n\n\n', 2495, 'https://media.gamestop.com/i/gamestop/11154016/PaperCraft-World-3D-Model-Otter?$pdp2x$,https://media.gamestop.com/i/gamestop/11154016_ALT01/PaperCraft-World-3D-Model-Otter?$pdp2x$,https://media.gamestop.com/i/gamestop/11154016_ALT02/PaperCraft-World-3D-Model-Otter?$pdp2x$,https://media.gamestop.com/i/gamestop/11154016_ALT03/PaperCraft-World-3D-Model-Otter?$pdp2x$,https://media.gamestop.com/i/gamestop/11154016_ALT04/PaperCraft-World-3D-Model-Otter?$pdp2x$,https://media.gamestop.com/i/gamestop/11154016_ALT05/PaperCraft-World-3D-Model-Otter?$pdp2x$,', 66, 13),
	(148, 'Super NES Classic Edition Controller', '\n\n        The Super NES Classic Edition system looks and feels just like the original ’90s home console, except it’s super small. Play 20 classic Super NES games plus *gasp* the never-before-released Star Fox? 2 game!\n    \n\n\n', 1798, 'https://media.gamestop.com/i/gamestop/10171311/Super-NES-Classic-Edition-Controller?$pdp2x$,', 27, 36),
	(149, 'Star Wars Jedi Knight Robe Deluxe Kids', '\n\nComplete your Star Wars costume with this Deluxe Super Jedi Hood Robe for Kids! This high-quality costume replica of the traditional Jedi ceremonial robe is made of comfortable and durable materials for a costume piece you will love to wear again and again! Add a lightsaber so that your Jedi is ready for battle! Perfect for Star Wars cosplay, Halloween and any other costumed occasion year round! Don\'t wait until the last minute! Order yours online today!\n\n\nComplete your Star Wars costume with this Deluxe Super Jedi Hood Robe for Kids! This high-quality costume replica of the traditional Jedi ceremonial robe is made of comfortable and durable materials for a costume piece you will love to wear again and again! Add a lightsaber so that your Jedi is ready for battle! Perfect for Star Wars cosplay, Halloween and any other costumed occasion year round! Don\'t wait until the last minute! Order yours online today!\n\n\n\n', 5999, 'https://media.gamestop.com/i/gamestop/11169425/Star-Wars-Jedi-Knight-Robe-Deluxe-Kids?$pdp2x$,', 67, 55),
	(150, 'Animal Crossing Isabelle Looking Toward New Horizons Long Sleeve T-Shirt', '\n\n        Join all your favorite villagers in this officially licensed Nintendo Animal Crossing apparel!\n    \n\nPrinted in the U.S.A\nMachine Washable\nPrinted with Water-Based Ink\nFifth Sun\n\n\n\n\n', 2499, 'https://media.gamestop.com/i/gamestop/11122208/Animal-Crossing-Isabelle-Looking-Toward-New-Horizons-Long-Sleeve-T-Shirt?$pdp2x$,', 5, 5),
	(151, 'Sniper Elite III - Xbox 360', '\n\n        Featuring a greater focus on player agency/choice and expansive environments filled with opportunities for distinct play-styles, and set in the exotic yet deadly terrain of North Africa during World War Two, Sniper Elite 3 sees American OSS agent Karl Fairburne deep behind Nazi lines, providing crucial sharpshooter skills as the Allies battle Germany\'s fearsome Tiger tanks across the Western Desert. But it\'s not just the famed Afrika Korps that Karl has to worry about. He soon uncovers German plans to build a “wunderwaffe” – wonder weapon – with the power to crush any Allied forces in its path, and turn the tide of the whole war.\n    \n\n\n\nFeatures:Observe. Plan. Execute. Adapt – expansive environments allow the player to choose how they complete the mission, offering non linear multi-routes, and more verticality than ever before, offering the freedom to take out the enemy by your own design. Relocation – A sniper always needs an exit strategy. Search the varied environments to create and discover opportunities that suit your play-style: sniper nests, ambush locations, alternative approaches, sound masking and trap setup. Prioritise your targets to maximise your advantage and use shadows and darkness to remain unseen by the Afrika Korps, or relocate to keep your prey guessing. Environment - The North African battlefields of WWII provide great visual variation, significantly different from any other sniping title before it, allowing for much longer ranged shots. Play amongst mountain ranges and huge flat plains; bustling townships and cities, and remote village settlements. Improved Afrika Korps AI – Clear cues for engagement and detection and a rebuilt AI system emphasizing squad roles and tactics make the Afrika Korps smarter and more challenging, while allowing the player more meaningful choices. Backed by a variety of vehicles from Jeeps to Panzer Tanks, the Afrika Korps are a force to be reckoned with... Weapon &amp; Character Customisation – Gain XP and sniper ranks from both single and multiplayer progression to unlock over 40 new and unique customisation parts and build the ultimate rifle that best suits your mission and play-style. Customise individual load-outs and store them for both multiplayer and single-player engagements. Improved Human Kill-Cam – now shows even greater detail including the human circulatory system and complete muscle layer. New Vehicle Kill-Cam – Extended to mechanical equipment such as armoured cars and tanks, multi- stage destruction allows you to create your own opportunity on a vehicle, before delivering the killing shot; shoot into tanks via the driver view-port; see the crew taken out inside. Multiplayer – Building on the multiplayer pedigree of previous titles, SE3 is packed with content for both co-operative and competitive players. 5 modes of competitive action with support for team or lone wolf play including Distance King and No Cross with a selection of maps at launch. Larger and more open environments allow for greater freedom of movement and longer distances for the more skilled Sniper. Earn your Medals and Ribbons to become the Ultimate Sniper! Co-Op – The return of your favourite modes sees Co-operative players able to choose from Overwatch missions and the new Survival Missions. In Overwatch players take the distinct roles of the Sniper and the Operative and must choose their play-style working closely as a team to accomplish their mission. For Survival gameplay you take on the endurance challenge against everything the German Afrika Korps can throw against you! Cover – A greater range of movement and agility means Snipers can quickly navigate the environment and keep one step ahead of their prey. Improved Combat – Better feedback is given to the player so they can decide how best to deal with both long-range and short-range combat. Improved stealth melee combat gives additional ways to take out your enemy without being seen.\n\n\n\n\n\n', 999, 'https://media.gamestop.com/i/gamestop/10113789/Sniper-Elite-III---Xbox-360?$pdp2x$,https://media.gamestop.com/i/gamestop/10113788_10113789_10113791_10113792_SCR13/Sniper-Elite-III---Xbox-360?$screen2x$,https://media.gamestop.com/i/gamestop/10113788_10113789_10113791_10113792_SCR12/Sniper-Elite-III---Xbox-360?$screen2x$,https://media.gamestop.com/i/gamestop/10113788_10113789_10113791_10113792_SCR11/Sniper-Elite-III---Xbox-360?$screen2x$,https://media.gamestop.com/i/gamestop/10113788_10113789_10113791_10113792_SCR10/Sniper-Elite-III---Xbox-360?$screen2x$,https://media.gamestop.com/i/gamestop/10113788_10113789_10113791_10113792_SCR09/Sniper-Elite-III---Xbox-360?$screen2x$,https://media.gamestop.com/i/gamestop/10113788_10113789_10113791_10113792_SCR08/Sniper-Elite-III---Xbox-360?$screen2x$,https://media.gamestop.com/i/gamestop/10113788_10113789_10113791_10113792_SCR07/Sniper-Elite-III---Xbox-360?$screen2x$,https://media.gamestop.com/i/gamestop/10113788_10113789_10113791_10113792_SCR06/Sniper-Elite-III---Xbox-360?$screen2x$,https://media.gamestop.com/i/gamestop/10113788_10113789_10113791_10113792_SCR05/Sniper-Elite-III---Xbox-360?$screen2x$,https://media.gamestop.com/i/gamestop/10113788_10113789_10113791_10113792_SCR04/Sniper-Elite-III---Xbox-360?$screen2x$,https://media.gamestop.com/i/gamestop/10113788_10113789_10113791_10113792_SCR03/Sniper-Elite-III---Xbox-360?$screen2x$,https://media.gamestop.com/i/gamestop/10113788_10113789_10113791_10113792_SCR02/Sniper-Elite-III---Xbox-360?$screen2x$,https://media.gamestop.com/i/gamestop/10113788_10113789_10113791_10113792_SCR01/Sniper-Elite-III---Xbox-360?$screen2x$,https://media.gamestop.com/i/gamestop/10113788_10113789_10113791_10113792_SCR13/Sniper-Elite-III---Xbox-360?$screen$,https://media.gamestop.com/i/gamestop/10113788_10113789_10113791_10113792_SCR12/Sniper-Elite-III---Xbox-360?$screen$,https://media.gamestop.com/i/gamestop/10113788_10113789_10113791_10113792_SCR11/Sniper-Elite-III---Xbox-360?$screen$,https://media.gamestop.com/i/gamestop/10113788_10113789_10113791_10113792_SCR10/Sniper-Elite-III---Xbox-360?$screen$,https://media.gamestop.com/i/gamestop/10113788_10113789_10113791_10113792_SCR09/Sniper-Elite-III---Xbox-360?$screen$,https://media.gamestop.com/i/gamestop/10113788_10113789_10113791_10113792_SCR08/Sniper-Elite-III---Xbox-360?$screen$,https://media.gamestop.com/i/gamestop/10113788_10113789_10113791_10113792_SCR07/Sniper-Elite-III---Xbox-360?$screen$,https://media.gamestop.com/i/gamestop/10113788_10113789_10113791_10113792_SCR06/Sniper-Elite-III---Xbox-360?$screen$,https://media.gamestop.com/i/gamestop/10113788_10113789_10113791_10113792_SCR05/Sniper-Elite-III---Xbox-360?$screen$,https://media.gamestop.com/i/gamestop/10113788_10113789_10113791_10113792_SCR04/Sniper-Elite-III---Xbox-360?$screen$,https://media.gamestop.com/i/gamestop/10113788_10113789_10113791_10113792_SCR03/Sniper-Elite-III---Xbox-360?$screen$,https://media.gamestop.com/i/gamestop/10113788_10113789_10113791_10113792_SCR02/Sniper-Elite-III---Xbox-360?$screen$,https://media.gamestop.com/i/gamestop/10113788_10113789_10113791_10113792_SCR01/Sniper-Elite-III---Xbox-360?$screen$', 68, 17),
	(152, 'Tokyo Xtreme Racer - Sega Dreamcast', '\n\n        Throw down against road rivals in Point Battle Mode, customize your import dream ride in Quest Mode, or choose Versus Mode to go head-to-head at a blistering 60 frames-per-second in Tokyo Highway Challenge.\n    \n\n\n\n Pre-owned Guarantee This pre-owned product has been carefully tested, and is guaranteed to work.  If you are not completely satisfied, simply return the product within 7 days for your money back.  Product may not include original box and instruction manual.  Item pictured may not be exact item received.  \n\n\n\n\n\n', 999, 'https://media.gamestop.com/i/gamestop/10122595/Tokyo-Xtreme-Racer---Sega-Dreamcast?$pdp2x$,', 69, 10),
	(153, 'Call of Duty: Black Ops II Viper Personalization Pack', '\n\n        Inspired by the camouflaged scales of a deadly snake, the Call of Duty?: Black Ops 2 Viper MP Personalization Pack comes loaded with a snakeskin-themed weapon skin, three uniquely-shaped reticles, and an all-new themed Calling Card by which your enemies can remember you. (NOTICE: Reticles will only be available for ACOG, EOTECH and Red Dot scopes.)\n    \n\n\n', 199, 'https://media.gamestop.com/i/gamestop/10109136/Call-of-Duty-Black-Ops-II-Viper-Personalization-Pack?$pdp2x$,', 20, 21),
	(154, 'Bakugan: Champions of Vestroia Deluxe Edition - Nintendo Switch', '\n\n        Bakugan: Champions of Vestroia is an all-new action role-playing game with an original story that expands on the hit TV series and brings the Bakugan universe to the Nintendo Switch for the very first time. The adventure takes players on the ultimate Bakugan journey as they befriend powerful creatures known as Bakugan, gear up and customize Bakugan teams for fiercely strategic battles, and master their skills to become the Champion of Vestroia. Players can also play online in head-to-head multiplayer. Only on Nintendo Switch.\n    \n\nDeluxe edition includes: \n\nBakugan?: Champions of Vestroia ? Videogame\nExclusive Ultima Dragonoid? transforming Bakugan?  Toy\nExclusive Ultima Dragonoid? trading card\nExclusive Ultima Dragonoid? metal gate card\nTwo powerful BakuCores?\n\n\nMaster Your Bakugan Fighting Skills: Become Bakugan Brawling heroes through the game’s highly competitive and deep Action Battle System as players build their best Bakugan teams. Players can collect Bakugan by befriending them while exploring and completing quests. Level them up by battling in Bakugan Brawls and watch them grow more powerful as they evolve.\nBuild the Perfect Team: Assemble three of your strongest Bakugan, each with their own customizable abilities, and equip Baku-Gear to form the ultimate team synergy. Bakugan also come in various Factions, which determines their strengths and weaknesses, adding another layer of depth and strategy to the brawl. \nVaried Environments to Explore: Fully explorable 3D world divided into different districts each with dedicated battle environments. Players can interact with other characters, go on quests, and explore with their Bakugan team through locations such as a sunny waterfront, bustling downtown or a factory riddled with nefarious enemies.\nTake on the World: Test your skills against the world in head-to-head Online Multiplayer Brawls using the Bakugan teams you have trained on your adventure. \n\n\n\n\n', 4999, 'https://media.gamestop.com/i/gamestop/11103848/Bakugan-Champions-of-Vestroia-Deluxe-Edition---Nintendo-Switch?$pdp2x$,https://media.gamestop.com/i/gamestop/11103848_ALT01/Bakugan-Champions-of-Vestroia-Deluxe-Edition---Nintendo-Switch?$pdp2x$,https://media.gamestop.com/i/gamestop/11103996_11103848_SCR03/Bakugan-Champions-of-Vestroia-Deluxe-Edition---Nintendo-Switch?$screen2x$,https://media.gamestop.com/i/gamestop/11103996_11103848_SCR02/Bakugan-Champions-of-Vestroia-Deluxe-Edition---Nintendo-Switch?$screen2x$,https://media.gamestop.com/i/gamestop/11103996_11103848_SCR01/Bakugan-Champions-of-Vestroia-Deluxe-Edition---Nintendo-Switch?$screen2x$,https://media.gamestop.com/i/gamestop/11103996_11103848_SCR03/Bakugan-Champions-of-Vestroia-Deluxe-Edition---Nintendo-Switch?$screen$,https://media.gamestop.com/i/gamestop/11103996_11103848_SCR02/Bakugan-Champions-of-Vestroia-Deluxe-Edition---Nintendo-Switch?$screen$,https://media.gamestop.com/i/gamestop/11103996_11103848_SCR01/Bakugan-Champions-of-Vestroia-Deluxe-Edition---Nintendo-Switch?$screen$', 70, 25),
	(155, 'DC Comics Batgirl Girls Costume', '\n\n        Holy smokes, Batgirl! Who needs Batman when the crime fighting Batgirl is there to save the day? Our Halloween Girl\'s Batgirl Costume is all your daughter needs to fight crime in Gotham City! She\'ll be ready to suit up and track villains down with our Batgirl costume. Complete with belt, glovelettes, dress with attached cape, and mask, Barbara Gordon will keep citizens safe for Halloween! Shop for a Girl\'s Batgirl Costume and your little girl will put the Joker and Penguin in Arkham Asylum for good!\n    \n\n        Holy smokes, Batgirl! Who needs Batman when the crime fighting Batgirl is there to save the day? Our Halloween Girl\'s Batgirl Costume is all your daughter needs to fight crime in Gotham City! She\'ll be ready to suit up and track villains down with our Batgirl costume. Complete with belt, glovelettes, dress with attached cape, and mask, Barbara Gordon will keep citizens safe for Halloween! Shop for a Girl\'s Batgirl Costume and your little girl will put the Joker and Penguin in Arkham Asylum for good!\n    \n\n\n', 4999, 'https://media.gamestop.com/i/gamestop/11169391/DC-Comics-Batgirl-Girls-Costume?$pdp2x$,', 67, 55),
	(156, 'Bomberman Land - Nintendo Wii', '\n\n        Adventure, Mini-games, and Multiplayer Action await you!Embark on a fun-filled, theme park adventure as you discover intrigue and a host of addicting mini-games throughout 5 unique Zones. Also included, is the original Bomberman Battle game. Battle up to 4 friends and find out who is king Bomberman.\n    \n\n\n\n50 Mini-games  Extreme sports fan? Try your hand at the Skateboarding mini-gameDo you love Sci-Fi? Try out the Laser Ball mini-game. With 50 unique, addictive mini-games there\'s something here for everyone. Character Customization  Customize and create you very own Bomberman character withFun-filled Adventure  Bomberman Land has broken into pieces, uncover the mysteries and restore Bomberman Land by collecting all the pieces and put Bomberman Land back together again.Multiplayer Action Go head-to-head and battle up to 4 players in either all 50 mini-games or the original Bomberman Game.Original Bomberman Battle Game Included!  The Original Bomberman Battle game is included with all new maps and power up items. Multiplayer Strategy Action doesn\'t get better than this! \n\n\n\n\n\n', 1998, 'https://media.gamestop.com/i/gamestop/10012436/Bomberman-Land---Nintendo-Wii?$pdp2x$,', 65, 45),
	(157, 'Jojo Siwa Rainbow Unicorn Pillow Pet', '\n\n        Because JoJo and her fans are obsessed with unicorns, Pillow Pets presents JoJo Siwa’s Rainbow Unicorn! Just like the real star, this unicorn loves to sing, dance, act, and wear BIG colorful bows! Siwatorz love this super soft, cute, and adorable stuffed unicorn. She’s unique, fun, special. and magical, just like JoJo! Surprise your little one with a unicorn that they will love endlessly as a child, snuggle with as a teen, and end up taking to college. Pillow Pets bring joy, security, comfort and smiles to all ages. Super soft, parent approved, fun and functional, high quality plush designs that last through childhood and beyond.\n    \n\nFeatures:\n\nRAINBOW UNICORN: With her pink bow and rainbow tail and mane, JoJo the unicorn is just as fun as JoJo Siwa, the singer, dancer, YouTube personality, and Nickelodeon star.\nCOMFORTING COMPANION: Pillow Pets presents super soft, cute, & adorable stuffed animals that unfold into fuzzy pillows for sleep. Kids, teens, & adults love these classic & collectible comfy critters.\nCOMFORT: This plush is a pal by day, then unfasten its belly to make a pillow by night! Comfortable travel friend for any child on road trips & airplanes. Also use as boy & girl bedroom decoration.\nBEST BUDDY: Children of all ages will love this original toy for play & as a large pillow for reading, watching television, studying, and sleepy nap time. Youth love to read with this cozy creature.\nSPECS: Official Pillow Pets & Nickelodeon. High-quality washable fabrics. BPA & Phthalates free. Unfastens to 16-in pillow. Machine wash cold & gentle cycle in white pillowcase (tie off open end). Ages 0+.\n\n\n\n\n', 2999, 'https://media.gamestop.com/i/gamestop/11134722/Jojo-Siwa-Rainbow-Unicorn-Pillow-Pet?$pdp2x$,https://media.gamestop.com/i/gamestop/11134722_ALT01/Jojo-Siwa-Rainbow-Unicorn-Pillow-Pet?$pdp2x$,https://media.gamestop.com/i/gamestop/11134722_ALT02/Jojo-Siwa-Rainbow-Unicorn-Pillow-Pet?$pdp2x$,https://media.gamestop.com/i/gamestop/11134722_ALT03/Jojo-Siwa-Rainbow-Unicorn-Pillow-Pet?$pdp2x$,https://media.gamestop.com/i/gamestop/11134722_ALT04/Jojo-Siwa-Rainbow-Unicorn-Pillow-Pet?$pdp2x$,https://media.gamestop.com/i/gamestop/11134722_ALT05/Jojo-Siwa-Rainbow-Unicorn-Pillow-Pet?$pdp2x$,https://media.gamestop.com/i/gamestop/11134722_ALT06/Jojo-Siwa-Rainbow-Unicorn-Pillow-Pet?$pdp2x$,', 71, 56),
	(158, 'This Is The Police - Xbox One', '\n\n        Dive into a deep story of corruption, crime and intrigue. Take the role of gritty Police Chief Jack Boyd, and come face to face with the ugly underbelly of Freeburg, a city spiraling the drain. Will Jack reach his retirement with a nice stack of bills, or will he end up broken ... or worse? Manage your staff, respond to emergencies, and investigate crimes in a city on the brink of chaos. The mafia underworld maneuvers behind the scenes, sinking their claws ever deeper into the city, even as the mayor is ready to exploit every situation to his political advantage. Choose your approach to each situation as it unfolds. Sometimes you\'ll be responding to a developing crisis at a crime scene, or negotiating with Freeburg\'s crime bosses. Sometimes you\'ll find yourself dodging questions in the press room, or even the occasional cross-examination in the witness box. Can you keep this pressure cooker from exploding, at least for long enough to stash away a nice retirement nest egg?\n    \n\n\n\nYour mission is clear: make $500,000 in 180 days, before Jack Boyd reaches retirement. How? That\'s up to you! Decisions, decisions! This Is the Police is all about a dark story and how you react to it. Whatever you decide, your choices will influence the game – and the fate of Jack Boyd. The Good, the Bad, and... the Ugly? The Chief of Freeburg\'s Police Department deals with all kind of people. It is up to you to find the bad guys, and decide how to deal with them. Carry out your duties. As head of Freeburg PD, Jack deals with all sorts of challenges every day: responding to emergencies, managing his officers, defending the department against City Hall and a corrupt mayor, and much more. Solve Investigations and gather evidence against the criminal gangs of Freeburg. Deal with the competing powers of the city. Everyone offers you favors, and each one comes at a price. Rich and fully voiced story: Jack Boyd is portrayed by Jon St. John, the voice of Duke Nukem.\n\n\n\n\n\n', 499, 'https://media.gamestop.com/i/gamestop/10142519/This-Is-The-Police---Xbox-One?$pdp2x$,https://media.gamestop.com/i/gamestop/10142519_10142522_SCR03/This-Is-The-Police---Xbox-One?$screen2x$,https://media.gamestop.com/i/gamestop/10142519_10142522_SCR02/This-Is-The-Police---Xbox-One?$screen2x$,https://media.gamestop.com/i/gamestop/10142519_10142522_SCR01/This-Is-The-Police---Xbox-One?$screen2x$,https://media.gamestop.com/i/gamestop/10142519_10142522_SCR03/This-Is-The-Police---Xbox-One?$screen$,https://media.gamestop.com/i/gamestop/10142519_10142522_SCR02/This-Is-The-Police---Xbox-One?$screen$,https://media.gamestop.com/i/gamestop/10142519_10142522_SCR01/This-Is-The-Police---Xbox-One?$screen$', 15, 15),
	(159, 'Hasbro Power Rangers Lightning Collection Dino Fury Red Ranger 6-in Action Figure', '\n\n        This 6-inch Lightning Collection Dino Fury Red Ranger figure features premium paint and decorative details inspired by the show, over 20 points of articulation for high poseability, swappable heads to display the Ranger with or without his helmet, Chromafury Saber, blast effect piece, and an extra pair of hands for more ways to play or display. Go Go Power Rangers!\n    \n\nIT’S MORPHIN TIME! From Dino Fury back to the original Mighty Morphin Power Rangers, the Power Rangers have brought teamwork, action, and adventure to generations of fans. The legacy continues with figures, vehicles, collectibles, and roleplay toys from Hasbro, celebrating ranger teams from Mighty Morphin to Dino Fury. Imagine all the action of Power Rangers with toys from Hasbro! (Power Rangers toys each sold separately. Subject to availability.)\n\n\n\n\n\n6-Inch Scale Collectible Dino Fury Red Ranger Action Figure- This Power Rangers Lightning Collection action figure has premium painted details and design inspired by the Power Rangers Dino Fury series.\nIncludes Character-inspired Accessories- This Dino Fury Red Ranger toy includes multiple character-inspired accessories, and swappable heads, one of the Ranger in his helmet and one without.\nInspired By The Series Power Rangers Dino Fury- Zayto, an alien knight from the planet Rafkon, wakes up after 65 million years in stasis to stop evil forces from destroying Earth.\nPart Of The Power Rangers Lightning Collection- Look for more collectible figures in the Lightning Collection. Each sold separately. Subject to availability.\nFor ages 4 and up\n\n\n\n\n\n\n', 2299, 'https://media.gamestop.com/i/gamestop/11160366/Hasbro-Power-Rangers-Lightning-Collection-Dino-Fury-Red-Ranger-6-in-Action-Figure?$pdp2x$,https://media.gamestop.com/i/gamestop/11160366_ALT01/Hasbro-Power-Rangers-Lightning-Collection-Dino-Fury-Red-Ranger-6-in-Action-Figure?$pdp2x$,https://media.gamestop.com/i/gamestop/11160366_ALT02/Hasbro-Power-Rangers-Lightning-Collection-Dino-Fury-Red-Ranger-6-in-Action-Figure?$pdp2x$,https://media.gamestop.com/i/gamestop/11160366_ALT03/Hasbro-Power-Rangers-Lightning-Collection-Dino-Fury-Red-Ranger-6-in-Action-Figure?$pdp2x$,https://media.gamestop.com/i/gamestop/11160366_ALT04/Hasbro-Power-Rangers-Lightning-Collection-Dino-Fury-Red-Ranger-6-in-Action-Figure?$pdp2x$,https://media.gamestop.com/i/gamestop/11160366_ALT05/Hasbro-Power-Rangers-Lightning-Collection-Dino-Fury-Red-Ranger-6-in-Action-Figure?$pdp2x$,https://media.gamestop.com/i/gamestop/11160366_ALT06/Hasbro-Power-Rangers-Lightning-Collection-Dino-Fury-Red-Ranger-6-in-Action-Figure?$pdp2x$,https://media.gamestop.com/i/gamestop/11160366_ALT07/Hasbro-Power-Rangers-Lightning-Collection-Dino-Fury-Red-Ranger-6-in-Action-Figure?$pdp2x$,https://media.gamestop.com/i/gamestop/11160366_ALT08/Hasbro-Power-Rangers-Lightning-Collection-Dino-Fury-Red-Ranger-6-in-Action-Figure?$pdp2x$,https://media.gamestop.com/i/gamestop/11160366_ALT09/Hasbro-Power-Rangers-Lightning-Collection-Dino-Fury-Red-Ranger-6-in-Action-Figure?$pdp2x$,https://media.gamestop.com/i/gamestop/11160366_ALT10/Hasbro-Power-Rangers-Lightning-Collection-Dino-Fury-Red-Ranger-6-in-Action-Figure?$pdp2x$,https://media.gamestop.com/i/gamestop/11160366_ALT11/Hasbro-Power-Rangers-Lightning-Collection-Dino-Fury-Red-Ranger-6-in-Action-Figure?$pdp2x$,https://media.gamestop.com/i/gamestop/11160366_ALT12/Hasbro-Power-Rangers-Lightning-Collection-Dino-Fury-Red-Ranger-6-in-Action-Figure?$pdp2x$,', 24, 7),
	(160, 'Dragon Ball Xenoverse 2 - PlayStation 4', '\n\n        IT\'S TIME TO GO SUPER SAIYAN!\n    \n\n\n\nDeveloped to fully utilize the power of current generation gaming consoles and PCs, DRAGON  BALL XENOVERSE 2 builds upon the highly popular DRAGON BALL XENOVERSE with  enhanced graphics that will further immerse players into the largest and most detailed Dragon  Ball world ever developed. DRAGON BALL XENOVERSE 2 will deliver a new hub city and the  most character customization choices to date among a multitude of new features and special  upgrades. DRAGON BALL XENOVERSE 2 is scheduled to launch in the Americas in 2016.  Relive the Dragon Ball story by time traveling and protecting historic moments in the Dragon Ball universe  Next-gen visuals bring the Dragon Ball anime experience to life  New characters and boss fights  Brand new hub city more than 7X the size of the original game with 300 players online at the same time  More in depth character creation system and battle adjustments  Post launch support for one year  \n\n\n\n\n\n', 1599, 'https://media.gamestop.com/i/gamestop/10132205/Dragon-Ball-Xenoverse-2---PlayStation-4?$pdp2x$,https://media.gamestop.com/i/gamestop/10132203_10132205_10132295_10132296_10136138_10136224_10142020_SCR17/Dragon-Ball-Xenoverse-2---PlayStation-4?$screen2x$,https://media.gamestop.com/i/gamestop/10132203_10132205_10132295_10132296_10136138_10136224_10142020_SCR16/Dragon-Ball-Xenoverse-2---PlayStation-4?$screen2x$,https://media.gamestop.com/i/gamestop/10132203_10132205_10132295_10132296_10136138_10136224_10142020_SCR15/Dragon-Ball-Xenoverse-2---PlayStation-4?$screen2x$,https://media.gamestop.com/i/gamestop/10132203_10132205_10132295_10132296_10136138_10136224_10142020_SCR14/Dragon-Ball-Xenoverse-2---PlayStation-4?$screen2x$,https://media.gamestop.com/i/gamestop/10132203_10132205_10132295_10132296_10136138_10136224_10142020_SCR13/Dragon-Ball-Xenoverse-2---PlayStation-4?$screen2x$,https://media.gamestop.com/i/gamestop/10132203_101322