	(236, 'You Push All My Buttons T-Shirt', '\n\n        Left, right. Up, down. Show your love for gaming with the You Push All My Buttons T-Shirt.\n    \n\n\n\n\nClassic mid-weight fabric\nClassic Fit\n100% Cotton\nPreshrunk jersey knit\n\n\n\n\n\n\n', 1998, 'https://media.gamestop.com/i/gamestop/11116548/You-Push-All-My-Buttons-T-Shirt?$pdp2x$,', 22, 5),
	(237, 'Borderlands 3 Zero Sketched T-Shirt', '\n\n        Stock up on all of your favorite Borderlands 3 styles and head to the outer reaches of the galaxy with Moze, Amara, FL4K, and Zane. You\'re going to need the best weapons, the best team, and the best video game apparel when you go up against The Children of the Vault and the dangers lurking beyond the galaxy.\n    \n\n\nPrinted in the U.S.A.\nMachine Washable\nPrinted with Water-Based Inks\nFifth Sun\n\n\n\n\n', 1998, 'https://media.gamestop.com/i/gamestop/11116626/Borderlands-3-Zero-Sketched-T-Shirt?$pdp2x$,', 5, 5),
	(238, 'Whatever People Say I Am, That\'s What I Am Not by Arctic Monkeys Vinyl', '\n\n        Whatever People Say I Am, That\'s What I\'m Not by the Arctic Monkeys was released January 23, 2006 by Domino Recording. It was the English rock band’s debut album and received widespread critical acclaim, including ranking in Rolling Stone’s 100 Best Debut Albums of All Time. It won the Mercury Music Prize, received a Grammy nomination for Best Alternative Music Album, and had hits with "I Bet You Look Good on the Dancefloor" and "When the Sun Goes Down."\n    \n\nTRACKLIST:\n\nThe View From the Afternoon\nI Bet You Look Good on the Dancefloor\nFake Tales of San Francisco\nDancing Shoes\nYou Probably Couldn’t See for the Lights but You Were Staring Straight at Me\nStill Take You Home\nRiot Van\nRed Light Indicates Doors Are Secured\nMardy Bum\nPerhaps Vampires Is a Bit Strong But…\nWhen the Sun Goes Down\nFrom the Ritz to the Rubble\nA Certain Romance\n\n\n\n\n', 2299, 'https://media.gamestop.com/i/gamestop/11135704/Whatever-People-Say-I-Am-Thats-What-I-Am-Not-by-Arctic-Monkeys-Vinyl?$pdp2x$,', 97, 40),
