	(241, 'Star Wars: The Mandalorian The Child Cute Pin Set 4 Pack', '\n\n        Fall in love with some of your favorite moments from “The Mandalorian” season two with this four-piece, officially licensed Grogu enamel pin pack. Remember how cute he was in the messenger bag? Or when he was “playing with his food”? Maybe he wasn’t as cute when he started a giant spider attack, but we did get to see just how powerful his Force capabilities are… and for such a young Child! This darling Mandalorian Child pin pack comes in a window box, ideal for displaying.\n    \n\nMaterials: Basemetal/Enamel\nCare: Damp Cloth and Soap Clean\n\n\n\n', 1698, 'https://media.gamestop.com/i/gamestop/11112229/Star-Wars-The-Mandalorian-The-Child-Cute-Pin-Set-4-Pack?$pdp2x$,https://media.gamestop.com/i/gamestop/11112229_ALT01/Star-Wars-The-Mandalorian-The-Child-Cute-Pin-Set-4-Pack?$pdp2x$,https://media.gamestop.com/i/gamestop/11112229_ALT02/Star-Wars-The-Mandalorian-The-Child-Cute-Pin-Set-4-Pack?$pdp2x$,', 99, 72),
	(242, 'TheNorthwest Star Wars: The Mandalorian Moon Child Silk Throw Blanket 60x80', '\n\n        Keep warm as you snuggle up with an Oversized Silk Touch Throw Blanket by TheNorthwest. This throw is vividly designed with your favorite entertainment characters on a fun background. This large 60"x 80" silky-soft blanket with decorative binding around all edges will become your new favorite to use on the couch or in the bedroom. 100% Polyester.\n    \n\n        Keep warm as you snuggle up with an Oversized Silk Touch Throw Blanket by TheNorthwest. This throw is vividly designed with your favorite entertainment characters on a fun background. This large 60"x 80" silky-soft blanket with decorative binding around all edges will become your new favorite to use on the couch or in the bedroom. 100% Polyester.\n    \n\n\n', 5999, 'https://media.gamestop.com/i/gamestop/11166739/TheNorthwest-Star-Wars-The-Mandalorian-Moon-Child-Silk-Throw-Blanket-60x80?$pdp2x$,', 56, 47),
