	(247, 'Desert Bronze Console Skin for Xbox One', '\n\n        The Textures Xbox One Console Skin is made from a 3M durable auto-grade vinyl for an ultimate lightweight Xbox One Console decal protection without the bulk. Every Skinit Textures skin is officially licensed by Metallic Material for an authentic brand design. The Textures Desert Bronze Chameleon Microsoft Xbox One Console decal skin is engineered to feature vibrant photo quality designs and to perfectly fit your Xbox One Console The Textures Desert Bronze Chameleon skin can be easily applied and removed from your Xbox One Console with no residue, no mess and no fuss due to 3M adhesive backing. This makes it even easier for you to mix up your Xbox One Console style as much as you want to keep your device feeling new. All Skinit made decal skins are cut and crafted with everyday Xbox One Console uses in mind so that each Textures skin offers a premium feel with a thin functional protection. Shop all officially licensed Textures Microsoft Xbox One Console skins made by Skinit and make it yours today!\n    \n\nUltra-Thin, Lightweight Xbox One Console Vinyl Decal ProtectionOffically Licensed Metallic Material DesignIndustry Leading Vivid Color Vinyl Print TechnologyScratch - Resistant. Built To Last Everday Xbox One Console Use3M Adhesive Backing - Easy On, Easy Off & Residue-Free\n\n\n\n', 2499, 'https://media.gamestop.com/i/gamestop/11128546/Desert-Bronze-Console-Skin-for-Xbox-One?$pdp2x$,', 8, 15),
	(248, 'Car Adapter for PlayStation Vita (Assortment)', '\n\n        One of the best features of Sony\'s handheld PS Vita is its ability to travel. Limited by the onboard battery life, any PS Vita owner will benefit from this car adapter. The adapter comes with the charger and charging cable. Plug it into any standard 12V auxiliary outlet to keep your Vita running during long road trips. Don\'t limit how long you can immerse yourself in the Vita\'s library of hit titles!\n    \n\n\n', 499, 'https://media.gamestop.com/i/gamestop/10121313/Car-Adapter-for-PlayStation-Vita-Assortment?$pdp2x$,', 26, 36),
	(249, 'Ghostrunner  - PlayStation 5', '\n\n        Ghostrunner on PS5 is a first-person action SLASHER game with slick parkour-inspired gameplay elements. Players assume the role of an android ninja and use a combination of abilities and melee katana combat to slice foes as they ascend treacherous neon cyberpunk skyscrapers of the future. Players have a wide ranger of movement abilities, including wall running, sliding, and time manipulation to eliminate all targets in their way. The result is an extremely agile character providing players ultimate satisfaction with each potent swing of a katana (a superhuman blade fighter).\n    \n\nDeath is inevitable. Players have one hit point and must use their kill mechanics and dynamic mobility to overcome challenging foes without a scratch. They must fight their way to the top of the structure to ?bring down the tyrannical Keymaster and avert humanity’s extinction.\nFeatures:\n\nUNUSUAL PERSPECTIVE: Ghostrunner is a unique and challenging game, with half-open and primarily vertical levels. Vertical design also contains elements of exploration and learning through environmental storytelling about the player character’s background, rationale, and overall game world.\nONE HIT, ONE KILL: One-Hit-One-Kill system is, for sure, one of the most important features alongside the movements mechanics.\nThe player and opponents have one hit point. Through instant restart, the player gets to know game level layouts and eliminates enemies using extraordinary mobility and sensory boost (slow-motion ability).\nPARKOUR MOVEMENT MECHANICS: Ghostrunner’s movement system is very dynamic featuring abilities which let the player run on walls, slide and slice foes, dashing with gusto, time manipulation, leaping and bounding off neon-lit walls, and so much more.\nCYBERPUNK SETTING: The game takes place in the future, after a global cataclysm where the remains of humanity live in an ominous neon tower built by The Architect, who died mysteriously years ago. Everyone knows the truth, no one says it aloud.?\n	?\n\n\n\n\n', 2548, 'https://media.gamestop.com/i/gamestop/11147672/Ghostrunner----PlayStation-5?$pdp2x$,', 68, 8),
