	(252, 'Skinit Wonder Woman Comic Blast Console Skin for Xbox Series X', '\n\n        The DC Comics Wonder Woman Xbox Series X Console Skin is made from a 3M durable auto-grade vinyl for an ultimate lightweight Xbox Series X Console decal protection without the bulk. Every Skinit Wonder Woman skin is officially licensed by Warner Bros for an authentic brand design. The Wonder Woman Wonder Woman Comic Blast Microsoft Xbox Series X Console decal skin is engineered to feature vibrant photo quality designs and to perfectly fit your Xbox Series X Console The Wonder Woman Wonder Woman Comic Blast skin can be easily applied and removed from your Xbox Series X Console with no residue, no mess and no fuss due to 3M adhesive backing. This makes it even easier for you to mix up your Xbox Series X Console style as much as you want to keep your device feeling new. All Skinit made decal skins are cut and crafted with everyday Xbox Series X Console uses in mind so that each Wonder Woman skin offers a premium feel with a thin functional protection. Shop all officially licensed DC Comics Wonder Woman Microsoft Xbox Series X Console skins made by Skinit and make it yours today!\n    \n\nUltra-Thin, Lightweight Xbox Series X Console Vinyl Decal ProtectionOffically Licensed Warner Bros DesignIndustry Leading Vivid Color Vinyl Print TechnologyScratch - Resistant. Built To Last Everday Xbox Series X Console Use3M Adhesive Backing - Easy On, Easy Off & Residue-Free\n\n\n\n', 2499, 'https://media.gamestop.com/i/gamestop/11129177/Skinit-Wonder-Woman-Comic-Blast-Console-Skin-for-Xbox-Series-X?$pdp2x$,https://media.gamestop.com/i/gamestop/11129177_ALT01/Skinit-Wonder-Woman-Comic-Blast-Console-Skin-for-Xbox-Series-X?$pdp2x$,https://media.gamestop.com/i/gamestop/11129177_ALT02/Skinit-Wonder-Woman-Comic-Blast-Console-Skin-for-Xbox-Series-X?$pdp2x$,https://media.gamestop.com/i/gamestop/11129177_ALT03/Skinit-Wonder-Woman-Comic-Blast-Console-Skin-for-Xbox-Series-X?$pdp2x$,', 8, 12),
	(253, 'VNCI-217 Briefcase', '\n\n        This laptop case is the epitome of “just right.” Just the right size, just the right organization and just the right features. A protective laptop compartment and organization for your commuting essentials allow you to arrive at your desk or morning meeting feeling perfectly prepared for anything.\n    \n\nFEATURES:\n\nTailored case compatible with most laptops with a 17.3" screen\nPadded laptop compartment walls provide extra protection\nSlip pocket keeps documents separated from other items in your bag\nFront pocket panel provides basic organization for small daily accessories\nFront pocket features a wide base for bulky items like a power brick\nClamshell design allows the case to open completely for full access to your laptop\nAdjustable strap secures laptop in padded compartment\nCarry comfortably with neoprene-lined, padded handles and a removable strap with anti-slip shoulder pad\n SPECIFICATIONS:\n\nStyle: Briefcase\nAccessibility: Clamshell\nMaximum Screen Size Supported: 17.3\nColor: Black\nApplication/Usage: Notebook\nSize: 18.5 x 3.5 x 15.75 in\nFits devices: 16.4 x 1.7 x 11.8 in\nWeight: 1.41 lb\nMaterials: Polyester\nWarranty: 25 years\n\n\n\n\n', 2895, 'https://media.gamestop.com/i/gamestop/10102196/VNCI-217-Briefcase?$pdp2x$,', 101, 73),
	(254, 'FuRyu Laid-Back Camp Chobirume Season 2 Chiaki Ohgaki 2.7-In Figure', '\n\n        Chiaki Ohgaki is a character from the Laid Back Camp series. Chiaki is a student at Motosu High School and is a part of the Outdoor Activities Club. Chiaki is a bright, friendly, and playful girl. Always bursting with high energy, she is sometimes mischievous and likes to pull pranks on the other club members.\n    \n\n\n\nChiaki Ohgaki from Laid-Back Camp\nChibi-style\n Figure stands approximately 2.7-inches tall\n\n\n\n\n\n', 2899, 'https://media.gamestop.com/i/gamestop/11155528/FuRyu-Laid-Back-Camp-Chobirume-Season-2-Chiaki-Ohgaki-2.7-In-Figure?$pdp2x$,https://media.gamestop.com/i/gamestop/11155528_ALT01/FuRyu-Laid-Back-Camp-Chobirume-Season-2-Chiaki-Ohgaki-2.7-In-Figure?$pdp2x$,https://media.gamestop.com/i/gamestop/11155528_ALT02/FuRyu-Laid-Back-Camp-Chobirume-Season-2-Chiaki-Ohgaki-2.7-In-Figure?$pdp2x$,https://media.gamestop.com/i/gamestop/11155528_ALT03/FuRyu-Laid-Back-Camp-Chobirume-Season-2-Chiaki-Ohgaki-2.7-In-Figure?$pdp2x$,https://media.gamestop.com/i/gamestop/11155528_ALT04/FuRyu-Laid-Back-Camp-Chobirume-Season-2-Chiaki-Ohgaki-2.7-In-Figure?$pdp2x$,https://media.gamestop.com/i/gamestop/11155528_ALT05/FuRyu-Laid-Back-Camp-Chobirume-Season-2-Chiaki-Ohgaki-2.7-In-Figure?$pdp2x$,https://media.gamestop.com/i/gamestop/11155528_ALT06/FuRyu-Laid-Back-Camp-Chobirume-Season-2-Chiaki-Ohgaki-2.7-In-Figure?$pdp2x$,https://media.gamestop.com/i/gamestop/11155528_ALT07/FuRyu-Laid-Back-Camp-Chobirume-Season-2-Chiaki-Ohgaki-2.7-In-Figure?$pdp2x$,', 102, 7),
	(255, 'Fire Emblem: Shadow Dragon - Nintendo DS', '\n\n        Fire Emblem: Shadow Dragon is a turn-based strategy game with a fantasy setting. Players alternate turns with opponents, moving their pieces (units) and attacking enemy units on the battlefield. There are dozens of units and different weapons and magic spells, each with its own strategic benefits-high-flying Pegasus knights move effortlessly over varied terrain, fast-moving mounted cavaliers can use swords and lances, unarmed curates use healing staves to mend the wounds of other units and so on.\n    \n\n\n\nMany groups play a part in a story but undoubtedly the story\'s protagonist, Prince Marth, will be the focus for most. Marth has been featured in the Super Smash Bros. series and has been extremely popular within those games, but this is his first time starring in a Fire Emblem game in the United States. At Marth\'s side is a support of fearless fighters, including the brave Caeda, a princess of the Talys kingdom. Other major characters include the evil sorcerer Gharnef and the sole surviving descendant of the royal House Archanea, Princess Nyna. Fire Emblem returns to its roots with a total overhaul of an NES classic never before released in America. New features include touch-screen controls, multiple save options and easy-to-follow tutorial chapters that shed new light on Marth\'s story. New players can jump into the action, even if they\'ve never played a Fire Emblem game before. Take the battle online and clash with players around the world over Nintendo Wi-Fi Connection. You can also borrow units to use in your army, talk with friends using the built-in Nintendo DS microphone and even buy rare and powerful items from the Online Shop using in-game currency. You are the general: Shape your army to suit your strategy by selecting from dozens of characters with unique spells and abilities. But guide your army wisely, because if a character falls on the battlefield, he\'s lost forever. Fire Emblem: Shadow Dragon is the first to offer players a chance to test their skills against other players in combat. Using your broadband connection, Nintendo Wi-Fi Connection and wireless play modes, players are able to send units they\'ve trained into battle against those of another player. Collect optional cards to give your team a unique tactical bonus that can help you clench victory. During Nintendo Wi-Fi Connection matches, friends can talk to each other using the built-in Nintendo DS microphone. Touch-screen controls, multiple save options and an easy-to-follow tutorial allow novice players to jump into the action, even if they\'ve never played a Fire Emblem game before. Borrow units wirelessly or through Nintendo Wi-Fi Connection and use them in your own battles with the Loan Unit feature. Six levels of difficulty ensure that even seasoned players can find a challenge in this new entry into the Fire Emblem series. Purchase rare and powerful items using the gold you\'ve acquired during your single-player campaign with the Online Shop feature. You never know what items you might come across, because new items rotate in and out of the armory on a daily basis. Play through the events that brought Marth to the beginning of his quest through a new set of prologue chapters that were specially added to the game for its Nintendo DS release. \n\n\n\n\n\n', 3999, 'https://media.gamestop.com/i/gamestop/10073025/Fire-Emblem-Shadow-Dragon---Nintendo-DS?$pdp2x$,', 27, 22),
	(256, 'Types of Deer Buck Word Art Mens Tank Top', '\n\nCreated using Popular types of DeerCreated using Popular types of Deer - This amazing work of word art recreates a deer out of the most popular types of deer.\n\n\nMATERIAL - 100% CottonPRINTED WITH PRIDE IN THE USA- All of our products are printed and shipped from Las Vegas, Nevada USA.\n\n\n\n', 2249, 'https://media.gamestop.com/i/gamestop/11140073_gray/Types-of-Deer-Buck-Word-Art-Mens-Tank-Top-gray?$pdp2x$,', 2, 5),
	(257, 'Honu Turtle Hawaiian Islands Word Art Womens Premium Blend T-Shirt', '\n\nPage Title Created using The Hawaiian Island Names  There are three species of sea turtles native to the Hawaiian Islands: the Green, the Hawksbill, and the Leatherback. These fascinating creatures have played important roles in the environment and culture of Hawaii\'s people. Of the three native sea turtles, the Green Turtle also called Honu is the most popular and has become a symbol of the enchantment of the Hawaiian Islands. Our Honu Turtle is created using the names of all the Hawaiian Islands.  \n\n\nMATERIAL - 50% Cotton/50% PolyesterPRINTED WITH PRIDE IN THE USA - All of our products are printed and shipped from Las Vegas, Nevada USA.\n\n\n\n', 2899, 'https://media.gamestop.com/i/gamestop/11143293/Honu-Turtle-Hawaiian-Islands-Word-Art-Womens-Premium-Blend-T-Shirt?$pdp2x$,https://media.gamestop.com/i/gamestop/11143293_ALT01/Honu-Turtle-Hawaiian-Islands-Word-Art-Womens-Premium-Blend-T-Shirt?$pdp2x$,', 2, 5),
	(258, 'Skinit White Carbon Fiber Controller Skin for Xbox One', '\n\n        The Textures Xbox One Controller Skin is made from a 3M durable auto-grade vinyl for an ultimate lightweight Xbox One Controller decal protection without the bulk. Every Skinit Textures skin is officially licensed by Metallic Material for an authentic brand design. The Textures White Carbon Fiber Microsoft Xbox One Controller decal skin is engineered to feature vibrant photo quality designs and to perfectly fit your Xbox One Controller The Textures White Carbon Fiber skin can be easily applied and removed from your Xbox One Controller with no residue, no mess and no fuss due to 3M adhesive backing. This makes it even easier for you to mix up your Xbox One Controller style as much as you want to keep your device feeling new. All Skinit made decal skins are cut and crafted with everyday Xbox One Controller uses in mind so that each Textures skin offers a premium feel with a thin functional protection. Shop all officially licensed Textures Microsoft Xbox One Controller skins made by Skinit and make it yours today!\n    \n\nUltra-Thin, Lightweight Xbox One Controller Vinyl Decal ProtectionOffically Licensed Metallic Material DesignIndustry Leading Vivid Color Vinyl Print TechnologyScratch - Resistant. Built To Last Everday Xbox One Controller Use3M Adhesive Backing - Easy On, Easy Off & Residue-Free\n\n\n\n', 1599, 'https://media.gamestop.com/i/gamestop/11129167/Skinit-White-Carbon-Fiber-Controller-Skin-for-Xbox-One?$pdp2x$,https://media.gamestop.com/i/gamestop/11129167_ALT01/Skinit-White-Carbon-Fiber-Controller-Skin-for-Xbox-One?$pdp2x$,https://media.gamestop.com/i/gamestop/11129167_ALT02/Skinit-White-Carbon-Fiber-Controller-Skin-for-Xbox-One?$pdp2x$,https://media.gamestop.com/i/gamestop/11129167_ALT03/Skinit-White-Carbon-Fiber-Controller-Skin-for-Xbox-One?$pdp2x$,', 8, 15),
	(259, 'Monster Power Strip Surge Protector 8 Outlets with USB and USB-C Ports', '\n\nPlug multiple devices without worries with the Monster Power Strip Surge Protector. Our heavy-duty power strip can accommodate up to 8 plug-ins, 1 USB-C and 1 USB-A port. Keep your electronics safe from dangerous power surges with Monster\'s Fireproof MOV? Technology that protects more than just your electronics, but also your family. Use at home or in offices with sensitive and expensive equipment, including computers, TVs, entertainment systems, servers, etc. Monster Surge Protectors provide reliable safety when you need it.\n\n\nFEATURES:\n\nMULTIPLE OUTLETS: Our power strip surge protector can provide protection for up to 8 plug-ins, 1 USB-C and 1 USB-A port with up to 4,050 joule energy rating\nULTIMATE PROTECTION: Safeguards your electronics and office equipment from permanent damage due to power surges caused by storms or outages; our power strip surge protector can also prolong the life of your gadgets\nFIREPROOF MOV TECHNOLOGY: Monster Power Strip Surge Protectors feature MOV (Metal Oxide Varistor) technology which prevents electrical fires that can cause irreparable damage to your items and home\nCHARGE MOBILE DEVICES: Featuring USB charging, this surge protector safeguards not only your AV equipment, but powers and protects mobile devices, like a smartphone or tablet\nLIGHT INDICATOR: This heavy-duty surge protector power strip has a built-in LED light that indicates when your devices are protected and when your wiring is properly grounded\n\n\n\n\n', 5299, 'https://media.gamestop.com/i/gamestop/11155668/Monster-Power-Strip-Surge-Protector-8-Outlets-with-USB-and-USB-C-Ports?$pdp2x$,https://media.gamestop.com/i/gamestop/11155668_ALT01/Monster-Power-Strip-Surge-Protector-8-Outlets-with-USB-and-USB-C-Ports?$pdp2x$,https://media.gamestop.com/i/gamestop/11155668_ALT02/Monster-Power-Strip-Surge-Protector-8-Outlets-with-USB-and-USB-C-Ports?$pdp2x$,https://media.gamestop.com/i/gamestop/11155668_ALT03/Monster-Power-Strip-Surge-Protector-8-Outlets-with-USB-and-USB-C-Ports?$pdp2x$,https://media.gamestop.com/i/gamestop/11155668_ALT04/Monster-Power-Strip-Surge-Protector-8-Outlets-with-USB-and-USB-C-Ports?$pdp2x$,https://media.gamestop.com/i/gamestop/11155668_ALT05/Monster-Power-Strip-Surge-Protector-8-Outlets-with-USB-and-USB-C-Ports?$pdp2x$,https://media.gamestop.com/i/gamestop/11155668_ALT06/Monster-Power-Strip-Surge-Protector-8-Outlets-with-USB-and-USB-C-Ports?$pdp2x$,', 103, 74),
	(260, 'Blood Bowl 2 - PlayStation 4', '\n\n        TOUCHDOWN!Blood Bowl 2 smashes Warhammer and American football together, in an explosive cocktail of turn-based strategy, humour and brutality, adapted from Games Workshop\'s famous boardgame.\n    \n\n\n\nBlood Bowl 2\'s new graphics engine and high-flying realization makes for a faithful portrayal of the fury and intensity of classic Blood Bowl matches. The solo game mode will have you lead the famous Reikland Reavers. Former star team of Blood Bowl you are tasked with bringing them back to glory, following a full story campaign supported by the hilarious commentators Jim & Bob from Cabalvision. Each match of the campaign is unique, with unexpected and surprising events constantly renewing the experience!The multiplayer modes are bigger and richer than ever. In the persistent online mode, create and manage your own team comprised of one of eight races from the Warhammer world – Humans, Orcs, Dwarfs, Skaven, High Elves, Dark Elves, Chaos, and the Bretonnia newcomers. You will develop your team, gaining XP and unlocking new skills. But beware! On the pitch, all losses are permanent... Organize entirely customisable championships, from qualifications to finale, and use the new Transfer Market to buy and sell your players, and build your Blood Bowl dream-team!The next generation of Blood Bowl touches down today, will YOU be the champion? \n\n\n\n\n\n', 999, 'https://media.gamestop.com/i/gamestop/10122882/Blood-Bowl-2---PlayStation-4?$pdp2x$,', 104, 26),
	(261, 'NieR: Automata Game of the Yorha Edition', '\n\n        NieR: Automata tells the story of androids 2B, 9S and A2 and their battle to reclaim the machine-driven dystopia overrun by powerful machines.Humanity has been driven from the Earth by mechanical beings from another world. In a final effort to take back the planet, the human resistance sends a force of android soldiers to destroy the invaders. Now, a war between machines and androids rages on... A war that could soon unveil a long-forgotten truth of the world.\n    \n\n\n\nThe NieR:Automata Game of the YoRHa Edition includes the game itself and comes packed with DLC and bonus content for the full experience of the award-winning post-apocalyptic action RPG, including: Valve Character Accessory, Cardboard Pod Skin, Retro Grey Pod Skin, Retro Red Pod Skin, Grimoire Weiss Pod, Machine Mask Accessory, Exclusive set of wallpapers, and 3C3C1D119440927 DLC*.  *To enjoy this content, you will need to have progressed a certain way into the main story of the game. There are also some scenes during the progression of the main game scenario in which this content cannot be accessed.Action-Packed Battles – Players will switch between using melee and ranged attacks in battle against hordes of enemies and challenging bosses across a variety of open field maps. The tight controls and incredibly fluid combat are simple to learn for newcomers while offering plenty of depth for more experienced action gamers. Players can perform high-speed battle actions—combining light and heavy attacks—and switch through an arsenal of weaponry while evading enemies with speed and style. Beautifully Desolate Open-World – The game seamlessly joins together hauntingly beautiful vistas and locations with no area loading. The environments are rendered in 60fps and contain a wealth of sub-events in addition to the main storyline. Masterfully Crafted Story and Characters – NieR:Automata tells the story of androids 2B, 9S and A2 and their ferocious battle to reclaim a machine-driven dystopia overrun by powerful weapons known as machine lifeforms.Elements of an RPG – Players will obtain a variety of weapon types, level up in battle, learn new combat skills, and customise a loadout that caters to their playstyle.Utilise the Pod Support System to Assist In and Outside of Battle – Pods can attack the enemy in both manual and lock-on modes. They can also assist outside of battle, such as allowing the player to glide through the air. Pods can be enhanced throughout the game, with upgrades including new attack methods and variations.“Auto Mode” Available for Beginners – Novice players can elect “Auto Mode” for easy attacks and evasions.\n\n\n\n\n\n', 3999, 'https://media.gamestop.com/i/gamestop/10171355/NieR-Automata-Game-of-the-Yorha-Edition?$pdp2x$,https://media.gamestop.com/i/gamestop/10136578_10143556_10167176_10171354_10171355_SCR20/NieR-Automata-Game-of-the-Yorha-Edition?$screen2x$,https://media.gamestop.com/i/gamestop/10136578_10143556_10167176_10171354_10171355_SCR19/NieR-Automata-Game-of-the-Yorha-Edition?$screen2x$,https://media.gamestop.com/i/gamestop/10136578_10143556_10167176_10171354_10171355_SCR18/NieR-Automata-Game-of-the-Yorha-Edition?$screen2x$,https://media.gamestop.com/i/gamestop/10136578_10143556_10167176_10171354_10171355_SCR17/NieR-Automata-Game-of-the-Yorha-Edition?$screen2x$,https://media.gamestop.com/i/gamestop/10136578_10143556_10167176_10171354_10171355_SCR16/NieR-Automata-Game-of-the-Yorha-Edition?$screen2x$,https://media.gamestop.com/i/gamestop/10136578_10143556_10167176_10171354_10171355_SCR15/NieR-Automata-Game-of-the-Yorha-Edition?$screen2x$,https://media.gamestop.com/i/gamestop/10136578_10143556_10167176_10171354_10171355_SCR14/NieR-Automata-Game-of-the-Yorha-Edition?$screen2x$,https://media.gamestop.com/i/gamestop/10136578_10143556_10167176_10171354_10171355_SCR13/NieR-Automata-Game-of-the-Yorha-Edition?$screen2x$,https://media.gamestop.com/i/gamestop/10136578_10143556_10167176_1