	(262, 'The Legend of Zelda Hylian Crest Protection Case for Nintendo Switch Only at GameStop', '\n\n        Take your gaming on the go with this sturdy compact console case designed to fit Nintendo Switch or Nintendo Switch Lite. Inside this Nintendo Switch case you will find a felt lining, Hylian Shield tag, screen-protector flap with storage for six game cards, and zippered mesh storage pocket for small accessories. This portable gaming case featuring Legend of Zelda Hylian Crest gives you the freedom to have fun on the go with your Nintendo Switch. Wherever. Whenever.\n    \n\n\nSturdy outer shell with rubberized handle and durable dual zipper pulls\nOfficially licensed gaming case for Nintendo Switch and Nintendo Switch Lite\nMolded interior with felt lining plus zippered mesh storage fits either system\nBuilt-in padded screen-protector flap includes game storage for six game cards\nNintendo Switch carrying case with two-year limited warranty – visit PowerA.com/Support\n\n\n\n', 1998, 'https://media.gamestop.com/i/gamestop/11105076/PowerA-Protection-Case-for-Nintendo-Switch-The-Legend-of-Zelda-Hylian-Crest-GameStop-Exclusive?$pdp2x$,https://media.gamestop.com/i/gamestop/11105076_ALT01/PowerA-Protection-Case-for-Nintendo-Switch-The-Legend-of-Zelda-Hylian-Crest-GameStop-Exclusive?$pdp2x$,https://media.gamestop.com/i/gamestop/11105076_ALT02/PowerA-Protection-Case-for-Nintendo-Switch-The-Legend-of-Zelda-Hylian-Crest-GameStop-Exclusive?$pdp2x$,https://media.gamestop.com/i/gamestop/11105076_ALT03/PowerA-Protection-Case-for-Nintendo-Switch-The-Legend-of-Zelda-Hylian-Crest-GameStop-Exclusive?$pdp2x$,https://media.gamestop.com/i/gamestop/11105076_ALT04/PowerA-Protection-Case-for-Nintendo-Switch-The-Legend-of-Zelda-Hylian-Crest-GameStop-Exclusive?$pdp2x$,https://media.gamestop.com/i/gamestop/11105076_ALT05/PowerA-Protection-Case-for-Nintendo-Switch-The-Legend-of-Zelda-Hylian-Crest-GameStop-Exclusive?$pdp2x$,https://media.gamestop.com/i/gamestop/11105076_ALT06/PowerA-Protection-Case-for-Nintendo-Switch-The-Legend-of-Zelda-Hylian-Crest-GameStop-Exclusive?$pdp2x$,https://media.gamestop.com/i/gamestop/11105076_ALT07/PowerA-Protection-Case-for-Nintendo-Switch-The-Legend-of-Zelda-Hylian-Crest-GameStop-Exclusive?$pdp2x$,', 25, 25),
	(263, 'Mickey Mouse Console Skin for Xbox Series S', '\n\n        The Mickey Mouse Xbox Series S Console Skin is made from a 3M durable auto-grade vinyl for an ultimate lightweight Xbox Series S Console decal protection without the bulk. Every Skinit Mickey Mouse skin is officially licensed by Disney for an authentic brand design. The Mickey Mouse Mickey Mouse Microsoft Xbox Series S Console decal skin is engineered to feature vibrant photo quality designs and to perfectly fit your Xbox Series S Console The Mickey Mouse Mickey Mouse skin can be easily applied and removed from your Xbox Series S Console with no residue, no mess and no fuss due to 3M adhesive backing. This makes it even easier for you to mix up your Xbox Series S Console style as much as you want to keep your device feeling new. All Skinit made decal skins are cut and crafted with everyday Xbox Series S Console uses in mind so that each Mickey Mouse skin offers a premium feel with a thin functional protection. Shop all officially licensed Mickey Mouse Microsoft Xbox Series S Console skins made by Skinit and make it yours today!\n    \n\nUltra-Thin, Lightweight Xbox Series S Console Vinyl Decal ProtectionOffically Licensed Disney DesignIndustry Leading Vivid Color Vinyl Print TechnologyScratch - Resistant. Built To Last Everday Xbox Series S Console Use3M Adhesive Backing - Easy On, Easy Off & Residue-Free\n\n\n\n', 2499, 'https://media.gamestop.com/i/gamestop/11132471/Mickey-Mouse-Console-Skin-for-Xbox-Series-S?$pdp2x$,https://media.gamestop.com/i/gamestop/11132471_ALT01/Mickey-Mouse-Console-Skin-for-Xbox-Series-S?$pdp2x$,https://media.gamestop.com/i/gamestop/11132471_ALT02/Mickey-Mouse-Console-Skin-for-Xbox-Series-S?$pdp2x$,https://media.gamestop.com/i/gamestop/11132471_ALT03/Mickey-Mouse-Console-Skin-for-Xbox-Series-S?$pdp2x$,', 8, 12),
	(264, 'Sailor Moon Luna/Artemis Mug Gamestop Exclusive', '\n\n        16 oz. Sailor Moon mug features Luna and Artemis printed on a matte metallic glitter purple mug.\n    \n\n\n\n16 ounces\nSailor Moon mug\nFeatures Luna and Artemis\nPrinted on a matte metallic glitter purple mug\nGameStop Exclusive\n\n\n\n\n\n', 1499, 'https://media.gamestop.com/i/gamestop/11162602/Sailor-Moon-Luna/Artemis-Mug-Gamestop-Exclusive?$pdp2x$,', 105, 75),
	(265, 'Cyber Stadium Series: Base Wars - Nintendo', 'None', 999, 'https://media.gamestop.com/i/gamestop/10152457/Cyber-Stadium-Series-Base-Wars---Nintendo?$pdp2x$,', 65, 43),
	(266, 'Baseus Mini Q 10000mAh Power Bank and Hand Warmer', '\n\n        Baseus Mini Q Power Bank features a hand warmer function – perfect for those cold winter days!\n    \n\nMORE DETAILS:\n\nCapacity (mAh): 10000\nConnector type: USB. USB Type-C. micro USB\nDimensions: 102x65x28mm\nOutput USB: 5V 2.1A\n\n\n\n\n\nFEATURES\n\nFor emergency cellphone charging\nKeeps your phone, tablet and other battery powered devices charged\nWill warm your hands on a chilly day\nHand warmer provides up to 12 hours of warmth on a single charge\n\n\n\n\n\n\n', 2295, 'https://media.gamestop.com/i/gamestop/11179618/Baseus-Mini-Q-10000mAh-Power-Bank-and-Hand-Warmer?$pdp2x$,https://media.gamestop.com/i/gamestop/11179618_ALT01/Baseus-Mini-Q-10000mAh-Power-Bank-and-Hand-Warmer?$pdp2x$,https://media.gamestop.com/i/gamestop/11179618_ALT02/Baseus-Mini-Q-10000mAh-Power-Bank-and-Hand-Warmer?$pdp2x$,', 106, 76),
	(267, 'POP! Marvel: Infamous Iron Man', '\n\n        Pop! Marvel Infamous Iron Man is ready to join your Marvel vinyl bobble-head collection! Vinyl bobble-head is approximately 3.75-inches tall.\n    \n\n\n', 1299, 'https://media.gamestop.com/i/gamestop/11103938/POP-Marvel-Infamous-Iron-Man?$pdp2x$,https://media.gamestop.com/i/gamestop/11103938_ALT01/POP-Marvel-Infamous-Iron-Man?$pdp2x$,https://media.gamestop.com/i/gamestop/11103938_ALT02/POP-Marvel-Infamous-Iron-Man?$pdp2x$,https://media.gamestop.com/i/gamestop/11103938_ALT03/POP-Marvel-Infamous-Iron-Man?$pdp2x$,https://media.gamestop.com/i/gamestop/11103938_ALT04/POP-Marvel-Infamous-Iron-Man?$pdp2x$,', 1, 1),
	(268, 'When Irish Eyes Are Smiling Lyrics Clover Word Art  Small Tote Bag', '\n\nPage Title Created using the Lyrics to When The Saints Go Marching In Created using the Lyrics to When The Saints Go Marching In\n \nThe English translation of "fleur-de-lis" is "flower of the lily." This symbol, depicting a stylized lily or lotus flower, has many meanings. Traditionally, it has been used to represent French royalty, and also said to signify perfection, light, and life. The Fleur De Lis has also become synonymous with New Orleans, as the Saints have worn it on their uniform since 1967. Since the devastating storms during Hurricane Katrina, the Fleur De Lis has become the symbol of the city of New Orleans as well. It is a recognizable sign to those who are far away from home as well as for those trying to rebuild and come back. Since the Fleur De Lis is so synonymous with New Orleans, what better song to create this image out of than the song most recognized with the city, "When The Saints Go Marching In". A true jazz standard most widely known from the version by Louis Armstrong, it has also been sung by many other great musicians such as Fats Domino, The Beatles, Elvis Presley and Bruce Springsteen.\n \n\n\nMATERIAL - 100% CottonFEATURES - Tote size 15 x 16 with a 9" handle drop PRINTED WITH PRIDE IN THE USA- All of our products are printed and shipped from Las Vegas, Nevada USA.\n\n\n\n', 1299, 'https://media.gamestop.com/i/gamestop/11143370/When-Irish-Eyes-Are-Smiling-Lyrics-Clover-Word-Art--Small-Tote-Bag?$pdp2x$,https://media.gamestop.com/i/gamestop/11143370_ALT01/When-Irish-Eyes-Are-Smiling-Lyrics-Clover-Word-Art--Small-Tote-Bag?$pdp2x$,', 2, 2),
	(269, 'Star Wars Episode VIII: The Last Jedi BB-8 Cufflinks', '\n\n        8 BB-8 Stainless Steel Cufflinks. Styles for every occasion. Superior quality and style.\n    \n\n\n', 5099, 'https://media.gamestop.com/i/gamestop/11110885/Star-Wars-Episode-VIII-The-Last-Jedi-BB-8-Cufflinks?$pdp2x$,https://media.gamestop.com/i/gamestop/11110885_ALT01/Star-Wars-Episode-VIII-The-Last-Jedi-BB-8-Cufflinks?$pdp2x$,https://media.gamestop.com/i/gamestop/11110885_ALT02/Star-Wars-Episode-VIII-The-Last-Jedi-BB-8-Cufflinks?$pdp2x$,', 99, 77),
	(270, 'Bandai Pretty Guardian Sailor Moon Sailor Uranus Animation Color Edition S.H.Figuarts 4-in Action Figure', '\n\n        Sailor Uranus joins the popular Pretty Guardian Sailor Moon -Animation Color Edition- series! Featuring all of the gorgeously accurate detail and high posability fans expect from S.H.Figuarts, this updated portrayal of the character features new packaging, too. Optional crossed arms and a Space Sword let you re-create your favorite scenes, and the figure also includes "heart eyes" for the S.H.Figuarts Pretty Guardian Sailor Moon -Animation Color Edition- figure (sold separately).\n    \n\nFEATURES:\n\nMeasures 4" tall\nHighly detailed\nSailor Uranus from Sailor Moon\nHigh posability\n[Set Contents] Main Body, Three optional expression parts, "Heart Eyes" expression part for S.H.Figuarts Pretty Guardian Sailor Moon-Animation Color Edition- figure (sold separately), Five left and eight right hands, Crossed arm part, Space Sword, Stand\n\n\n\n\n', 5999, 'https://media.gamestop.com/i/gamestop/11112071/Bandai-Pretty-Guardian-Sailor-Moon-Sailor-Uranus-Animation-Color-Edition-S.H.Figuarts-4-in-Action-Figure?$pdp2x$,', 12, 7),
	(271, 'Batman The Dark Knight Rises Console Skin for PlayStation 5', '\n\n        The DC Comics Batman PS5 Console Skin is made from a 3M durable auto-grade vinyl for an ultimate lightweight PS5 Console decal protection without the bulk. Every Skinit Batman skin is officially licensed by Warner Bros for an authentic brand design. The Batman Batman Dark Knight Rises Sony PS5 Console decal skin is engineered to feature vibrant photo quality designs and to perfectly fit your PS5 Console The Batman Batman Dark Knight Rises skin can be easily applied and removed from your PS5 Console with no residue, no mess and no fuss due to 3M adhesive backing. This makes it even easier for you to mix up your PS5 Console style as much as you want to keep your device feeling new. All Skinit made decal skins are cut and crafted with everyday PS5 Console uses in mind so that each Batman skin offers a premium feel with a thin functional protection. Shop all officially licensed DC Comics Batman Sony PS5 Console skins made by Skinit and make it yours today!\n    \n\nUltra-Thin, Lightweight PS5 Console Vinyl Decal ProtectionOffically Licensed Warner Bros DesignIndustry Leading Vivid Color Vinyl Print TechnologyScratch - Resistant. Built To Last Everday PS5 Console Use3M Adhesive Backing - Easy On, Easy Off & Residue-Free\n\n\n\n', 2499, 'https://media.gamestop.com/i/gamestop/11119091/Batman-The-Dark-Knight-Rises-Console-Skin-for-PlayStation-5?$pdp2x$,https://media.gamestop.com/i/gamestop/11119091_ALT01/Batman-The-Dark-Knight-Rises-Console-Skin-for-PlayStation-5?$pdp2x$,', 8, 8),
	(272, 'TygerClaw 17-in to 30-in Double Extending Gas Spring Arms Monitor Desk Mount', '\n\n        TygerClaw double extending arm monitor desk mount is an ideal mount for any home and office. This helps you free up valuable desk space and also places the monitors at your desired viewing position. Its compatible with VESA hole pattern up to 100mm x 100 mm\n    \n\n        TygerClaw double extending arm monitor desk mount is an ideal mount for any home and office. This helps you free up valuable desk space and also places the monitors at your desired viewing position. Its compatible with VESA hole pattern up to 100mm x 100 mm\n    \n\n\n', 24399, 'https://media.gamestop.com/i/gamestop/11150362/TygerClaw-17-in-to-30-in-Double-Extending-Gas-Spring-Arms-Monitor-Desk-Mount?$pdp2x$,', 107, 78),
	(273, 'Overcooked Gourmet Edition - Xbox One', '\n\nThe Overcooked Gourmet Edition stirs together the smash hit co-op cooking game and the Lost Morsel content pack into one delicious package that will test your culinary skills to the limit!\nOvercooked is a chaotic couch co-op cooking game for one to four players. Working as a team, you and your fellow chefs must prepare, cook and serve up a variety of tasty orders before the baying customers storm out in a huff. Sharpen your knives and dust off your chef’s whites, there isn’t mushroom for error and the steaks are high in these crazy kitchens!\nThe Overcooked Lost Morsel content pack continues the chefs’ crazy culinary adventure through six new campaign levels, featuring challenging new kitchens set in an exotic jungle world, a new vehicle to navigate the world map in and six new chef characters to unlock!\n\n\n\n\nA new type of culinary co-op gameThe Onion Kingdom is a rich world full of cruel and unusual kitchens for you to conquerSimple controls, deep challengeAs you play the game, you\'ll unlock new levels, new chef characters and even competitive challenge levels which allow teams of 2 to go head-to-head in the kitchenIncludes exclusive DLC, The Last Morsel, which includes 6 new levels, a new desert island world, 6 new wild and wacky chefs to play as\n\n\n\n\n\n', 1499, 'https://media.gamestop.com/i/gamestop/10136814/Overcooked-Gourmet-Edition---Xbox-One?$pdp2x$,', 108, 15),
	(274, 'Pokemon Lugia Plush GameStop Exclusive', '\n\n        The cute and cuddly 12-inch Lugia plush is here! Lugia is one of the most popular Legendary Pokémon and now you can take it with you on all of your adventures! With incredible detail that looks like it has jumped right from the Pokémon Animated Series, this Gamestop Exclusive Lugia plush is the perfect gift for Pokémon fans of all ages!  Gotta Catch \'Em All!? An Officially licensed Pokémon product from Wicked Cool Toys, a Jazwares Company!\n    \n\n\nThis cute and cuddly 12" Lugia plush is a must-have for all Pokémon fans!\nThis super-soft plush is great to take wherever you go!\nThis Lugia plush is inspired by smash-hit Pokémon Animated Series!\nA Gamestop Exclusive Pokémon Plush!\nGotta Catch \'Em All!?\nAn Officially licensed Pokémon product from Wicked Cool Toys, a Jazwares Company!\nAges: 2+\n\n\n\n', 1998, 'https://media.gamestop.com/i/gamestop/11100723/Pokemon-Lugia-Plush-GameStop-Exclusive?$pdp2x$,https://media.gamestop.com/i/gamestop/11100723_ALT01/Pokemon-Lugia-Plush-GameStop-Exclusive?$pdp2x$,', 109, 48),
	(275, 'JaRu Mega Grow Egg Dinosaur', '\n\n        Place egg in water and watch it grow!  Takes up to 10 days to fully grow and can get up to 18"!\n    \n\n\n', 299, 'https://media.gamestop.com/i/gamestop/11167280/JaRu-Mega-Grow-Egg-Dinosaur?$pdp2x$,https://media.gamestop.com/i/gamestop/11167280_ALT01/JaRu-Mega-Grow-Egg-Dinosaur?$pdp2x$,', 110, 6),
	(276, 'Hasbro Marvel Legends Series Doctor Strange in the Multiverse of Madness Wong 6-in Action Figure', '\n\n        Wong takes over for The Ancient One as Sorcerer Supreme and leader of Kamar-Taj, teaching a new era of sorcerers to protect our reality from mystical threats.\n    \n\nWith over 80 years of entertainment history, Marvel has become a cornerstone of fan collections around the world. With the Marvel Legends Series, fan favorite Marvel Comic Universe and Marvel Cinematic Universe characters are designed with premium detail and articulation for posing and display in collections. From figures to vehicles to premium roleplay items, the Marvel Legends Series offers elite character-inspired product for Marvel fans and collectors. Additional figures each sold separately. Subject to availability.\nMORE DETAILS:\n\nIncludes: figure, 4 accessories, 1 Build-A-Figure Part\nFigure scale: 6 inches\nAges 4 and up.\n\n\n\n\n\n\n6-INCH-SCALE COLLECTIBLE FIGURE - Fans, collectors, and kids can enjoy this 6-inch-scale Marvel&rsquo;s Wong figure, inspired by the character from Marvel Studios\' Doctor Strange in the Multiverse of Madness\nINSPIRED BY THE MARVEL CINEMATIC UNIVERSE - This 6-inch scale Marvel&rsquo;s Wong figure features premium movie-inspired design, detail, and articulation for posing and display in your Marvel collection\nPREMIUM ARTICULATION AND ACCESSORIES - This 6-inch Legends Series Doctor Strange figure features multiple points of articulation and movie-inspired accessories, including alternate hands and sword accessory!\nMARVEL UNIVERSE IN 6-INCH SCALE - Look for other Marvel Legends action figures inspired by the Marvel Cinematic Universe, including Doctor Strange, America Chavez, and Master Mordo. (Additional figures each sold separately. Subject to availability.)\nINCLUDES BUILD-A-FIGURE PART(S) (RINTRAH) - Each Marvel Legends Doctor Strange figure includes at least one Build-A-Figure piece. Collect all the figures to assemble an additional figure (Additional figures each sold separately. Subject to availability.)\n\n\n\n\n\n\n', 2299, 'https://media.gamestop.com/i/gamestop/11160327/Hasbro-Marvel-Legends-Series-Doctor-Strange-in-the-Multiverse-of-Madness-Wong-6-in-Action-Figure?$pdp2x$,https://media.gamestop.com/i/gamestop/11160327_ALT01/Hasbro-Marvel-Legends-Series-Doctor-Strange-in-the-Multiverse-of-Madness-Wong-6-in-Action-Figure?$pdp2x$,https://media.gamestop.com/i/gamestop/11160327_ALT03/Hasbro-Marvel-Legends-Series-Doctor-Strange-in-the-Multiverse-of-Madness-Wong-6-in-Action-Figure?$pdp2x$,https://media.gamestop.com/i/gamestop/11160327_ALT04/Hasbro-Marvel-Legends-Series-Doctor-Strange-in-the-Multiverse-of-Madness-Wong-6-in-Action-Figure?$pdp2x$,https://media.gamestop.com/i/gamestop/11160327_ALT05/Hasbro-Marvel-Legends-Series-Doctor-Strange-in-the-Multiverse-of-Madness-Wong-6-in-Action-Figure?$pdp2x$,https://media.gamestop.com/i/gamestop/11160327_ALT06/Hasbro-Marvel-Legends-Series-Doctor-Strange-in-the-Multiverse-of-Madness-Wong-6-in-Action-Figure?$pdp2x$,', 24, 7),
	(277, 'Hasbro Star Wars: The Mandalorian - The Mandalorian Retro Collection 3.75-in Action Figure', '\n\n        The Mandalorian is battle-worn and tight-lipped, a formidable bounty hunter in an increasingly dangerous galaxy.\n\nKids and collectors alike can imagine the biggest battles and missions in the Star Wars saga with figures from Star Wars Retro Collection! With exquisite features and decoration, this series embodies the quality and realism that Star Wars devotees love. Star Wars Retro Collection includes figures from the 40-plus-year legacy of the Star Wars Galaxy, including movies and live-action series. (Additional products each sold separately. Subject to availability.)\n\nThe 3.75-inch-scale Retro Collection figure is detailed to look like The Mandalorian character from The Mandalorian live-action series on Disney Plus, featuring design and detailing inspired by 1970s Star Wars figures.\n    \n\n\nSTAR WARS RETRO COLLECTION: The Star Wars Retro Collection features design and detailing inspired by the original 1970s Star Wars figures \n\nKENNER-INSPIRED PACKAGING: The Star Wars Retro Collection 3.75-inch-scale figures feature classic Kenner branding, as well as packaging treated with a weathered look (Each sold separately. Subject to availability.)\n\nTHE MANDALORIAN SERIES-INSPIRED DESIGN: Fans and collectors can imagine scenes from the Star Wars Galaxy with this premium The Mandalorian toy, inspired by the live-action series on Disney Plus\n\nSERIES-BASED CHARACTER-INSPIRED ACCESSORIES: This Star Wars Retro Collection 3.75-inch-scale action figure comes with 3 entertainment-inspired accessories and makes a great addition to any Star Wars collection\n\nKENNER-INSPIRED ARTICULATION AND DETAILING: Star Wars fans and collectors can display this figure, featuring five points of articulation, in their action figure and vehicle collection\n \nIncludes: figure and 3 accessories. \nFigure scale: 3.75 inches\nAges 4 and up\nWARNING: CHOKING HAZARD - Small parts. Not for children under 3 years.\n\n\n\n\n', 1299, 'https://media.gamestop.com/i/gamestop/11109027/Hasbro-Star-Wars-The-Mandalorian---The-Mandalorian-Retro-Collection-3.75-in-Action-Figure?$pdp2x$,https://media.gamestop.com/i/gamestop/11109027_ALT01/Hasbro-Star-Wars-The-Mandalorian---The-Mandalorian-Retro-Collection-3.75-in-Action-Figure?$pdp2x$,', 24, 7),
	(278, 'Tokidoki Mermicorno Blind Box Series 5 Mermicornos 2.75-In Figure', '\n\n        Grab your goggles and swimsuit and get ready for an undersea adventure with Mermicorno Blind Box Series 5! These 8 new Mermicornos are full of the beauty and mystery of the ocean and ready to join your collection. Dive into a world of wonder with new Mermicorno Blind Box Series 5! Characters in this series include: Azzurra, Lil\' Red, Doodle, Johnny D, Flower Princess, Stinger, Kaikoura, and Love Note.\n    \n\n\n\nEach blind box contains one character sealed in a silver foil bag (chosen at random)\nEach figure stands at approximately 2.75 inches high (7cm)\nFeatures may include transparent details and more!\nPaper insert listing all of the characters in this collection is included\nRecommended for ages 8 and up\n\n\n\n\n\n', 1200, 'https://media.gamestop.com/i/gamestop/11155249/Tokidoki-Mermicorno-Blind-Box-Series-5-Mermicornos-2.75-In-Figure?$pdp2x$,https://media.gamestop.com/i/gamestop/11155249_ALT01/Tokidoki-Mermicorno-Blind-Box-Series-5-Mermicornos-2.75-In-Figure?$pdp2x$,', 111, 7),
	(279, 'The Surge 2 - PlayStation 4', '\n\n        On the way to Jericho City, your plane is shot down by a mysterious storm and crash-lands in the outskirts. You wake up weeks later in a derelict detention facility inside the city. Armor-clad soldiers enforce Martial Law, robots are on a rampage, and a dark, expanding nanostorm looms over the cityscape...\n    \n\n\n', 999, 'https://media.gamestop.com/i/gamestop/11103188/The-Surge-2---PlayStation-4?$pdp2x$,', 104, 26),
	(280, 'Watch Dogs: Legion 500 Credits', '\n\n        500 in-game credits for Watch Dogs: Legion. Use these credits to purchase extra cosmetic items, in-game currency, resources, operatives, and more!\n    \n\n\n', 499, 'https://media.gamestop.com/i/gamestop/11108961/Watch-Dogs-Legion-500-Credits?$pdp2x$,', 33, 26),
	(281, 'Skinit Punisher Long Skull Skin Bundle for PlayStation 4', '\n\n        The Marvel Punisher PS4 Console and Controller Bundle Skin is made from a 3M durable auto-grade vinyl for an ultimate lightweight PS4 Console and Controller Bundle decal protection without the bulk. Every Skinit Punisher skin is officially licensed by Marvel/Disney for an authentic brand design. The Punisher Punisher Long Skull Sony PS4 Console and Controller Bundle decal skin is engineered to feature vibrant photo quality designs and to perfectly fit your PS4 Console and Controller Bundle The Punisher Punisher Long Skull skin can be easily applied and removed from your PS4 Console and Controller Bundle with no residue, no mess and no fuss due to 3M adhesive backing. This makes it even easier for you to mix up your PS4 Console and Controller Bundle style as much as you want to keep your device feeling new. All Skinit made decal skins are cut and crafted with everyday PS4 Console and Controller Bundle uses in mind so that each Punisher skin offers a premium feel with a thin functional protection. Shop all officially licensed Marvel Punisher Sony PS4 Console and Controller Bundle skins made by Skinit and make it yours today!\n    \n\nUltra-Thin, Lightweight PS4 Console and Controller Bundle Vinyl Decal ProtectionOffically Licensed Marvel/Disney DesignIndustry Leading Vivid Color Vinyl Print TechnologyScratch - Resistant. Built To Last Everday PS4 Console and Controller Bundle Use3M Adhesive Backing - Easy On, Easy Off and Residue-Free\n\n\n\n', 3999, 'https://media.gamestop.com/i/gamestop/11115325/Skinit-Punisher-Long-Skull-Skin-Bundle-for-PlayStation-4?$pdp2x$,https://media.gamestop.com/i/gamestop/11115325_ALT01/Skinit-Punisher-Long-Skull-Skin-Bundle-for-PlayStation-4?$pdp2x$,https://media.gamestop.com/i/gamestop/11115325_ALT02/Skinit-Punisher-Long-Skull-Skin-Bundle-for-PlayStation-4?$pdp2x$,https://media.gamestop.com/i/gamestop/11115325_ALT03/Skinit-Punisher-Long-Skull-Skin-Bundle-for-PlayStation-4?$pdp2x$,', 8, 26),
	(282, 'Sonix MagSafe Case for iPhone 12/12 Pro Purple Rain', '\n\n        Purple Rain, MagSafe? Compatible iPhone case features a blend of magenta and purple brush strokes with purple glitter to finish. Pretty & Bold. Essentials you want.\n    \n\nUnlike others, the actual material of our cases are antimicrobial (this is not your average surface coating). The antimicrobial agent is injected and mixed into the plastic during production. This ensures that the antimicrobial protection won’t chip away nor deteriorate with use.\n*Our cases are designed with built-in magnets to support the MagSafe? wireless charging feature.\n\n\n\n\n\nMagSafe?* compatible\nAntimicrobial material\nGrooved impact resistant corners for added protection\nRaised bumper around camera hole\nFeaturing Sonix’s statement-making print design with foil details\nSleek, lightweight case\n10 ft. drop protection\nScratch-resistant, protective coating, with raised shock-absorbent sides for full 360o protection\nIncludes Sonix Limited Lifetime Warranty\n\n\n\n\n\n\n', 3599, 'https://media.gamestop.com/i/gamestop/11157713/Sonix-MagSafe-Case-for-iPhone-12/12-Pro-Purple-Rain?$pdp2x$,https://media.gamestop.com/i/gamestop/11157713_ALT01/Sonix-MagSafe-Case-for-iPhone-12/12-Pro-Purple-Rain?$pdp2x$,https://media.gamestop.com/i/gamestop/11157713_ALT02/Sonix-MagSafe-Case-for-iPhone-12/12-Pro-Purple-Rain?$pdp2x$,https://media.gamestop.com/i/gamestop/11157713_ALT03/Sonix-MagSafe-Case-for-iPhone-12/12-Pro-Purple-Rain?$pdp2x$,', 32, 32),
	(283, 'Fairy Tail Emblem Controller Skin for Xbox Series X', '\n\n        The Fairy Tail Xbox Series X Controller Skin is made from a 3M durable auto-grade vinyl for an ultimate lightweight Xbox Series X Controller decal protection without the bulk. Every Skinit Fairy Tail skin is officially licensed by Group 1200 for an authentic brand design. The Fairy Tail Fairy Tail Emblem Microsoft Xbox Series X Controller decal skin is engineered to feature vibrant photo quality designs and to perfectly fit your Xbox Series X Controller The Fairy Tail Fairy Tail Emblem skin can be easily applied and removed from your Xbox Series X Controller with no residue, no mess and no fuss due to 3M adhesive backing. This makes it even easier for you to mix up your Xbox Series X Controller style as much as you want to keep your device feeling new. All Skinit made decal skins are cut and crafted with everyday Xbox Series X Controller uses in mind so that each Fairy Tail skin offers a premium feel with a thin functional protection. Shop all officially licensed Fairy Tail Microsoft Xbox Series X Controller skins made by Skinit and make it yours today!\n    \n\nUltra-Thin, Lightweight Xbox Series X Controller Vinyl Decal ProtectionOffically Licensed Group 1200 DesignIndustry Leading Vivid Color Vinyl Print TechnologyScratch - Resistant. Built To Last Everday Xbox Series X Controller Use3M Adhesive Backing - Easy On, Easy Off & Residue-Free\n\n\n\n', 1599, 'https://media.gamestop.com/i/gamestop/11129468/Fairy-Tail-Emblem-Controller-Skin-for-Xbox-Series-X?$pdp2x$,https://media.gamestop.com/i/gamestop/11129468_ALT01/Fairy-Tail-Emblem-Controller-Skin-for-Xbox-Series-X?$pdp2x$,https://media.gamestop.com/i/gamestop/11129468_ALT02/Fairy-Tail-Emblem-Controller-Skin-for-Xbox-Series-X?$pdp2x$,https://media.gamestop.com/i/gamestop/11129468_ALT03/Fairy-Tail-Emblem-Controller-Skin-for-Xbox-Series-X?$pdp2x$,', 8, 12),
	(284, 'Funkoverse Strategy Game Harry Potter 100', '\n\n        In the Funkoverse Strategy Game - Harry Potter 100, you\'ll combine your favorite characters and go\nhead-to-head in four exciting game scenarios. Move through memorable locations – Diagon Alley or the\nRoom of Requirement – and use your characters\' unique abilities to capture points and achieve victory!\n    \n\n\nLight strategy game\nIncludes 2 playable maps: Diagon Alley and the Room of Requirement.\nPlay as a stand-alone game or mix with other Harry Potter? Funkoverse games!\n\nGame Contents:\n\n4 Characters\n4 Character Bases\n4 Character Cards\n2 Basic Characters\n2 Basic Character Cards\n2 Double-Sided Scenario Cards\n1 Dagger\n1 Felix Felicis\n2 Item Cards\n4 Status Cards\n2 Cooldown Tracks\n1 Double-Sided Map\n8 Game Tokens\n15 Game Markers\n6 Dice\n21 Points\n1 First Player Marker\nInstructions\n\nGame Details:\n\nPublished by Funko Games\nCollectible Strategy Game\nExclusive Funkoverse Pop! Game Figures\nAges 10 and up\n2 players\n20 – 60 minutes\n\n\n\n\n', 1997, 'https://media.gamestop.com/i/gamestop/11053680/Funkoverse-Strategy-Game-Harry-Potter-100?$pdp2x$,https://media.gamestop.com/i/gamestop/11053680_ALT01/Funkoverse-Strategy-Game-Harry-Potter-100?$pdp2x$,', 1, 11),
	(285, 'Sniper Elite 4 - Nintendo Switch', '\n\n        Sniper Elite 4 is the most widely acclaimed entry in Rebellion\'s sharpshooter series, which has sold more than 20 million units worldwide. It continues the series\' heritage of thrilling World War Two action, taking players to the lush Mediterranean landscapes of Italy, 1943 where the Resistance fights to defeat a terrifying new threat to the Allied fightback.\n    \n\nSniper Elite 4 combines emergent stealth action with unrivalled sniping freedom in huge maps brimming with tactical possibilities. Switch owners can look forward to:\n\nGenre-leading sniping defined by advanced, authentic ballistics\nAn expansive campaign featuring massive maps and boundless strategy\nTrademark X-Ray kill cams, including melee and explosive takedowns\nIconic WW2 weaponry; sniper rifles, pistols, SMGs, traps, grenades and more\nUpgrade and customize your skills and weaponry as you progress\nTactical traversal mechanics; climb, hang, shimmy and leap across maps!\nAnd much more\n\nOn Nintendo Switch, Sniper Elite 4 offers exclusive new features including:\n\nMotion aim with gyroscopic controls\nHD rumble support- feel your heartbeat and bullet impacts!\nPro Controller support to take your precision up a level\n\nStay tuned for more info on Sniper Elite 4 for Switch ahead of its release later this year.\nFinally, Rebellion, Sold Out and GSE are partnering to release Sniper Elite 4 for the first time in Japan on PlayStation 4. Look out for more news soon.\n\n\n\n', 2499, 'https://media.gamestop.com/i/gamestop/11109019/Sniper-Elite-4---Nintendo-Switch?$pdp2x$,https://media.gamestop.com/i/gamestop/11109019_SCR05/Sniper-Elite-4---Nintendo-Switch?$screen2x$,https://media.gamestop.com/i/gamestop/11109019_SCR04/Sniper-Elite-4---Nintendo-Switch?$screen2x$,https://media.gamestop.com/i/gamestop/11109019_SCR03/Sniper-Elite-4---Nintendo-Switch?$screen2x$,https://media.gamestop.com/i/gamestop/11109019_SCR02/Sniper-Elite-4---Nintendo-Switch?$screen2x$,https://media.gamestop.com/i/gamestop/11109019_SCR01/Sniper-Elite-4---Nintendo-Switch?$screen2x$,https://media.gamestop.com/i/gamestop/11109019_SCR05/Sniper-Elite-4---Nintendo-Switch?$screen$,https://media.gamestop.com/i/gamestop/11109019_SCR04/Sniper-Elite-4---Nintendo-Switch?$screen$,https://media.gamestop.com/i/gamestop/11109019_SCR03/Sniper-Elite-4---Nintendo-Switch?$screen$,https://media.gamestop.com/i/gamestop/11109019_SCR02/Sniper-Elite-4---Nintendo-Switch?$screen$,https://media.gamestop.com/i/gamestop/11109019_SCR01/Sniper-Elite-4---Nintendo-Switch?$screen$', 108, 25),
	(286, 'PlayStation Logo T-Shirt', '\n\nPLAYSTATION LOGO AD T\n\n\n\nGraphic Tee\n\n\n\n\n', 1998, 'https://media.gamestop.com/i/gamestop/11110211/PlayStation-Logo-T-Shirt?$pdp2x$,', 112, 5),
	(287, 'Dear Esther: Landmark Edition', '\n\n        ”A deserted island... a lost man... memories of a fatal crash... a book written by a dying explorer." The critically acclaimed Dear Esther is finally available for Xbox One.\n\nDear Esther immerses you in a stunningly realised world, a remote and\ndesolate island somewhere in the outer Hebrides. As you step forwards, a voice begins to read fragments of a letter: "Dear Esther..." - and so begins a journey through one of the most original first-person games of recent years.\n\nAbandoning traditional gameplay for a pure story-driven experience, Dear Esther fuses its beautiful environments with a breathtaking soundtrack to tell a powerful story of love, loss, guilt and redemption.\n\nDear Esther: Landmark Edition features a Directors\' Commentary mode that allows players to explore the island and learn what inspired the game and how it was crafted by The Chinese Room and Rob Briscoe.\n    \n\n\n', 999, 'https://media.gamestop.com/i/gamestop/10150985/Dear-Esther-Landmark-Edition?$pdp2x$,', 113, 15),
	(288, 'Felix Gray Roebling Narrow/Medium Frame Blue Light Glasses', '\n\n        Housed in beautiful frames handcrafted from Italian Acetate. A sophisticated circular shape that fits perfectly on almost any face shape. The Roebling’s signature keyhole bridge and terrific frame sits beautifully and comfortably as you look at your screen.\n    \n\nAbout Felix Gray: Felix Gray cuts through false claims, poor quality add-on coatings, and ineffective dyes that “block” Blue Light. Instead, their proprietary Blue Light filtering solution filters 15x more Blue Light. With Felix Gray, you don\'t have to sacrifice style for function. When they say their eyewear does more, they mean it.\n\n\n\n\nHoused in beautiful frames handcrafted from Italian Acetate\nA sophisticated circular shape that fits perfectly on almost any face shape\nThe Roebling’s signature keyhole bridge and terrific frame sits beautifully and comfortably as you look at your screen\n\n\n\n\n\n', 9500, 'https://media.gamestop.com/i/gamestop/11164797/Felix-Gray-Roebling-Narrow/Medium-Frame-Blue-Light-Glasses?$pdp2x$,https://media.gamestop.com/i/gamestop/11164797_ALT01/Felix-Gray-Roebling-Narrow/Medium-Frame-Blue-Light-Glasses?$pdp2x$,https://media.gamestop.com/i/gamestop/11164797_ALT02/Felix-Gray-Roebling-Narrow/Medium-Frame-Blue-Light-Glasses?$pdp2x$,', 114, 79);
